INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '454', 'THE DROPPER: REVOLUTION I', 'This is one of the most beautiful and challenging dropper maps! It includes 12 droppers with amazing effects and structures. All you have to do is drop down and land on a water.\n\nSome levels are easy, others are more difficult. Careful, there are fake water blocks in some places to trick you!\n\nI hope you enjoy it. Have fun!\n\nNOTE: ALL JUMPS POSSIBLE! DON''T RAGE QUIT! :)\n\nEstimated Game Play Time: 25-35 Minutes\n\nNote: this map was ported from Java to Bedrock edition, so it may contain some glitches.\n\nCrеаtоr: CEMREK', 'http://www.minecraftmaps.com/map-maker/cemrek', '', 'i3NplEP', '', 'Game,Droper', '10,0 MB', '1.10+', '0', ''
