      '463', 'Parkour Spiral', 'This is one of the best and challenging parkour maps made for Minecraft. Can you parkour your way to the top of this gigantc spiral?\n\nCreator: Hielke', 'https://mcpedl.com/parkour-spiral-map', '', 'mVUlhg3', '', 'Parkour', '1,22 MB', '1.9.0+', '1', ''
