      '484', 'Toruń - Old Town [city|город]', 'This is a recreation od one of the most beautiful and oldest Polish cities - Toruń, the birthplace of Nicolaus Copernicus.\n\nCreators: AventureStudios', 'https://www.planetminecraft.com/member/aventurestudios/', '', '0DJMNe1', '', 'Creation,City', '7,66 MB', '1.11.0+', '0', ''
