      '496', 'Shiganshina District (Attack on Titan) [city|город]', 'This map is an extremely detailed recreation of Shiganshina District from "Attack on titan".\n\nPlease note: this map is huge and is very detailed, so your Minecraft may freeze or even crash, if your device isn''t powerful enough.\n\n[RUS: Карта очень большая и детализированная, поэтому во время игры на этой карте ваш Майнкрафт может зависать или даже закрыться, если ваше устройство недостаточно мощно.]\n\n\nCrеаtоrs: etherealcat\n-KonosakiLem(etherealcat)\n-Arthur\n-Azr60g\n-CENT & Fumisaka\n-coglelo\n-Dr.Volga\n-ebibagamon\n-Eruca\n-Hagi3\n-Hasukko\n-Hiranya\n-Inist\n-Izakaya\n-Mao\n-Masuneko\n-mihune\n-Morunyau\n-Nieve\n-Nowe\n-Peinto\n-PERO\n-Saya\n-SengokuSan\n-Silent7\n-Sion\n-Sitruc\n-sophia\n-Sui-mi\n-Suirou_Nemi\n-t.s.kai\n-Yukkuwa\n\nPeople that provided architectures:\n-Gazamo', 'https://www.planetminecraft.com/member/etherealcat/', '', 'goPfza9', '', 'Anime,Creation,City', '24,3 MB', '1.8.0+', '0', 'https://www.youtube.com/channel/UCI7G3wPnAbxnzwLPn_LOrIA\nhttps://twitter.com/KonosakiLem'
