INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '497', 'Blip Noir''s Newisle 1.2 [city|город]', 'This is an incredibly detailed modern city that has been in work for more than 9 years now!\n\nThe city consists of multiple unique districts, has a port, downtown with skyscrapers, subway system, museums, cultural objects and many many more! And on top of that all the buildings are fully furnished!\n\nFeatures:\n• Fully furnished interiors in each and every building – hundreds across the world\n• 12 subway lines, highway system and multiple rural rail lines\n• Named streets with roadside maps\n• Neighbourhoods ranging from modern downtowns to historic districts\n• Roleplay features such as shops and schools\n• 7 unique cities and towns in total to explore\n\nIt''s perfect for survival, custom servers, realm playing with friends, roleplaying etc.\n\nCrеаtоr: Blip Noir', 'https://www.planetminecraft.com/member/blip_noir/', '', 'sFQx9tZ', '', 'Creation,City', '126,0 MB', '1.11.0+', '0', 'https://www.youtube.com/channel/UCKUKV55SqAJbCxKXPQ1nRjw'
    );
