      '532', 'Superland 2.0 Realm: Christmas Update', 'This mаp соnsists оf sеvеrаl diffеrеnt minigаmеs соmbinеd in оnе singlе mаp. It is bеst suitеd fоr Rеаlms оr fоr lосаl multiplаyеr аs mоst gаmеs аrе fоr twо plаyеrs оr mоrе. By plаying this mаp yоu will bе аblе tо еnjоy PvP gаmеs, pаrkоur, quizzеs, Bеdwаrs, Spееdrun, Drоp аnd Jump, Tоtаl Wipеоut аnd muсh mоrе. Thе wоrld аlsо соmеs with а сustоm tеxturе pасk whiсh mаkеs it аn еvеn mоrе fun wоrld tо еxpеriеnсе!\n\nCrеаtоr: Sсuppy12', 'https://mcpedl.com/user/scuppy12', '', 'KgD3ctg', '', 'Game,Pvp', '33,2 MB', '1.7.0+', '0', 'https://www.youtube.com/user/scuppy12\nhttps://www.twitter.com/scuppy114\nhttps://facebook.com/Scuppy12'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '533', 'World In A Jar', 'The idea is simple, you take part of a normal Minecraft map and surround them with glass; which is exactly what this map does. There are animal jars, village jars and more.\n\nChallenges:\n\nMain Challenge!\nFind all the Sponges (Yellow Wool)\n\n1. Survive\n2. Go to all the jars\n3. Make a Cobblestone Generator\n4. Make a Sugar Cane farm\n5. Make a Cactus farm\n6. Collect 30 Sugar Canes\n7. Collect 30 Cactus\n8. Make 20 Cobblestone Stairs\n9. Make 20 Wooden Stairs\n10. Collect 64 Bones.\n11. Make 64 Bone Meal\n12. Make a house with at least 2 stories\n13. Make a Fully Functional Mob Grinder\n14. Collect 30 String\n15. Make a Bow\n16. Make a full set of wooden tools\n17. Make a full set of stone tools\n18. Make a full set of iron tools\n19. Make a full set of gold toos\n20. Make a full set of diamond tools\n21. Make another Jar at least the size of an animal Jar or more\n22. Get 2 full sets of arrows\n23. Try not to die(hardcore mode) (optional)\n24. Make 64 Stone Bricks\n25. Make 10 Mushroom Stew\n26. Make a bed\n27. Make at least 10 chests\n28. Make 30 TNT\n29. Collect 64 Gunpowder\n30. Collect 64 Sand\n31. Make 64 Bread\n32. Make a Wheat Farm\n33. Conquer the Hostile Mob Jar without loosing any of the items\n34. Make 64 Glass Blocks\n35. Make 64 Glass Pane\n36. Make 15 Wooden Stairs\n37. Make 15 Cobblestone Stairs\n38. Make 15 Brick Stairs\n\nCreators: Gtawesomesauce, Lethal_Zak', 'http://www.minecraftforum.net/topic/1456829-survadvworld-in-a-jar-pe-update-animals-in-animal-jars-new-jars-added-many-more/', '', 'wXPzJgp', 'VvDhJokSTnQ', 'Survival', '317 kB', '1.5.3+', '0', ''
    );
