    ) VALUES (
      '626', 'Valle del resol, Argentina', 'This map features a city with many shops, skysccrapers, administrative buildings, a beach, an airport and much more! There''s also a big house just outside the city. You can modify the map any way you want.\n\n___\n\nEsta ciudad tiene una gran carretera hacia otras partes, con una ciudad con playa y mar, muchas tiendas en la carretera, muchos arboles y un aeropuerto. Si quieres puedes poner o construir lo que quieras sin importar. Ademas tiene una mini ciudad con una casa grande, muchas tiendas, un parque grande y una playa. Si pueden terminarla como quieran.\n\nCrеаtоr: jdguzman', 'http://mine-apps.com', '', 'ZACjMcH', '', 'City', '19,8 MB', '1.7.0+', '1', 'mcpe.app'
