INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '641', 'LUCKY BLOCK SUPER', 'Lucky Block Islands is an exciting game which contains new Type of blocks(Lucky block)\n\nYou can use it to claim some weapons and blocks which will help you to win the match\n\nPlay with your friends by LAN without internet support\n\nWin the games and claim your rewards to buy exclusive items from the shop. Enjoy!\n\n1.) Preparing To Play:\n\nInvite Your Friends By Connecting All devices to one Hotspot Network or Router Network\n\n-Enter The Map then let your friends join you by following Steps:\n\nPlay >> Friends >> (choose Your Friend Name)\n\n\n2.) How To Start:\n\nFirst select The Nubmer of Players you want to play with by MODE MENU\n\nThen Press The Button to confirm your choice\n\nAfter That Enter The Play Portal and Wait untill all players join The Match\n\nWarning: Don’t Enter the Portal Together to avoid Bugs\n\n\n3.) Game Rules:\n\nWait a few seconds until the match starts\n\nThen start breaking all lucky blocks to claim some weapons and blocks \n\nCraft a crafting table and make ypur Own weapons\n\nUse blocks to build some bridges to reach to another island\n\nDefeat all players to win The Game!\n\nDon’t Forget to check the middle island which contains Special items\n\n\n4.) The Winner Rewards:\n\nIf you win the Game you will claim 25 POINT\n\nUse the Points to buy SPECIAL ITEMS which it helps you to win the next Match \n\nThis special Items you can’t Claim from lucky blicks During The Match\n\nHow To Buy:\n\nGo to the Shop Island\nOpen The chest then select the category you want to buy from by throwing the selected category outside the chest\nBuy what you want in the same way.\n\n\nFollow us on Instagram: @commanders_crew or YouTube: "The SYRIAN KING"\n\nCrеаtоr: CommandersCrew ', 'https://instagram.com/commanders_crew', '', 'jelfAJn', '', 'PvP', '1,4 MB', '1.12.0+', '0', 'https://instagram.com/commanders_crew\nhttps://www.youtube.com/c/syrking'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '642', 'Protect The Zombie', 'Zombies are always the bad guys, but not in this game! XD\n\nIn This game you have to protect your zombie to survive and try to kill other zombies to defeat other players and win.\n\nYou can buy weapons to help you or claim some weapons by breaking ore blocks.\nBuild bridges to other islands and kill all enemy’s zombies.\n\n1.) Preparing To Play:\n\n Invite Your Friends By Connecting All devices to one Hotspot Network or Router Network\n\n-Enter The Map then let your friends join you by following Steps:\n\nPlay >> Friends >> (choose Your Friend Name)\n\n\n2.) How To Start:\n\nFirst select The Nubmer of players You Want To play with.\n\nAfter That Enter The Play Portal and Wait untill all players join The Match.\n\nWarning: Don’t Enter the Portal Together to avoid Bugs.\n\n\n3.) Game Rules:\n\nWait a few seconds until the match starts.\n\nThen start breaking all ore blocks to claim weapons and blocks or break gold blocks to claim GOLD POINTS.\n\nUse crafting table to make your own weapons.\n\nBuy blocks to build bridges to reach to another island or to protect your zombie by building a wall around it.\n\nDefeat all players by killing their Zombies.\n\nDon’t Forget to check the middle island which contains Special items\n\nUse the Points to buy SPECIAL ITEMS which it helps you to win the Match \n\nHow To Buy:\n\nGo to the Shop chest\nOpen The chest then select the category you want to buy from by throwing the selected category outside the chest\nBuy what you want in the same way.\n\n\n4.) Map Restart Feature:\n\nWant to play again??? No problem\n\nThere is an Auto RESTARTING FEATURE in our Map Which allows you to Play The Map Again!!\n\nAfter The Match ends , The Map will restart it self\n\nSo please wait a few seconds untill it finishes restarting.\n\n\n\nFollow us on Instagram: @commanders_crew or YouTube: "The SYRIAN KING"\n\nCrеаtоr: CommandersCrew ', 'https://instagram.com/commanders_crew', '', 'fgTwoda', '', 'PvP', '10,5 MB', '1.12.0+', '0', 'https://instagram.com/commanders_crew\nhttps://www.youtube.com/c/syrking'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '643', 'The Lost Soul', 'Welcome to The Lost Soul\n\nPlease note: this game can be spooky.\n\nThis is our biggest map ever!!\n\nThe Lost Soul is a storymode game which contains an exciting story with Ingame (Soundtracks!)\n\nThe story is Talking about Saving Your sister from Unknown kidnappers!!! You will find so many challenges to reach to your sister… Enjoy!\n\nIn addition, This Game Contains 3 Chapters you have to complete it ; one of them is DIVERSITY CHAPTER which you to claim all The 5 Wools to unlock The Boss Fight Chapter!!!!\n\n– Do Think That’s all???\n\nNope….  After You finish the map,you will be able to play it with a Special Survival Mode which you can discover all places and build your own buildings!!\n\nEnjoy!\n\n1) Cinematic Cutscenes:\n\nOnce you enter The Game, Enjoy our Cinematic Cutscenes untill The Game Begins.. \n\nPlease Don’t Try To Skip The Cutscenes by Changing You Own Gamemode To creative.\n\n\n2) Complete Your Objectives:\nEnjoy the story by completing The Objectives in The Scoreboard.\n\nIf You Don’t Know Where is Your Objective location, Don’t worry… Use Your Compass to know where should you go.\n\n\n3) Voice Conversations:\n\nThis is our best feature!!\n\nSome objectives need to meet some characters and speak to him\n\nHow To This? All what you have to do is Standing on the Emerald Block in front of The Character.\n\nThen Enjoy The Characters Conversation which you can listen The ARABIC Dubbing or read The English subtitle in the chat!!\n\n\n4) Pvp Stages:\n\nEnjoy out PVP stages which are contains 3 WAVES from different monsters such as (zombies, wither skeleton, ravagers…..)\n\nDon’t Worry if you Die…. You will be able to respawn in The Same arena each time you have been killed.\n\n\n5) Diversity CHAPTER:\n\nNow You Can Enjoy DIVERSITY in BEDROCK EDITION\n\nWhat Is Diversity??\nDiversity is a huge map for Java EDITION which contains many different minigame stages like (Parkour , dropper , Find The Button , Quiz……..). Each time you win a stage, you will claim a special wool you have to put it in the right place to activate another stage.\n\n\n6) After The Story Ends:\n\nEnjoy our Special Survival mode after you end the story \n\nExplore our World and build your own buildings in SYRVANIA.\n\nYou can play this mode With your friends.\n\n\n\nFollow us on Instagram: @commanders_crew or YouTube: "The SYRIAN KING"\n\nCrеаtоr: CommandersCrew ', 'https://instagram.com/commanders_crew', '', 'aHias1I', '', 'Adventure, Survival', '34,2 MB', '1.14.1+', '0', 'https://instagram.com/commanders_crew\nhttps://www.youtube.com/c/syrking'
    );
