    ) VALUES (
      '658', 'FNAF: Sister location. Night 1 [horror]', 'This map lets you play through a first night of Five Nights at Freddy''s: Sister location form a series of 4 maps. It has a fully narrated story, custom sounds at other cool features. \n\nHow to play:\nDon''t forget to turn the sound on on you device as the narrating voice will guide you through the map. This chapter takes around 10 minutes to complete.\n\nWARNING: Don''t play if you don''t like to be scared.\n\nCrеаtоr: DarkPower202', 'https://mcpedl.com/user/darkpower202', '', 'VC174eJ', '', 'Adventure', '8,4 MB', '1.2.6.2+', '0', 'https://www.youtube.com/c/DarkPower202\nhttps://www.twitter.com/DarkPower202'
