    ) VALUES (
      '675', 'The Real Hogwarts', 'This is a 1:1 model of the Hogwarts castle in Minecraft featuring the castle with surrounding terrain and a Quidditch pitch.\n\nIt includes most of the movie locations:\n— Slytherin Dorm\n— Dumbeldor''s office\n— Quidditch pitch\n— Gryffindor Dorm\n— Library\n— White Tomb\n— Grand Staircase\n— Hagrid''s hut\n— Astronomy Tower\n— The Chamber\n— The place where Dumbledor fell\n— The boat house where Snape found his end and a lot more!\n\nCrеаtоr: jstoeckm2', 'https://www.planetminecraft.com/member/jstoeckm2/', '', '5hNGBFu', '', 'Creation', '2,4 MB', '1.0.0+', '0', 'https://www.youtube.com/channel/UC-_1rj2ohwP8FzcS4jOTuFg\nhttps://twitter.com/jstoeckm2'
    );
