      '677', 'Super Mario Brothers (Arcade Game)', 'This is a recreation of Super Mario Bros. for Minecraft Bedrock Edition. It’s a minigame built as a 2D game in Minecraft. You use a controller to play Super Mario on a monitor.\n\nHow to play?\n\nWalk into the Play sign to start the game.\nYou can exit at any time by holding (drinking) the Save button.\n\nUse the normal control keys to go left or right.\nTo jump use the (A) button (modified fishing rod) - press Fish\n\n\nCreator: mcpe0717', 'https://twitter.com/mcpe0717', '', 'GLmTf6S', '', 'Game', '313 kB', '1.2.10+', '0', ''
