INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '679', 'TNT Wars – Red VS Blue', 'TNT wars is a classic Minecraft PvP mini-game.\n\nThere are two floating islands divided by a wall. Each opponent spawns on his own island and the goal is to build a TNT cannon and breach the wall and destroy the opponent''s island.\n\nWhoever kills his opponent wins the game.\n\nThere are different kits:\n• Helmet: Fireball Kit – Stack of fireballs to shoot at your enemy\n\n• Boots: Jetpack Kit – In case you fall off the platform\n\n• Sword: Baller Kit – You get a snowball that takes all the TNT lit in the game and throws it with the snowball\n\n• Fishing Rod: Troll Kit – Egg that throws creepers\n\n\nCrеаtоr: CracklyCactus17', 'http://mine-apps.com', '', 'KD2l5Ya', '', 'Game,Pvp', '114 kB', '1.1.5+', '0', 'mcpe.app'
    );
