    ) VALUES (
      '685', 'Granny House Horror', 'WARNING: This map contains elements of horror gameplay. Please do not play it if you don''t want to be scared.\n\nYou are Trapped in Granny''s house, Will you escape alive? This game has a brand new Granny, A shop to get items to help you, a chest to save your items, More traps and Buttons To help you escape! This game is a survival horror game.\n\nCreator: JaySki101', 'http://mine-apps.com', '', 'JpAcqTI', '', 'Game,Horror', '704 kB', '1.11.0.10+', '0', 'mcpe.app'
