    ) VALUES (
      '693', 'Baldi’s Basics in FTB [horror]', 'WARNING: This map contains elements of horror gameplay. Please do not play it if you don''t want to be scared.\n\nThis is a remake of the popular Baldi''s Basics horror game. You goal is to find buttons to complete the game.\n\nStory:\nYour friend left all of his notebooks at school but doesn’t have time to go and get them. To help your friend you decide to go back to the school and collect his notebooks. But it won’t be easy because Mr. Baldi will be in your way, challenging you on this task. And if you make him mad he will chase you down!\n\n(Find The Button)\n\n\nCreator: BendyTheDemon18', 'https://mcpedl.com/user/bendythedemon', '', 'xdlmwXj', '', 'Game,Horror', '9,8 MB', '1.7.0+', '0', 'https://www.youtube.com/channel/UCE7dzfqSAFCOdv4LPB-PY-w\nhttps://www.twitter.com/bendydemon18'
