INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '697', 'Lost Forest Hide and Seek', 'This is a multiplayer hide-and-seek minigame in an arena themed as a Lost Forest. There is a fully automatic countdown timer which is started by the seeker after performing a specific task. Hiders can take advantage of things like the automatic teleporters to quickly escape the seeker. The arena includes lots of different hiding spots, everywhere from underground caves to treetops.\n\nHow to play:\n\nBefore starting players decide who will begin as the seeker. The seeker then has to enter the wooden house in the center of the map and use a bow and arrow to shoot one of the buttons to start a 60 second timer.\n\nDuring this period the hiders have to find somewhere to hide. Once that time is up the seeker can exit out to the arena and start searching for the hiders. If a hider is found then he will have to fight his way out and find a way to the green safe area at the house.\n\n\nCrеаtоr: Kidsource', 'https://mcpedl.com/user/kidsource', '', '4NHIlyL', '', 'Game,Pvp', '93 kB', '1.2.8+', '0', 'https://www.youtube.com/channel/UC4L7VhfYiR9CWjlbJgQx7FA'
    );
