    ) VALUES (
      '705', 'Hide And Seek: Cave Edition', 'There are two teams: hiders and seekers.\n\nSeekers have to find the hiders in 3 minutes or they lose.\n\nThe seekers can select one of the camouflage skins: stone, obsidian, and a dark gray shadow. Some gravel, stone, dirt, and watermelons are actually hidden doors  and seekers can hide behind them!\n\n\nCreator: Gab_The_Crafter', 'https://mcpedl.com/user/gab_the_crafter', '', 'EWIRL7G', '', 'PvP, Game, H&S', '4,5 MB', '1.12.1.1+', '1', 'https://www.youtube.com/channel/UCG1DUQQqXE3zlMENFGb5utg\nhttps://www.twitter.com/Gab_The_Crafter'
