INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '706', 'Hide and Seek: cs_office', 'This is a recreation of the popular Counter Strike cs_office map which is often used for games like prop hunt and hide and seek.\n\nNow you can play hide and seek on this game in Minecraft!\n\nPlayers spawn in a room and decide who will be hiders and who will be seekers. Hiders then get few minutes to hide.\n\nIf you are a hider don''t worry about closing the doors behind you, because they will be closed automatically when the seekers leave the spawn room!\n\nIf you want wou can use potions and effects to make the game more fun!\n\n\nCrеаtоr: BubblesAndSuch', 'https://www.planetminecraft.com/member/bubblesandsuch/', '', 'CZ0rhzu', '', 'Pvp,Game', '72 kB', '1.10.0.7+', '0', 'https://www.youtube.com/channel/UC7LDxq0n_XTSuTtSo2gUxoQ\nhttps://www.paypal.me/MrChambers\nhttps://www.reddit.com/u/BubblesAndSuch'
    );
