INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '712', '1. One Block Survival [Un Bloque]', 'This is our version of the popular One Block game mode.\n\nYou start the game on one single block in the middle of the void. But it''s not an ordinary block - you can mine it endlessly!\nEvery time you break the block it changes and progresses through 10 levels:\n1. Forest\n2. Underground\n3. The Caves\n4. Barren Lands\n5. Swamps\n6. Deep Waters\n7. Jungle\n8. Snow World\n9. The Nether\n10. The End\n\nThe block can also give you chests with useful items and spawn mobs!\n\nThe block changes randomly (within the current level), so each game is unique.\n\nCan you get to the End and defeat the End Dragon?\n\n___________\nThe map supports 29 languages.\n\nWe worked really hard on this map and hope you enjoy it!\n\nCrеаtоr: Emily Wilkins', 'https://play.google.com/store/apps/details?id=mnw.mcpe_maps', '', 'VCUyKe0', '', 'Survival,Game,oneblock,1 block', '2 MB', '1.9.0.15+', '1', ''
    );
