      '719', 'Kingdom of Majesta', 'Kingdom of Majesta is a big kingdom consisting of palace and a town surrounded by a thick wall. You can find many interesting buildings inside the town: temples, a cathedral, the grand library, a mage school and more. Outside the town walls there''s also some villages and beautiful farm lands.\n\nCrеаtоr: Eftann Senpai', 'https://www.planetminecraft.com/member/eftann_senpai/', '', 'dIMLG7o', '', 'Creation,City,Village,Castle', '44,8 MB', '1.10.0+', '0', 'https://www.youtube.com/channel/UCno9o5Hc_XOkCmXS08mX0mw\nhttps://twitter.com/leveltion\nhttps://www.instagram.com/Jakub_osowski'
