      '720', 'BleedTheWorld Mountain Mansion', 'BleedTheWorld is the definition of a cool man cave. Built inside of a huge snowy mountain it is created in a Star Wars theme and has many hidden passages, secret rooms, cozy fireplace rooms, a bascetball room, spacecrafts and even a private subway system, and much more!\n\nThere''s also many interesting buildings outside the main mansion.\n\nThis awesome map is ideal for survival!\n\n\nCrеаtоr: BloodyComedyy', 'https://www.planetminecraft.com/member/bloodycomedyy/', '', 'lTe4EDW', '', 'Creation,Houses', '38 MB', '1.10.0+', '0', 'https://www.youtube.com/channel/UCEVKbPyAp9ICMtr80U-FEZg'
