      '1174', 'Tardis 2.0', 'This map recreates the famous T.A.R.D.I.S. from the popular TV show "Dr. Who". Walk inside of it and explorer many rooms and locations it can offer you:\n\n• Master''s Console Room\n• Observatory\n• Engine Room\n• Cloister Room\n• Armory\n• War Doctors Console Room\n• The End Console Room\n• The 8th Doctors Console Room\n• The Zero Room\n• and many others\n\n\nCrеаtor: MiсroJP', 'https://mcpe.app', '', 'hoV5X4Q', '', 'Creation, Drwho, TV', '80.2 MB', '1.16+', '0', ''
    );
