    ) VALUES (
      '1175', 'Big Survival World ', 'This is an awesome survival world with a lot of prebuilt structures and locations:\n\n• House\n• Animal and food farms\n• Bakery\n• Villager trading center\n• Cave base\n• Abandoned village\n• Abandoned mineshaft\n• Stronghold Outpost\n• Storage room\n• Nether base\n• Nether piglin village\n• and much more\n\nYou can earn achievements in this world.\n\n\nCreator: Mr Shadow\nYoutube: MrShadow', 'https://www.youtube.com/channel/UCOL7MO9w7LL_IW-QSzIbH0Q', '', 'yhTmrP2', '', 'Survival, Base, Village', '5.6 MB', '1.17+', '0', ''
