      '734', 'Falling Blocks [1.16+]', 'In this unique minigame you spawn in a 100 x 100 area which starts to fill up with random blocks of all kinds! This also includes chests with random loot. You can even reach The End if you collect all the needed items and construct the End Protal!\n\nIn the lobby you can choose from 3 different block spawn speeds: slow, medium and fast.\n\n\nCreator: B0NY434445', 'https://mcpedl.com/user/b0ny434445', '', 'pFpHjlD', '', 'Game', '881 kB', '1.16.0+', '0', 'https://www.youtube.com/channel/UC8PQ8f18ztK2LOM6Efu06dA\nhttps://twitter.com/B0NY434445'
