INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '737', 'LuckyTree SkyBlock', 'This is just like any other regular SkyBlock except that tere are some unpredictable random events that can make either easy or super hard!\n\nThere are 4 floating islands: the Main Island, a Desert Island, a Stronghold Island and a Lucky Island.\n\nImportant: Make sure that Lucky Block resource pack is activated!\n\n\nCrеаtоr: mcpedash', 'http://mine-apps.com', '', 'SsnX1sW', '', 'Survival,Sky block', '316 kB', '1.2.6.55+', '1', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '738', 'Flood Escape Parkour', 'In this fun minigame your goal is to get to the top of the level before the room floods!\n\nIn about 20 seconds after you''ve spawned the room that you''re in starts filling up with water. Find the buttons that place additional blocks and open gates:\n\nLapis Blocks: Places a block that will help you advanced through the floor\nEmerald Blocks: Opens a locked gate on an exit door\n\n\nCrеаtоr: McMCPE1234', 'https://mcpedl.com/user/mcmcpe1234', '', 'opwbyue', '', 'Game,Parkour', '11,3 MB', '1.8.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '739', 'Farm House', 'This map features a cozy little farm. You get a small house surrounded with farms and livestock: horses, sheep, cows. The house is empty and you can decorate it to your liking. This is a great map for to start a new survival!\n\n\nCrеаtоr: AWсооlgаmеs', 'http://mine-apps.com', '', '4Er3F7u', '', 'Houses,Farm,Survival', '1,1 MB', '1.1.0+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '740', 'DeathRun: The Snowy Update [PvP]', 'This is a multiplayer map with two teams The Runners and The Killers.\n\nThe Runners'' goal is to reach the finish, but only one player can win!\n\nThe Killers have to activate the traps to prevent the runners from reaching the finish line.\n\nThere are 6 levels:\n- Grasslands\n- Undertale\n- Snowy Hills\n- The Fandom Project\n- Temple Madness 2.0\n- Home Alone\n\nCrеаtоr: McMCPE1234', 'https://mcpedl.com/user/mcmcpe1234', '', 'MSAr261', '', 'Game,PvP', '4,9 MB', '1.8.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '741', 'Mythical Adventures: Desert [1.16+]', 'This map features a beautiful custom world with modded mobs, items and blocks and biomes.\n\nNew Mobs:\n— Vulture \n— Asian Mesa Trader \n— Loving Cactus \n— Scorpion \n— Scorpion King \n— Desert Skeleton \n— Sand Creeper \n\nNew Items:\n— Sand Sword (+9 attack damage)\n— Sand Pickaxe\n— Sand Axe\n— Sand Shovel\n— Cacti\n— Cacti for a water\n— Water\n— Water from cactus\n— And other\n— Me, the creator! :D\n\nNew Features:\n— Desert Tree\n— Mesa Tree\n— Desert Water\n— And other\n\nThanks for Support with dear, Mythical Adventures Team!\n\nMy Youtube: Mythical Adventures\n\n\nCrеаtоr: Mythical Adventures Team', 'http://mine-apps.com', '', 'jXocKoI', '', 'Creation,Survival', '6,3 MB', '1.16.0+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '742', 'A PVP Thing [1.16+]', 'Here is a KitPVP map that I made with help from other players. The 5 kits and all the commands were done by me, and Special credit goes to AimbotMac for building.\n\nCrеаtоr: SpilledCobra872', 'http://mine-apps.com', '', 'lf9znd6', '', 'Game,PvP', '505 kB', '1.16.0+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '743', 'Powerkour', 'This pаrkоur mаp inсludеs 10 diffеrеnt сhаllеnging pаrkоur соursеs. In еасh lеvеl yоu’ll gеt а diffеrеnt stаtus еffесt whiсh yоu must usе in оrdеr tо gеt thrоugh thе lеvеl. It’s kind оf diffiсult аs sоmе lеvеls аrеn’t еxасtly оptimizеd fоr еасh stаtus еffесt, sо еасh timе yоu’ll bе fасеd with а fun сhаllеngе.\n\nPrеss thе buttоn аt spаwn tо tеlеpоrt tо thе first lеvеl. At еасh lеvеl yоu will spаwn оn а prеssurе plаtе whiсh whеn prеssеd will givе yоu а stаtus еffесt. Usе thе stаtus еffесt tо gеt thrоugh еасh lеvеl.\n\nCrеаtоr: MаttH44', 'https://mcpedl.com/user/matth44', '', '2PIghvk', '', 'Game,Parkour', '206 kB', '1.6.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '744', 'Abandoned Military Base', 'There once was a top secret military base on this island. Now it is long time abandoned and overrun by the nature and local native tribes. Explore the base and find out what secrets it holds within!\n\n\nCrеаtоr: DSL3125', 'https://mcpedl.com/user/dsl3125', '', '4EXShvu', '', 'Creation', '10,3 MB', '1.14.0.9+', '0', 'https://www.youtube.com/channel/UCfD4XNTVmMm0xypviUwOhvg'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '745', 'SCP: The Breach', 'This is a multiplayer game inspired by the SCP game — SCP: Secret Laboratory.\n\nThere are 2 roles: SCP and Class D:\n\n— Class D''s goal is to excape the laboratory before time runs out\n— SCP''s goal is to catch and destroy Ds before time is up and the nuke is detonated.\n\nMechanics:\n\n— SCP-914: A machine that can upgrade items. This is essential if Class-D want an easier time to escape.\n\n— Keycards: The most useful item in the game. Grant access to locked doors which may lead to better routes or better items inside the locked rooms. \n\n— Timer: A scoreboard which shows how much time is left before the nuke detonates. You only have 10 minutes to achieve your goal!\n\n\nCreator: McMCPE1234', 'https://mcpedl.com/user/mcmcpe1234', '', 'hlC78m0', '', 'Game,PvP', '25,9 MB', '1.11.0.22+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '746', 'The Floor Kills 2 [Parkour]', 'This is a fun pаrkоur mаp but with mоrе еlеmеnts оf оbstасlеs аnd сhаllеngеs. By wаlking оn tоp оf сеrtаin соnсrеtе blосks yоu will gеt diffеrеnt stаtus еffесts – sоmе are gооd аnd sоmе are bаd. But thе mоst impоrtаntly, rеmеmbеr tо аvоid thе flооr аt all соst аs it will kill yоu instаntly if yоu touch it!\n\n\nCrеаtоr: Mаuwее', 'https://mcpedl.com/user/mauwee', '', 'A07qcOY', '', 'Game,Parkour', '128 kB', '1.1.3.52+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '747', 'DeathRun [1.16+]', 'This is a classic Deathrun minigame for 2-5 players.\n\nThere are 2 roles:\n— Runners: must clear the course and get to the finish point and press the point;\n— The Death Man: interferes with the runners, lays obstacles and tricks to slow them down or eliminate them!\n\nCreator''s Youtube channel: youtube.com/c/mcmtuber\n\nCrеаtоr: tubergamer2010', 'https://mcpedl.com/user/tubergamer2010', '', 'TwIhYKE', '', 'Game,PvP', '58 kB', '1.16.0+', '0', 'https://www.youtube.com/c/mcmtuber\nhttps://www.twitter.com/mcmtuber1\nhttps://www.twitter.com/mcmtuber1\nhttps://www.instagram.com/mcmtuber'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '748', 'Hide And Seek : Farm', 'In this game you play Hide and Seek on a Farm map.\n\nAt the start of the game hiders have 20 seconds to hide. After that the game starts and the seeker has 5 minutes to find all the hiders. If the seeker hits a hider he becomes a seeker too. Anyone who isn''t found after the 5 minutes wins.\n\n\nThere''s also gifts that start spawning on the map after a while. But beware, instead of giving you a reward some of them are bad for you!\n\n\nCreator: Startpoul\nYou can support the creator here: utip.io/startpoul\nInstagram: @startpoul', 'https://mcpedl.com/user/tubergamer2010/', '', 'fhkUj8Q', '', 'Game,PvP', '16,5 MB', '1.14.0.9+', '0', 'https://www.youtube.com/c/mcmtuber\nhttps://www.twitter.com/mcmtuber1\nhttps://www.instagram.com/@mcmtuber\nhttps://facebook.com/mcmtuber'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '749', 'Hide & Seek: The Nether Update [1.16+]', 'Hide & Seek game set up in the 4 new biomes from the 1.16 Nether Update!\n\nIn the beginning of the match all the hiders get 5 gold, they can buy taunts with them — play different sounds for the seekers to mislead them. Just place the gold in barrels at the shop.\n\nThere are many hiding spots all over the maps, for example there''s one spot where you can hide in lava.\n\n\nCrеаtоr: ExetreemPlayz\nYoutube: exetreemplayz', 'https://mcpedl.com/user/exetreemplayz', '', 'AN4dhxE', '', 'Game,PvP', '1,3 MB', '1.16.0+', '0', 'https://www.youtube.com/exetreemplayz'
    );
INSERT OR REPLACE INTO maps (
