INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '763', 'The Book — El Libro', 'This is a multiplayer PvP arena in a form of a giant book. Two sides — left and right — good and evil. In the beginning players choose their side and start to collect resources needed to break an obsidian barrier between the two sides andto defeat their opponent.\n\nThe map is in Spanish, but it is pretty straightforward, so it''s easy to understand the rules.\n\n\nCreator: TheDany9710 & Jota', 'http://mine-apps.com', '', 'n569YHM', '', 'Game,PvP', '328 kB', '1.5.0+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '764', 'Abandoned Jurassic World [1.16+]', 'Explore the remains of jurassic World — once a world-class theme park which was abondoned after the catastrophic events of 2015.\n\nThis map features many of the iconic locations and structures from Jurassic World and Jurassic World: Fallen Kingdom:\n\n- Gyrosphere Valley\n- Jurassic World Gates\n- Mount Sibo\n- Aviary\n- Cretaceous Cruise Attraction\n- Viewing Gallery\n- North Docks\n- and others\n\nPlease note: this map doesnot contain dinosaurs, however you can use any of the available addons to add dinosaurs to the game.\n\n\nCrеаtоr: DSL3125', 'https://mcpedl.com/user/dsl3125', '', 'xZyS5N7', '', 'Creation', '47,3 MB', '1.16.0+', '0', 'https://www.youtube.com/channel/UCfD4XNTVmMm0xypviUwOhvg'
    );
