    ) VALUES (
      '767', 'Zombie Survival : Subway', '!!! WARNING: This map contains elements of horror. Please do not play if you don''t want to get scared!\n\n\nYou and your friends find yourselves on a subway station in the middle of a Zombie Apocalypse! The Undead are coming to get you! Can you survive?\n\n\nCrеаtоr: Kyoko Studios', 'https://mcpedl.com/user/aria-williams', '', 'ccQxO7E', '', 'Game,Survival,Horror', '27,5 MB', '1.11.0.22+', '0', 'https://www.youtube.com/channel/UCDOE2BVvj9iP65pf62aAZhA\nhttps://twitter.com/KyokoStudios'
