INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '794', 'Better SkyBlock v 1.3 [1.16+]', 'In this map you start off on an island with only one block of bedrock, one block of grass and a chest. However, thanks to the "Better Skyblock" addon,  you can craft anything from grass and even spawn eggs! There are also crates (machines) such as sieves and others to help you on your journey.\n\nThere are 20 main and 10 bonus quests that you can to complete\n\nThis version also has shops and multple islands — great for multiplayer!\n\n\nCrеаtоr: jesser101, DanRobzProbz', 'https://mcpedl.com/user/jesser101/', '', 'ZTx0aZq', '', 'Game,PvP', '9,2 MB', '1.16.0+', '0', 'https://www.youtube.com/c/jesser101\nhttps://www.twitter.com/jesser101\nhttps://www.instagram.com/jesser101_/'
    );
