      '812', 'Caveblock v1.1', 'In Caveblock you are spawned in a small 3x3 underground chamber and start with only one wooden pickaxe and 32 sticks.\n\nFind a way to gather as much materials as you can and ultimately beat the End Dragon!\n\nThere are many custom structures underground which can help you gather more materials and survive:\n\n• Hostile Mob Dungeons\n\n• Passive Mob Spawners\n\n• Mineshafts\n\n• Custom Caves\n\n• Underground Villages\n\n• The Stronghold\n\nand more!\n\n\nCrеаtоr: jesser101 (PixelPlay MAPS)\nDiscord: discordapp.com/invite/h4TtFjY\nYoutube: youtube.com/channel/UCW069JKDr60hiCGtKP01fwg', 'https://mcpedl.com/user/bluflyaway', '', 'oOhln77', '', 'Game,Survival', '4.4 MB', '1.14.0.9+', '0', 'discordapp.com/invite/h4TtFjY\nyoutube.com/channel/UCW069JKDr60hiCGtKP01fwg'
