      '815', 'Ice Scream 1', '!!!WARNING!!!: This map contains elements of horror gameplay! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\n\nWelcome to Ice Scream 1 In Minecraft!\n\nIce Scream chapter 1, is a popular mobile horror game that was made by Keplerians team, and now it is being recreated in Minecraft bedrock edition as a horror and adventure map. How do I play? Your mission will be hiding inside his van and solving the mystery of this evil villain. To do this, you will travel through different scenarios and solve the necessary puzzles to save the frozen child. Save the child that the evil ice cream seller has frozen & kidnapped in his van.\n\nCrеаtоr: ItsRyanFire\nYoutube: ItsRyanFire', 'http://mcpe-apps.com', '', 'f6QUX7h', '', 'Adventure,Horror', '4.5 MB', '1.16.0+', '0', 'https://www.youtube.com/channel/UCG_wjI_ViYLL1JO9uSwaVQA'
