INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '821', 'Transcendance', 'This is a strategy multiplayer world inspired by the Werewolf card game.\n\nYou can play with just 2 players, but it''s more fun to play with more people. the map supports up to 8 players.\n\nNight\n\nThe game is running in a cycle system, its starts with the night where all players will be teleported to the bed in their house, randomly choose at the beginning of the game. The cycle will then run and allow roles one by one to use their capacities if they have one usable during the night.\n\nThe capacities can be choosing a player that will die at the end of the night as for classic Creatures of Darkness, save one player before his death as the Guru or even wake up to look through the windows the Creatures of Darkness as the Spirit.\n\nDay\n\nWhen the all the capacities usable the night for this turn have been played, the day will come and players supposed to die will be out of the game but able to use the spectator mode in the spawn to look the others play. If the role they have give them a power at their death this one will be usable before they are out of the game.\n\nThe day cycle will then launch a timer and let players walk on the village. They will have to vote against on player they suspect to be a Creature of Darkness. For that they should talk together, and use the golden pressure plate inside the house of the player you want to vote against. A public message will tells that you have voted against this player but you can change of vote while the timer is running. At the end of the time if the majority of players have vote against a player this one will be killed and if he has a power to use this one will be usable before the night. The night cycle will the run again and so one while no roles has achieve their win condition. If one achieve his role condition the game will end, show the roles of all players who still alive. They will then be send back to the spawn and a new game can be launch.\n\n\nCrеаtоr: Trinity Block', 'https://twitter.com/Trinity_Block', '', 'GNmK4oT', '', 'Game, PvP', '6.9 MB', '1.5.2.1+', '0', ''
    );
