      '843', 'Anurag Dodake''s world', 'This map includes many structures:\n\n• living houses, survival houses, a big tree house with a pool\n• 2 underground secret bases — one is in the modern house and to find the other follow the signs — there is a treasure hidden in the underground secret base.\n• rail lines leading to mines, and also a big roller coaster ride\n• a temple behind the modern house with a pool\n• a joker house its like joker in that there are many chests including many things in it.\n\nIn one of the modern houses coastal ride starts. In that house there is also a nether portal and an underground secret base including enchanting materials ender chest etc.\n\n• structures like a tank, an airplane, beacon etc.\n\n• automatic farms like bread farm, wheat farm etc.\n\nCreator: Anurag dodake', 'https://mcpe.app', '', 'lgSo0Eo', '', 'Creation, Rollercoaster', '9.4 MB', '1.16.0+', '0', ''
