      '871', 'Deadly Find the Button 2: The Revenge', 'This is a sequel of the first Deadly Find the Button map, and it is based off of the 1.16 Nether Update. There are many levels, each featuring a different Nether biome or structure from The Nether. There are Crimson Forest, Warped Forest, and more!\n\n\nCreator: JburrowPlays\nYoutube: JburrowPlays', 'https://www.youtube.com/c/JburrowPlays', '', '451pmsa', '', 'Game, FTB', '6.6 MB', '1.16.0+', '0', ''
