    ) VALUES (
      '873', 'Modern Wooden Mansion', 'Awesome wooden mansion that includes:\n- 3 living rooms\n- 3 Kitchens\n- 2 Bathrooms\n- Master Bedroom\n- 2 Guest Bedrooms\n- 2 Pools (One Mini-pool)\n- Basement\n- Many unique features like fish tanks\n- Secret Areas :)\n- Rooftop Garden\n- Fully Detailed Guest Bungalow\n\nThere are also many other unique areas outside the main mansion!\n\n\nCreator: AeonianLegend', 'https://www.planetminecraft.com/member/aeonianlegend/', '', 'SzC25OQ', '', 'House', '12.1 MB', '1.16.0+', '0', ''
