INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '875', 'Anurag Castle', 'This map is about a small kingdom.\n\nThere are many structures to explore:\n\n• Village \n• Large castle for the world owner\n• Prison with many prisoners, which you have  to feed daily.\n• Two underground bases with hidden treasure.\n• A large stone tower like structure with a water lift.\n• Two nether houses to go in the nether and there is also a house in nether.\n• Beacon structure.\n• Animal barn to feed the animals \n• End portal, nether portal etc.\n\nFollow signs which will help you explore the world.\n\nYou can watch the sunrise from the top of the large stone tower, in middle of the castle''s small tower the sunrise looks very nice!\n\n\nCreator: Anurag Dodake', 'https://mcpe.app', '', 'V9QEI8B', '', 'Creation, Village', '29.0 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '876', 'Flood Escape!', 'This is a Bedrock version of the popular green flood escape parkour map!\n\nStart at the bottom of the map and hop your way up to the top through 4 beautifully designed levels.\n\nThere are also 4 different difficulty levels to chose frm: from easy to super hard.\n\nYou can play alone or with friends.\n\nThis map supports two languages: English and Chinese.\n\n\nCreator: Alvin Launcher1024\nYoutube channel: Alvin Launcher1024', 'https://www.youtube.com/channel/UCsPkCBs0W7Mal8yL6fcVmLg', '', 'ctCRcoz', '', 'Parkour, Game', '1.8 MB', '1.16.0+', '0', ''
    );
