INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '879', 'It Lurks', '!!!WARNING!!!: This map contains elements of horror gameplay! There are also jumpscares! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\nThis is a singleplayer adventure horror map based on a Roblox Horror game called “It Lurks” by Terribleblox.\n\nYou live a perfectly normal life with your brother Grim and your father. Until one day, when you hear some weird noises coming from the basement and decide to go and see what''s up.\nThere are 5 chapters.\n \nCreator: PMNguyen\nYoutube: PMNguyen', 'https://www.youtube.com/channel/UCqxYJH0IrZGSRfDjKwQEOpw', '', 'XWNVZn6', '', 'Adventure, Horror', '33.2 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '880', '7 Minegames', 'This world provides 7 fun PvP minigames:\n\n1. • The Bridge •\nA 2 team PvP minigame where your objective is to cross the bridge, try reach the other team’s base, and jump in their goal to score a point.\nFirst team to score 5 points wins!\n\nYou will get swords, armour, and other items you will need to defeat the other team.\n\n\n2. • Kitted FFA •\nA free for all PvP. Choose from 12 available kits and defeat all other players! The last player standing wins.\n\n\n3. • Knockoff  •\nPlayers are spawn on a floating platform and are given a bow. Knock other players off the platform and be the last one standing to win.\n\n\n4. • Playground •\nIn this mode there are no rules, everybody is free to do what they want. You can parkour, fight other players, practice your archery skills and more!\n\n\n5. • Duels •\n2 teams, the last one standing wins. Easy!\n\n\n6. • Hide N See •\nGame starts with 1 Seeker and all other players as Hiders. Seek can hit a Hider to convert him into a Seeker as well. The game stops when time runs out or there are no more Hiders.\n\n\n7. • Skywars •\nA classic Skywars game: Players are spawned each on their own floating island and have to use the resources they are given to defeat all other players.\n\n\nCreator: Aden Lynn\nYoutube: Aden Lynn', 'https://www.youtube.com/channel/UCWLkmKLz1JIoo-uh6_5rYNg', '', 'q5urH9H', '', 'Game, PvP', '1.91 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '881', 'Castle Adventure', 'This is a fun adventure map. An evil villager decided to overthrow your kingdom and proclaim himself king. Search for clues and tools you will need to restore yourself as king and save the kingdom.\n\n\n\nRules:\n\n• Play in easy\n• Survival Mode\n• Maximum rendering distance 10\n• Don''t break blocks\n\n\nCreator: MattH44\nTwitter: MattTheMiner44', 'https://twitter.com/MattTheMiner44', '', 'sRazfUR', '', 'Adventure, Village', '1.9 MB', '1.0.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '882', 'Island In The Sky', 'This is a SkyBlock with one exception that there''s also a store near your sky island, where you can trade with villagers.\n\nExpend your island and survive for as long as you can!\n\n\nRecommended Guidelines:\n• Build the Nether portal in the back of the store\n• Set brightness to maximum\n• Don’t move the portal in the Nether\n• Create a chest and put all of your items there from the challenges\n\nRules:\n• Don’t break store blocks\n• Don’t take objects from stores (item frame)\n• Don’t kill the villagers\n• Play on normal or hard\n• Don’t kill yourself to regenerate health\n\nImportant: The map includes a behavior pack and resource pack. Make sure they are enabled before entering the world.\n\n\nCreator: EdherJR2', 'https://mcpe.app', '', 'AbXL1uw', '', 'Game, Survival', '2.8 MB', '1.2.1.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '883', 'Prison Life PvP [RP]', 'This roleplay PvP minigame is inspired by ROBLOX game "Prison Life".\n\nIt is recommended to be played by 2-6 players, divided evenly into 2 teams.\nYou can choose to be either a Guard or a Prisoner.\n\nPrisoners: Find your way out and get to the Criminal Base, gear up and free your teammates.\n\nGuards: You make the rules here! Watch the prisoners and it''s up to you to decide when they eat, sleep or take a walk in the prison yard. Don''t let anyone escape!\n\n\nRules:\n• Don’t break blocks\n• Play in survival mode\n• No cheating\n\n\nCreator: NateTGM\nYoutube: WolfLord', 'https://www.youtube.com/channel/UCQIfsT_TREWVlH_5nSacoZA', '', 'GY0y0DV', '', 'Game, PvP', '430 kB', '1.0.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
