      '891', 'Gotham City [Nov. 2020]', 'November 2020 update of the WIP recreation of Gotham City from Batman series, which features:\n\n• The Batcave (The entranceto it is hidden behind the chimney in the Wayne Manor. Coordinates: -223, 49, -204)\n\n• Downtown with many buildings and roads\n• Wayne Tower\n• Wayne International Plaza\n• Monorail Central Station\n• Wayne Manor (not yet fully developed)\n• The Pioneer Bridge\n• The Royal Hotel of Gotham (missing the interior)\n• A “mini” Arkham City\n• Arkham Asylum\n• The GCPD\n• An old Joker’s Funland (one of the first buildings)\n• The Batcave from "Batman v Superman"\n• Wayne Estate\n\n\nCrеаtоr: The4BDmaster', 'https://www.planetminecraft.com/member/the4bdmaster/', '', 'A6Hj0vV', '', 'City, Batman, Superhero', '26.2 MB', '1.13.0+', '0', ''
