INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '907', 'Fantasy BedWars', 'This minigame is just like the classic BedWars, the main difference is that each player gets his own unique set of magic powers depending on which island he chooses at the beginning of the game.\n\nThe powers are:\n\n• Black (Darkness)\nBlinds nearby enemies for a period of time\n\n• White (Light)\nSummons lightning bolt infront of you\n\n• Red (Fire)\nSummons a fireball\n\n• Blue (Water)\nTraps nearby players inside an obsidian egg filled with water\n\n• Green (Wind)\nLevitates you and gives slow falling effect\n\n• Brown (Earth)\nSummons evocation fangs around you\n\n• Light Blue (Time)\nMakes nearby enemies unable to move for a period of time\n\n• Purple (Space)\nTeleports you back to your island\n\nCollect resources, buy items, defend your bed and defeat other players!\n\n\nCreator: Lgamer24', 'https://mcpedl.com/user/lgamer24', '', 'rrWWtua', '', 'Game. PvP, Bed Wars', '1.3 MB', '1.16.0+', '0', 'https://www.youtube.com/Lance%20Of%20Jynnue\nhttps://www.instagram.com/lanceofjynnue'
    );
