      '908', 'Advanced KitPvP', 'Kit PvP minigame with 20 unique characters to pick from:\n\n- Warrior\n- Heavy Knight\n- Assassin\n- Paladin\n- Werewolf\n- Berserker\n- Fighter\n- Rogue\n- Monk\n- Wolf Master\n- Archer\n- Gunner\n- Engineer\n- Alchemist\n- Ninja\n- Vampire\n- Priest\n- Wizard\n- Druid\n- Necromancer\n\nPlus 8 more characters which you can unlock by purchasing a VIP pass in the game shop with the money that you earned in battles:\n- Cactus Boy\n- Echo\n- Pyro\n- Artiminus\n- Bomber Man\n- Dragonoid\n- King of Aquiria\n- Omilucem\n\nThere are 3 shops: regular shop, VIP shop and VVIP shop! :D\n\n\nCreator: Lgamer24', 'https://mcpedl.com/user/lgamer24', '', 'C8lSpGf', '', 'Game. PvP', '1.1 MB', '1.16.0+', '0', 'https://www.youtube.com/Lance%20Of%20Jynnue\nhttps://www.instagram.com/lanceofjynnue'
