      '920', 'Navrit Gaming Survival World', 'A beautiful survival world with many creative buildings.\n\nThis world has:\n• many automatic and manual farms: wool, sugarcane, wheat, coconuts, Nether wart etc.\n• artificial village ready for breeding villagers\n• a mob farm\n• cattle pens\n• storage\n• railway system to a big desert village\n• a sky house and many more\n\n\nCreator: SHAMBHO Gamer YT\nYoutube channel: SHAMBHO Gamer YT', 'https://www.youtube.com/channel/UCWZ8xNm7fo_skWlG2SwBy7w', '', 'Szxwj26', '', 'Survival, Base, Youtube', '13.3 MB', '1.16.0+', '0', ''
