INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '921', 'Murder Mystery Mansion', 'This is a multiplayer minigame for 3+ players.\n\nMurder Mystery is a game similar to Among Us. There is one murderer who is trying to kill all the other players. Your goal is to find and kill him before he murders all the innocent players.\n\nThere are 3 roles:\n\n• 1 Murderer – Kill all other players without being caught\n\n• 1 Sheriff  – Find and kill the murderer\n\n• Innocent (the rest) – Avoid getting killed, collect 10 gold ingots and then press the button on a diamond block to get a bow and an arrow. With them you can help the sheriff find and kill the murderer.\n\nCreator: TheRealHeshamYT', 'https://mcpe.app', '', '6kiuDJs', '', 'Game, Pvp, Among Us', '291 kB', '1.0.0+', '0', ''
    );
