      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '922', 'Entity_303 Boss Battle', 'Fight and try to defeat the evil boss Entity_303, who is trying to destroy the Overworld.\n\nEntity_303’s Abilities:\n\n• Shoots fireballs\n• Summons minions (wither skeletons)\n• Summons lightning\n• Drops anvils on you\n• Poisonous attack\n\nDuring the fight you will gain some superpowers: speed and jump boost, health regeneration.\n\n\nCreator: Vladu11, MCPEMike', 'https://mcpe.app', '', 'rO5HJat', '', 'Game, Battle', '10.8 MB', '1.2.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '923', 'FS Treasure Hunt', 'This map is based on Treasure Hunt Simulator from Roblox. Your objective is to dig for buried treasure chests, and trade the treasures for tool upgrades and other useful items. You can play alone or with friends.\n\nHow to play:\n\nOpen the glowing Shulker Box and take the items from it:\n\n• Bucket – Digging tool\n• Firework – Teleports you out of the digsite\n• Book – Tutorial\n\nAfter you’ve dug out some sand and gold you can sell it to the villagers in the huts. Use sand to get gold and use your gold to upgrade your tools and buy extra items.\n\n\nCreators: HAVOC INS4NITY\nYoutube channel: HAVOC INS4NITY', 'https://www.youtube.com/channel/UC8dB_wDtp-Sw6RAS2F3fusg/', '', 'nOPBHCe', '', 'Game, Adventure', '6.3 MB', '1.2.13.54+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '924', 'FS TNT Run', 'TNT Run PvP game with 3 stories intended to be played by multiple players (similar to the Hex-A-Gone gamemode in the "Fall Guys").\n\nAfter you press the button in the lobby, you are dropped to the first level of the arena. Don''t stop in one place or the block under you will fall down. So keep running! The last player to survive wins.\n\n\nCreator: HAVOC INS4NITY\nYoutube channel: HAVOC INS4NITY', 'https://www.youtube.com/channel/UC8dB_wDtp-Sw6RAS2F3fusg/', '', 'f5USDUv', '', 'Game, PvP, Fall Guys', '1.6 MB', '1.2.11.4+', '0', ''
    );
