      '932', 'The Perfect Heist', 'After escaping prison you''ve joined a mafia. Now the boss has given you a job of robbing the State Bank to steal a huge diamond. Can you complete the task?\n\nThis map features a GTA-like mini town where you can complete side quests, drive a car and buy gear for the heist!\n\nCreator: Umerkk164', 'https://twitter.com/umerkk164', '', '7Uu6Apy', '26cKMFOaaNk', 'Adventure, GTA, Heist', '4.2 MB', '1.1.3+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '933', 'One Night At Frankie’s: PvP', 'This is a multiplayer version of the One Night At Frankie’s map, best played by 2 players.\n\nThere are 2 roles: Night guard and Animatronic.\n\nChoose your role before the game starts.\n\nNightguard''s objective is to survive the night.\nAnimatronic''s objectiveisto hunt down the guard and kill him.\n\nThe game ends at 6:00 AM, and if the guard is still alive he wins!\n\n\nCreator: CreeperGamerZXZ', 'https://www.youtube.com/cgzxz', '', '3jOFv2Q', '', 'PvP, Horror', '3.8 MB', '1.12.1.1.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '934', 'Zombie Apocalypse City', 'This is an awesome, very detailed post apocalypse city infested by zombies!\n\nExplore the city, loot the buildings, fight zombies, search for the easter eggs and try to survive in the never ending night!\n\n\nCreator: Jarno', 'https://mcpe.app', '', 'XVVWuMr', '', 'Adventure, Zombie, City', '2.1 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '935', 'Beautiful Swamp Houses', 'This map features 2 houses located in a beautiful swampy area.\n\nOne is a cozy swamp house equipped with almost everything you need for a survival game: storage, diferent kinds of tables, enchantment area, bedroom, etc.\n\nThe other house is located nearby and is a 4 story medieval themed watermill with detailed interiors!\n\nIn the nearect vicinity there''s also a small villag, a shipwreck, and a witch hut.\n\n\nYou should definitely check out this map!\n\n\nHouses created by: pixelscarfYT', 'https://www.youtube.com/channel/UCcfoSjOrskabK8Hfmaa2WlA', '', '4gxkzJm', '', 'Survival, House, Medieval', '18.5 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '936', 'Train Station', 'This map features a european style train station.\n\nCreation: [-Dectec-]', 'https://www.youtube.com/channel/UCRBC62GL9P_YeRmHTZ5WiGQ', '', 'iljwoOt', '', 'Creation', '974 kB', '1.7.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '937', 'Tanav''s Survival World', 'This map features a tiny house with may farms, including:\n\niron golem farm,\nrooftop wheat farm,\nbeetroot farm,\ncarrot farm\nand pumpkin, melon, potato farms\n\n\nThere''s a hidden chest with diamonds somewhere in the house.\nYou have an iron farm which you will find 10 blocks above you when you go straight from the door crossing the river.\n\nThere''s an enchantment table near the animal farm which is underground.\nThere''s also villagers just behind your house near the river.\n\n\nEnjoy!\n\nCreator: It''s TANAV ', 'https://mcpe.app', '', 'EvEUgrR', '', 'Survival, House', '17.3 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '938', '20 Command Block Creations', 'This is a tutorial world, which will show you how to create 20 different command block creations:\n\n#1 – Auto-Smelt\n\n#2 – Remove Player Offline\n\n#3 – Money Transferring System\n\n#4 – Custom NPC Shops\n\n#5 – One Player Sleep System\n\n#6 – Randomised Chest Loot\n\n#7 – Cursed Mobs\n\n#8 – Custom Floating Text\n\n#9 – Custom Ranks\n\n#10 – /sudo (tellraw)\n\n#11 – Server Crates\n\n#12 – Player Tracking Compass\n\n#13 – Custom Portals\n\n#14 – Floating Signs\n\n#15 – Auto-Refilling Chests\n\n#16 – Particle Trails\n\n#17 – Spawn Protection\n\n#18 – Chest Shops\n\n#19 – Clickable NPCs\n\n#20 – Customisable Scoreboards\n\n\nCreator: jesser101\nDiscord: discord.com/invite/h4TtFjY\nYoutube: PixelPlay Official\n', 'https://www.youtube.com/channel/UCW069JKDr60hiCGtKP01fwg', '', 'WOkeIVx', '', 'Creation, Command, Tutorial', '1.6 MB', '1.16.100+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '939', 'Galaria Theme Park', 'GALARIA is a colorful theme park with many attractions.\n\nThere are many rides in GALARIA that you can enjoy.\n\nThe park is divided into 3 zones: \nPraja Zone (City)\nFantasy Zone\nJenggala Zone (Forest)\n\n\nCreator: IkiDepta\nYoutube: DevAmada CH', 'https://www.youtube.com/channel/UC0DyIvT5AgVthdoLnibsL1A', '', 'iOQJK2v', '', 'Rollercoaster, Park, Amusement', '4.1 MB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '940', 'Most Secure Base', 'Can you break into this super secure base and steal the Dragon Egg?\n\n\nThere are many redstone security mechanisms, traps, passcode protected doors etc.\nGet through all of them to get into the hidden room!\n\n\nCreator: BLyNkz\nYoutube: BLyNkz', 'https://www.youtube.com/channel/UC1R4qIje1H-gJOUNJCNi5Ww', '', 'iI5JGqF', '', 'Redstone, Base, Puzzle', '1.9 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '941', '10 Redstone Mechanisms', 'This map showcases 10 interesting redstone mechanisms:\n\n#1. Controllable Beacon: This Machine Allows you to Controlling the Different Effects in a Beacon.  Not only can it change Effects it also Changes colors in each different effects. \n\n#2. Hidden Dispenser Trap: This trap is really good since this will be hidden and undetectable until it gets triggered. \n\n#3. 3×3 Hidden Nether Portal: This Machine is the only Machine in Bedrock Edition That does not require Slime Blocks. ( I also made a Tutorial on this. Check it out on my YouTube Channel )\n\n#4. Hidden Staircase Entrance: This Hidden Staircase Entrance is not noticeable when not activated and has very fast opening and closing.\n\n#5. Automatic Brewing Station Machine: This Machine Allows you to make you’re own potion automatically. It also gives you an option to make it splash potion and increase potency/power or duration. \n\n#6. Inventory and Storage System: This machine is just like a bank. You can store you’re items in there and also get you’re stored items in there. \n\n#7. Secure Chest: This Chest Has a Secret Combination lock  in order for it to display the items. ( Inside the Chest is a very powerful weapon. Check this map out if you’re curious) \n\n#8. Beacon Color Combination Lock: This machine is combination lock that allows you to simply lock any redstone related stuff such as a door. \n\n#9. 3×3 Hidden Waterfall Entrance: This is first 3×3 Flush with the wall Waterfall Entrance in Bedrock Edition. The Opening and closing on this machine is really cool. \n\n#10. Slot Machine: This is basically like a mini game machine. Winning on this is just a matter of luck so…  good luck on winning and having fun on this.\n\n\nCreator: BLyNkz\nYoutube: BLyNkz', 'https://www.youtube.com/channel/UC1R4qIje1H-gJOUNJCNi5Ww', '', 'bpK09mM', '', 'Redstone, Tutorial', '314 kB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '942', '15 Redstone Door Mechanisms', 'This map showcases 15 redstone door mechanisms of varying complexity.\n\nYou strat from a simple pressure plate door, to huge slide doors, hidden door frames, lava wall door, hidden staircases and more!\n\n\nCreator: BLyNkz\nYoutube: BLyNkz', 'https://www.youtube.com/channel/UC1R4qIje1H-gJOUNJCNi5Ww', '', 'XIP4K8O', '', 'Redstone, Tutorial', '110 kB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '943', 'Lab Experiment PvP [2+ players]', 'This is a PvP game for 2+ players.\n\nIt''s a recreation of Roblox game called "Lab Experiment", where player''s goal is to survive on the plate and be the last one standing.\n\nEvery second there''s a new disaster happening and you have to survive them!\n\nThere are many game modes you can choose from: giant plate, sudden death (lowered), skyscraper, heal, poison, planks and others.\n\n\nYou begin in the lobby where you wait for the game to start. There are multiple mini-games in the lobby which you can play while waiting: parkour levels, mini spleef, lava run and others.\n\n\nCreator: Veinify\nYoutube: Veinify', 'https://www.youtube.com/channel/UC_3kX5OE6gkz1Rek_dVf_AA', '', 'i7z70k4', '', 'Game, PvP', '11.8 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '944', 'Beachside Mega Mansion', 'This enormous beachside mansion is a luxury home and B&B resort.\n\nIt is located in a lush tropical environment with an ocean to the West and a calm bay to the East. There is a gated drive with a security post to limit access.\n\nIt contains:\n\n• 14 bedrooms\n• 8 bathrooms, and 4 half baths. \n• a master suite with walk-in closets, whirlpool tub, private rooftop lounge and even a secret panic room. \n• a formal dining room and a breakfast nook.\n• 2 kitchens and a kitchen prep room. \n• a great hall for dining or balls with a grand piano.\n\nThere is an indoor pool, gym and sauna with shower facilities. There are also multiple sitting rooms, a library, an office and also a basement game/movie room attached to a sunken garden, and even a LAN gaming room. The house has 2 live-in servants quarters and an attached 6-bay garage and a 2 bay boathouse with a rooftop patio area.\n\nOutside there is a luxury beach-side gazebo and beach access with shower and bathroom facilities.\n\nThere is an outdoor pool with 2 hot tubs and a swim-up bar attached to a bar and lounge and guesthouse. Nearby is a tennis court, sand volleyball, indoor basketball court and driving range. A grounds keeper’s house stands near the bridge over the inlet connecting the ocean to the bay. North of the mansion there is a 6-hole golf course (more to come soon).\n\n\nCreator: COLFETTERS', 'https://www.planetminecraft.com/member/colfetters/', '', 'FFVGihR', '', 'House, Mansion, Survival', '33.7 MB', '1.7.0+', '0', 'https://steamcommunity.com/id/col_fetters'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '945', 'Underwater House', 'Cozy compact house built right into an underwater cliff.\n\nEnjoy the best view of a corall riff and beautiful tropical fish and dolphins swiming right outside of your window!\n\nThis house is equipped with basic tools needed for a great survival game:\n• crafting table\n• regular and ender chests\n• brewing stand\n• hidden enchanting room\n• and more\n\n\nCreator: emywilk\nBased on a design by Zaypixel, check out their youtube channel!', 'https://mcpe.app', '', 'Ll2P3XL', '', 'House, Base, Survival', '5.4 MB', '1.7.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1167', 'Skyblock with Structures', 'Skyblock with Structures is a spin on the popular Skyblock map, it includes different floating islands of each biome and with unique Minecraft structures like:\n• Witch House\n• Outpost\n• Bastion\n• Mansion\n• Desert temple\n• Jungle temple\n• and others!\n\n\nCreator: SrCamerot\nYoutube: SrCamerot\n', 'https://www.youtube.com/channel/UCyddt_OW3PJKOSQj44384Qg', '', 'nrsHjx3', '', 'Skyblock, Survival', '21.1 MB', '1.16.100+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '946', 'Kit PvP', 'This is the ultimate PvP arena with 13 kits and 13 arenas to choose from!\nThis map is for 2+ players.\n\n\nKits:\n• Knight Kit\n• Archer Kit\n• Tank Kit\n• Assassin Kit\n• Rouge Kit\n• Poseidon Kit\n• Healer Kit\n• Warper Kit\n• Gladiator Kit\n• Mage Kit\n• Glider Kit\n• Leaper Kit\n• Snowman Kit\n\nArenas:\n\n• Main Arena\n• Diamond Arena\n• Iron Arena\n• UHC Arena\n• Combo Arena\n• Leather Arena\n• Jungle Area\n• Slither Pit\n• Nether Arena\n• Ender Arena\n• Circle Arena\n• Ladder Arena\n• Sumo Arena\n\n\nCreator: LightKnight2311\nTwitter: GoldenCreeper88', 'https://mobile.twitter.com/GoldenCreeper88', '', 'XcFuc61', '', 'PvP, Game', '12.5 MB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '947', 'CraftWeird Games', 'This map has 7 game types, 20 different games, a large Unfinished lobby, ranks and cosmetics, a money system, achievements, parties, and a lot more!\n\nThe games are: \n\n•• TnT games ••\n\ntnt run, bow spleef, and tnt tag\n\n\n•• Planets ••\n\nSurvive on the planets, while avoiding disasters like meteor showers, alien invasions, and exploding suns.\n\n\n•• Prisons ••\n\nClassic game of mining, with a few twists, including a landscape and lore!\n\n\n•• Kit PvP ••\n\nChoose a kit, choose a class, and fight! There is also crafting and singleplayer PvE mode, when there are no other players in kit pvp, mobs will start spawning.\n\n\n\n•• Ore wars ••\n\nYou and another player get ores, bridge across lava, and fight! There is also creative mode.\n\n\n•• Duels ••\n\nHas 9 different types, including bow, spartan, uhc, and sumo.\n\n\n•• Build UHC ••\n\nAnother popular game mode, where you get to build, mine selected blocks, and fight your friends.\n\n\nCreator: CraftWeird\nVisit their youtube channel: CraftWeird Games\nTwitter: CraftWeirdGames\nYou can join the realm at https://realms.gg/5E9HIQYTbdg\n', 'https://youtube.com/channel/UC7dlBOdIQCIhd2ldhcewq7w', '', 'XD5yEga', '', 'PvP, Game', '3.6 MB', '1.16.200+', '0', 'https://youtube.com/channel/UC7dlBOdIQCIhd2ldhcewq7w\nhttps://twitter.com/craftweirdgames\nhttps://realms.gg/5E9HIQYTbdg'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '948', 'Craft Royale', 'This is a Fortnite-like PvP game in Minecraft.\n\nDifferent gamemodes:\n• Classic\n• Dead Trouble (adds Zombies)\n• Bladed Victory LTM (Infinity Blade is added, Including Ravania…)\n• Second Life (Spawn with Totem-of-Undying)\n• Explosives (Spawn with Explosives)\n• Knives Out (Swords do 3x more damage)\n• Duos\n\nYou can vote for the gamemode in the lobby!\n\nVehicles:\n• X-4 Storm Wing Plane\n• Shopping Cart\n• All Terrain Kart\n• Quadcrasher\n\nJust like in Fortnite you can build on the map while you''re playing.\n\nLocations:\n• Happy Homes\n• Sandy Sundunes\n• Mystic Mountain\n• Tiny Towers\n• Christmas Town\n• Lefty Lake\n• Dirt Fields \n• Farming Fields\n• Crooked Crater\n• Labyrinth Laboratories\n• Creative Campgrounds\n\n\nCreators: KrakenCreations. MineClan888, Th3LastSh3riff, LUCKYBLOCK17o\nDiscord: discord.gg/YK8RRug\nTwitter: krakencreation1', 'https://twitter.com/krakencreation1', '', 'U7BMLhD', '', 'PvP, Game, Fortnite', '5.7 MB', '1.9.0.15+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '949', 'Easy Survival Course', 'This is a short but entertaining survival course with easy parkour, a small maze, traps and a final boss at the end of the track. Can you beat it?\n\nFor a better gameplay it is recommended to set visibility to 5.\n\n\nCreator: dimoncherebrak', 'https://mcpe.app', '', 'yJfs1uv', '', 'Parkour, Game', '295 kB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '950', 'Rawknee Games World', 'A recreation of The Rawknee Games''s survival world.\n\nCreators:\n\n• The RawKnee Games\n• EpicBongBoy; Youtube: EpicBongBoy', 'https://mcpe.app', '', 'ST8sD7E', '', 'Survival, Youtube', '31.6 MB', '1.16.0+', '0', 'https://www.youtube.com/c/EpicBongBoy'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '951', 'Dark Deception Horror Map', '!!!WARNING!!!: This map contains elements of horror gameplay! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\n\nIn this horror map you have to go through 10 nightmares and collect soul shards. You are being chased by your fears!\n\nYou can use power ups to make your way through all 10 levels, and make sure you don’t get killed by the monsters. And remember you have 1 health, so you can die easily.\n\nEnemies:\n\n• Murder monkey\n• Agatha \n• Gold watchers\n• Dread ducky\n• Clown Gremlin\n\n\nCreator: YoBOIArmy\nYoutube: Kenji_Gaming', 'https://www.youtube.com/channel/UCTge7dtMsjWAT3o_VXFjN0w', '', 'NLxHLgG', '', 'Horror, Puzzle', '725 kB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '952', 'WEN Castle Anurag', 'This map features two castles: one in the Overworld and another in the Nether near a fortress.\n\nFollow the signs to reach the nether castle.\n\nThere are multiple other structures near the Overworld castle:\n• a wooden house \n• a village\n• Astronomia music to listen to by pressing a button.\n• beacon rainbow\n• TNT launcher (machine)\n• XP farm\n• Archery center to play archery\n• TWO Iron farms\n• Bamboo farm\n• Kelp Xp farm\n• Chicken farm\n\nCreator: AnDoD Gamerz\n\nFollow us on:\n\nInstagram :andod_gamerz\n\nYoutube channel: #AnDoD Gamerz (youtube.com/channel/UCVYin8Es9kdKASaeD7ElTgw)', 'https://youtube.com/channel/UCVYin8Es9kdKASaeD7ElTgw', '', 'bAlLkz0', '', 'Castle, Survival, Village', '31.3 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '953', 'The Rift Boss Fight', 'The Rift is a command block boss fight. The boss is a very strong zombie with multiple different attacks. There are 4 levels of difficulty. They differ by the power-up spawn rate and the type of kit that you get.\n\nTo summon the boss, drop the summoner (Dragon Head) on the bedrock block in the middle of the map.\n\n\nCreator: BluFlyaway\nTwitter: BluFlyaway1', 'https://twitter.com/BluFlyaway1', '', 'KYj0RFA', '', 'Game, Boss, Commands', '510 kB', '1.2.11.4+', '0', ''
    );
