      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '954', 'Self Building House [Redstone, CB]', 'This creative map features a self-building house with cool animations and fitting sounds!\n\nCreator: BluFlyaway\nTwitter: BluFlyaway1', 'https://twitter.com/BluFlyaway1', '', 'd1HfdGm', '', 'House, Redstone, Commands', '2.1 MB', '1.2.10.2+', '0', ''
    );
