      '955', 'Blu’s Redstone House', 'This is a big house with a lot of clever redstone contraptions: hidden rooms, automatic doors, etc.\n\n\nCreator: BluFlyaway\nTwitter: BluFlyaway1', 'https://twitter.com/BluFlyaway1', '', 'xBH5VNZ', '', 'House, Redstone, Commands', '5.7 MB', '1.2.13.60+', '0', ''
    );
