    ) VALUES (
      '956', 'Nether Modern House', 'Have you ever dreamt of having a house in the Nether? Then this map is for you.\n\n\nCreator: PointySalt\nIGN: PointySalt22968', 'https://mcpe.app', '', 'Qcdoty4', '', 'House, Nether', '4.7 MB', '1.16.200+', '0', ''
