INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '957', '25 Ways To Die', 'This is a fun challenging puzzle based single player minigame with 25 +1 very creative, differently themed levels. The goal is to find a way to die. Once dead, you will respawn in the next level.\n\nThe levels are themed around TV shows, movies, memes or some Minecraft references.\n\n\nCreator: BluFlyaway\nTwitter: BluFlyaway1', 'https://mcpe.app', '', 'Bv2Ol8A', '', 'Game, Puzzle', '311 kB', '1.2.8.0+', '0', 'https://twitter.com/BluFlyaway1'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '958', 'Sticky Situation [Parkour]', 'This is a honey parkour course with 5 stages of easy to medium difficulty. You will have to perform sliding, sticking, and leaps of faith.\n\nCreator: Gswizzle22', 'https://mcpe.app', '', 'Mn1E8sZ', '', 'Parkour, Honey', '3.5 MB', '1.16.0+', '0', ''
