INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '959', 'Survival Bingo', 'In this survival minigame your objective is to find the items shown on the filled bingo card by exploring, crafting and mining. Fill up your empty card to match the filled card to win!\n\nYou can win with 4 corners, 4 diagionals or 4 straight lines.\n\nThere are 3 different locations, with unique terrain and different cards.\n\n\nYou can play in multiplayer (max 4 players) or in single player mode.\n\n\nCreator: MattH44\nTwitter: MattTheMiner44', 'https://twitter.com/MattTheMiner44', '', 'jffepdJ', '', 'Game, PvP', '1.3 MB', '1.2.11.4+', '0', ''
    );
