      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '960', 'Customizable Command Block House [Redstone]', 'This map features a customizable house. With just a press of a button you can change different features of the house: roofing, walls, fences, pools, decorations and many others!\n\nFind your favorite combination and build your dream house!\n\nCreator: MattH44\nTwitter: MattTheMiner44', 'https://twitter.com/MattTheMiner44', '', 'VukXeLu', '', 'House, Redstone, Command', '1.5 MB', '1.4.3.0+', '0', ''
    );
