      '963', 'DreamSMP Parkour', 'This map features a parkour course inspired by the DreamSMP server.\n\nIt consists of multiple creations resembling buildings from the server, such as: the community house, the power tower, Tommyinnit’s vacation home, L’manburg, the Prison and others.\n\n\nCreator: MINIPRO27YT\nYoutube: MINIPRO27\nTwitter: Pro27Mini', 'https://www.youtube.com/c/MiniPro27/videos', '', 'A3fw68H', '', 'Parkour, Dream, DreamSMP', '7.2 MB', '1.16.200+', '0', 'https://www.youtube.com/c/MiniPro27/videos\nhttps://twitter.com/Pro27Mini'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '964', 'Beyond the Portal | FTB Nether', 'Find the Button minigame set up in the Nether!\n\nThere are 10 levels:\n\n1. The Beginning of the End\n\n2. Infected Forest\n\n3. A Time Before Change\n\n4. A Slow Souly Demise\n\n5. The Not Cobble Nether Bridges\n\n6. The Ne-end-er Glitch\n\n7. Ancient Debris Mines\n\n8. The Fungi Sanctuary\n\n9. Basalt Delta Royalty\n\n10. Strider Stables\n\n\nCreator: manifest\nYoutube: https://youtube.com/c/ManifestChannel/\nTwitter: https://twitter.com/notalienboy', 'https://www.youtube.com/c/ManifestChannel/', '', 'esINhom', '', 'Game, FTB, Nether', '347 kB', '1.16.200+', '0', 'https://youtube.com/c/ManifestChannel/\nhttps://twitter.com/notalienboy'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '965', 'Fork World Survival [skyblock]', 'You wake up in a plane which crashed on a giant... fork?!\n\nExplore the floating fork world and the surrounding islands, and try to survive and defeat the End Dragon!\n\n\nCreator: SCYTHEBRINE\nYoutube: Sandbox Guy', 'https://www.youtube.com/channel/UC22XYmiDLygdg_y9DFmyrjA', '', 'G31SiRc', 'My3Kqe6HSkU', 'Survival, Skyblock', '245 kB', '1.14.0.52+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '966', 'CTF: The Runaway Edition', 'This is a classic minigame of Capture The Flag.\n\nThe players are divided into two teams. You need at least 2 players to play.\n\nThere are 2 game modes:\n\n--- Normal Mode ---\nEach team''s flag spawns in their respective towers. Your goal is to steal opponents'' flag and bring it to your tower. First team to score 3 points wins.\n\n--- Runaway Mode ---\nPlayers get 1 minute to gather loot before the match begins. After that they are teleported to their towers and the flag spawns in the middle of the map. In this mode the flag will try to run away from players. First team to bring the flag to their tower wins.\n\n\nCreator: BluFlyaway\nTwitter: BluFlyaway1', 'https://mcpe.app', '', 'KZxfhQE', '', 'Game, PvP, CTF', '1.9 MB', '1.2.6.55+', '0', 'https://twitter.com/BluFlyaway1'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '969', 'Advanced Redstone Mansion', 'This is a quite old, but still very impressive map featureing a mansion with many clever redstone mechanisms:\n\n• automatic cooking stove, fridge\n• shower\n• automatic wardrobe\n• automatic waterfall, pool, lights, nether portal\n• automatic crop farms, animal farms\n• mob farms, iron farm\n• automatic smelter\n• automatic brewing room\n• and many more!\n\nBecause this map was created in an old version (0.15), some mechanisms may not work correctly in the latest versions.\n\n\nCreator: blueboy\nTwitter: dhruwlalan\n', 'https://twitter.com/dhruwlalan', '', 'o5RdAoe', '', 'House, Redstone', '9.0 MB', '0.15.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '970', 'Stark Mansion', 'This map features Tony Stark''s Mansion from the Iron Man movies. There are some redstone mechanisms, and a hidden room of the Iron Legion.\n\n\nCreator: GravePencil1441', 'https://mcpe.app', '', 'OVSG4BJ', '', 'House, Redstone', '6.7 MB', '1.12.0.25.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '971', 'Rage''s Lab', 'This is a redstone lab, with an automatic sugar farm, automatic tree farms and an automatic sorter for the storage etc.\n\n\nCreator: Rage2505', 'https://mcpe.app', '', '2wXgkP2', '', 'House, Lab, Redstone', '6.3 MB', '1.1.3+', '0', ''
