INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '972', 'Hide and Seek Morph', 'In this unique hide and seek map hiders can morph into different creatures!\n\nAt the beggining of a rounf you can choose between 3 unique maps and different mobs to morph into:\n\n• chicken\n• cow\n• villager\n• sheep\n• and others\n\n\nCreator: ELRandomMan\nELRandomDude', 'https://www.youtube.com/channel/UCSoHJszCmYRxx24VRsKScKg', '', 'nBCBsOp', '', 'Game, H&S, Hide and Seek', '729 kB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '973', 'Adventure Minigames', 'This map features with multiple PvP, FFA and team vs team minigames:\n\n• Castle Defense: defend your castle''s villager from zombie waves!\n• Tag\n• Bullseye: hit 5 bull''s eyes before your opponents\n• Ways to Die: find ways to die\n• Dodge Snow: snowball fight\n\nThere''s also a cool lobby with parkour and other minigames to play while you''re waiting for a game.\n\n\nCreator: ELRandomMan\nELRandomDude', 'https://www.youtube.com/channel/UCSoHJszCmYRxx24VRsKScKg', '', 'wMb2fVX', '', 'Game, PvP', '477 kB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '974', 'Private Island Luxurious Mansion', 'A luxurious mansion located on a beautiful private island called Santa Luisa.\n\nThe mansion has:\n\n• 8 bedrooms (2 guest, 5 en suite and master suite)\n• Multiple large living spaces\n• 2 main dining areas plus main kitchen\n• 3 bars\n• Study and office area\n• Multi-car garage\n• Home cinema and wine cellar\n• Gym\n• Large semi-outdoor leisure space\n• Multiple sun bed and lounge areas\n• Huge infinity pool\n• Basketball court\n• Outdoor kitchen and eating area\n• Guest carpark\n• Private beach\n• and more\n\n\nCreator: ackers5861\nYoutube: ackers5861', 'https://www.youtube.com/channel/UCVOGvVoAj_4gfrjCcrH8-3Q', '', 'yxQnsJr', '', 'House, Mansion, Island', '9.6 MB', '1.12.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '975', 'GTA SA: Idlewood', 'This map recreates the area around the Idlewood district from GTA San Andreas.\n\nThere are many iconic locations:\n• Los Santos Stadium\n• The Los Santos River\n• Vagos hangout\n• Grove Street\n• and others\n\n\nCreator: Raymancaster', 'https://mcpe.app', '', 'QRMjCej', '', 'City, Creation', '10.1 MB', '1.2.6+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '976', 'Poke Balls [Pokemon]', 'In this map you can equip Poké Balls and use them for catching mobs.\n\n1. SWITCH THE LEVER DOWN!\n2. Throw a poke ball near a mob you want to cath\n3. You will receive a spawn egg of that mob\n\nIt only works in close proximity to the command block room.\n\n\nCreator: Kingbudderjr', 'https://twitter.com/kingbudderjr', '', 'mqxmQzl', '', 'Pokemon, Commands', '1.2 MB', '1.0.7+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '977', 'Granny: Chapter 2', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\nYou are locked in a house with Granny and Grandpa. Collect tools and try to escape the house within 5 days without being caught.\n\n\nCreator: Last Warning, AshishX\nYoutube: AshishX0MC', 'https://www.youtube.com/c/AshishX', '', 'jFbtex3', '', 'Horror, Adventure, Puzzle', '11.5 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '978', 'Piggy Horror', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\nThis is a Minecraft adaptation of the "Piggy" — a popular Roblox horror game originally made by Minitoon.\n\nYou''re locked in Piggy''s house and have to find your way out of it without getting killed. You only have one day!\n\n\nCreator: Itsryanfire\nYoutube: ItsRyanFire', 'https://www.youtube.com/channel/UCG_wjI_ViYLL1JO9uSwaVQA', '', 'hB0907p', '', 'Horror, Adventure, Puzzle', '1.8 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '979', 'Natural Disasters', 'In this minigame players are spawned on a small map and are faced with waves of natural disasters, the last one standing wins!\n\nThis map supports both singleplayer and multiplayer.\n\nThe disasters are:\n\n• Thunderstorm\n• Cold Wind\n• SAW\n• Spoopy Fish\n• Murderers\n• Levitation\n• Grumpy Gad the Ravager\n• Phantoms\n• The Plane\n• The Wither\n• Arrow Rain\n• Fire\n\nYou can add these effects in the modifier lobby:\n\n– Speed 3\n– Jump Boost 2\n– Natural Regeneration\n– Blindness\n– Rain and Thunder\n– Nausea\n– Slow Falling\n– More HP\n\n\nCreator: KrakenCreationsMCPE\nTwitter: krakencreation1', 'twitter.com/krakencreation1', '', '2ru6Gvs', '', 'Game, PvP', '157 kB', '1.12.1.1.1+', '0', ''
    );
