      '981', '"Awesome City" by Connorrule', 'An Awesome City that took quite a while.\n\n\nCreator: Connorrule', 'https://mcpe.app', '', 'SXUjulS', '', 'City, Steve', '15.5 MB', '1.2.7+', '0', ''
