INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '982', 'New Avengers Facility', 'The New Avengers Facility was the primary base of operations used by the Avengers﻿ after the defeat of Ultron and the establishment of the team''s new roster.\n\nCreator: MorkiGlog', 'https://www.planetminecraft.com/member/morkiglog/', '', 'u5Djs6e', '', 'Creation, Marvel, Avengers, Spiderman', '21.0 MB', '1.12.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '983', 'KC: Murder Run', 'Murder Run is a game where players are divided into 2 groups: a Murderer and Survivors.\n\nSurvivors'' goal is to hide and survive the night. They can buy and use different traps to defend themselves.\n\nMurderer''s goal is to find and eliminate all the Survivors. He can also buy and use traps to help him hunt down the Survivors.\n\nTo use traps just throw them on the ground. Traps are activated when player steps on them.\n\nBoth teams have 2-3 minutes to buy traps.\nThen Survivors are given 30 seconds to hide.\nAfter that the match begins!\n\n\nCreator: KrakenCreations\nTwitter: krakencreation1', 'twitter.com/krakencreation1', '', 'qcUCa84', '', 'PvP, Game, Hide and Seek', '1.2 MB', '1.12.0.25+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '984', 'Bloxnite', 'Bloxnite is a PvP minigame based on Fortnite with moving bus, working crate, shop and building systems!\n\n\nCreator: KrakenCreations\nTwitter: krakencreation1', 'twitter.com/krakencreation1', '', 'jS9ahEM', '', 'Pvp, Game, Fortnite', '17.3 MB', '1.2.16.3+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '985', '12 Minigames', 'This map features 12 great minigames:\n\n• Ore Wars\n• Roadrunner\n• King of The Hill\n• Turtle Trek\n• Races\n• Prisons\n• TNT Run\n• Kit PvP\n• Farmer vs Imposter\n• Murder Mystery\n• Capture the Flag (CTF)\n• Spleef\n\nCreator: KrakenCreations\nTwitter: krakencreation1\nYoutube: Cr1smatic -', 'twitter.com/krakencreation1', '', '2FhiDWy', '', 'PvP, Game', '6.3 MB', '1.2.8.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '986', 'Hit PvP: PvP Practice', 'With this map you can practice your PvP skills.\n\nGrab your items: armour, weapons and potions and walk into arena!\n\nYou can play against other players or in a singleplayer against an NPC.\n\n\nCreator: MC Digger\nYoutube: MC Digger', 'https://www.youtube.com/channel/UCSvSK7iHHw-_ehUaniuz9kg', '', 'tkmIaKL', '', 'PvP', '1.6 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '987', 'FNAF Note Block Song', 'Listen to FNAF main theme played by a bunch of noteblocks and redstone cleverly put together.\n\n\nCreator: LesterPlaysMCPE', 'https://mcpe.app', '', 'bhIgQ8R', '', 'Creation, Music', '164 kB', '0.14.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '988', 'Death Swap PvP', 'Death Swap is a PvP minigame for 2 players.\n\nAt the beginning of the round you and your opponent are teleported to 2 random locations in the world. Every 3-7 minutes you automatically swap places.\n\nYour goal is to set up your spot in such a way as to kill your opponent when he teleports to your location.\n\n\nCreator: ThanPixel, BlueSlimeMC\nYoutube: BlueSlimeMC', 'https://www.youtube.com/channel/UCGl7QyMA-khA_fDj3aqf9kA', '', 'DI5u54G', '', 'PvP, Game', '1.0 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '989', 'Escape From The Mind [Horror]', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\nThere are rumors that Herobrine is haunting an abandoned castle. You are sent on a mission to find out the truth. Or maybe there is no castle at all and it''s just Herobrine playing trick with your mind?? \n\nLook for secrets and hidden items and solve puzzles to solve this mystery.\n\nThere''s a hidden ending to this map in the cell 4... Can you find it a way to unlock it?\n\n\nCreator: VirusX728', 'https://mcpe.app', '', 'roi2X5h', '', 'Adventure, Horror, Puzzle', '745 kB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '990', 'Escape From The Mind II [Horror]', '"!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\n ••• It is recommended to play the first part before this one •••\n\n10 years have passed since your dreadful experience with the Herobrine, when you were imprisoned in your own mind by him... You thought you stopped him, you thought he was gone once and for all.\n\nBut rumors have it that he has returned. People started disappearing from the town again. You are suspicious that Herobrine has reawakened and returned to terrorize people. Go back to the castle and find out what is going on!\n\n\nCreator: VirusX728', 'https://mcpe.app', '', 'wiSlh7l', '', 'Adventure, Horror, Puzzle', '9.6 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '991', 'Black Snow: Escape from Hospital', 'This is an escape adventure map. You wake up in an empty hospital and have to find a way out. Find tools and items to help you with your mission.\n\nCreator: Last Warning\nYoutube: AshishX', 'https://www.youtube.com/c/AshishX', '', 'mGjo0vM', '', 'Adventure, Escape', '3.6 MB', '1.9.0.5+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '992', 'aVIRa 2.0 [Adventure]', 'You are a programmer sent to explore the inside of a giant ancient computer and find a way to fix it with the help of a friendly AI system. Or is it really friendly?\n\nThis is a beautiful, very detailed map with a great storyline, set in a cyberpunk style.\nThere are many puzzles, mazes, parkour courses, elytra tracks and more!\n\nThis map has multiple endings, can you find them all?\n\n\nCreator: MegaStriker\nYoutube: LucasMegaStriker', 'https://www.youtube.com/channel/UC12_LkO0cjnC2U5tw3mQAwA', '', 'EFrT2eZ', '', 'Adventure, Computer, Cyberpunk', '1.1 MB', '1.0.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '993', 'Mr. Meat [Horror]', 'This map is a recreation of a popular horror adventure mobile game originally made by Keplerians Team.\n\nStory:\nSave a girl locked in the house and escape with her.\nBeware of Mr. Meat who will be chasing you. Remember, he can hear your every step. You can use it to your advantage and mislead him. You only have 3 nights!\n\n\nCreator: Itsryanfire\nYoutube: ItsRyanFire', 'https://www.youtube.com/channel/UCG_wjI_ViYLL1JO9uSwaVQA', '', 'pF1zInt', '', 'Horror, Adventure', '1.5 MB', '1.12.0.25.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '994', 'Ultimate map collection (UMC) 2', 'This single world contains a lot of great minigames and places to explore:\n\n• parkour\n• droppers\n• maze\n• find the button\n• puzzles\n• trivia\n• and more\n\n\nCreator: anto11', 'https://mcpe.app', '', 'kvaZt3Z', '', 'Game, Creation', '8.0 MB', '1.16.210+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '995', 'Shourya''s  castle', 'Small and cozy castle located in a village. There is a storage room, an enchantment room, a stable with a horse, farms outside the castle, a large ruind portal and more.\n\nThe castle is surrounded by many villages, there are at least 5 in the close vicinity. Great map for a survival!\n\n\nCreator: Shourya Vashishth\nYoutube, Instagram: shourya Vashishtha', 'https://mcpe.app', '', 'zmUYiqO', '', 'Survival, Castle, Village', '3.7 MB', '1.16.0+', '0', 'https://www.youtube.com/channel/UCV7R74zyc-7R8Ip6uIzj-HQ'
    );
