    ) VALUES (
      '997', 'Quest Open RPG [Adventure]', 'This is an interesting RPG-style adventure map set in medieval town.\n\nYou joined a Heros Guild and have been sent to the town of of Trinity to help local people with their needs.\n\nThere are 8 main and 9 side quests, as well as several easter eggs.\n\n\nCreator: Kandymusic88 / Frank Reese', 'https://mcpe.app', '', 'owX5h8r', '', 'Adventure, Village, RPG, Castle', '2.0 MB', '1.2.1.1+', '0', ''
