INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '998', 'Suburban Neighborhood', 'This map features a suburban neighborhood consisting of over 50 mansions and administrative buildings.\n\nEach house has a uniqine architecture and front and backyard decorations.\nBut there are NO INTERIORS, the houses are empty inside.\n\nIt is great for multiplayer RP gameplay or just for house building inspiration.\n\n\nCreator: Gatharian', 'https://mcpe.app', '', 'xXloFEV', '', 'City, Creation', '48.0 MB', '1.1.0+', '0', ''
    );
