    ) VALUES (
      '999', 'ArkCraft', 'This map is based on the game Ark: Survival Evolved.\nIt showcases many beautiful creations which you can explore.\n\n\nCreator: HorizonCrew', 'https://mcpe.app', '', 'brjr24k', '', 'Creation, Ark, Dinosaurs', '23.4 MB', '1.2.0+', '0', ''
