      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1000', 'Oceanic Redstone House [50+ mechanisms]', 'This awesome house has more than 50 clever redstone mehcanisms!\n\nIt looks small on the outside, but it''s size is deceiving, there are:\n\n• hidden rooms\n• automatic farms\n• underwater basements\n• nuclear bunker\n• automatic armor equipping\n• and many many more!\n\n\nCreator: XProfessorX', 'https://mcpe.app', '', 'JYk52MC', '', 'House, Redstone, Ocean', '9.8 MB', '1.2.16+', '0', ''
