INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1002', 'NXUS Modern City', 'NXUS Modern is one of the most detailed and realistic modern cities in MCBE!\n\nIt has a lot of beautiful skyscrapers, office buildings, a huge science center, embassies a fully working metro system, malls, fire station, bus port, city park and much more!\n\nAll the buildings interiors are fully decorated!\n\n\nCreator: NXUS', 'https://mcpe.app', '', 'YYHw8eL', '', 'City, Modern', '3.1 MB', '1.2.14+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1003', 'TRG Village', 'This is a medieval styled town that has been modeled in the architecture style of the 1300s. It''s a really nice map featuring a realistic medieval town with a big castle in the town center and lots of other structures such as shops, beautiful gardens and a few hidden features which you may come across while exploring it.\n\nCreator: xXRubyGamersXx\nYoutube: TheRubyGamersTRG', 'https://www.youtube.com/c/TheRubyGamersTRG', '', 'qRFaA2U', '', 'Village, Medieval', '8.8 MB', '1.1.3.52+', '0', ''
