      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1004', 'Escapists: The Prison of Minecraft', 'Use your cunning skills and help from your prison mates to escape from the space prison! Gain emeralds and use them to buy an axe. Then find the hidden wood wall and cut it down. Steal the warden''s ship and escape from the prison!\n\n\nCreator: EvilChicken0990', 'https://mcpe.app', '', 'IuppzJb', '', 'Puzzle, Adventure, Prison, Escape', '1.4 MB', '1.4.0+', '0', ''
