INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1008', 'Ship Wars PvP', 'Two teams - blue and red spawn on 2 ships.\nThe goal is to find the treasure hidden on an island between the ships, and bring it to your ship without getting killed!\n\n\nCreator: Yellow Sharks\nYoutube: xXTimeMast3rXx', 'https://www.youtube.com/channel/UCTH9CIAX1MjP2EPXX9HkUMg', '', 'vbtKYVo', '', 'PvP, Game', '10.6 MB', '1.16.210+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1009', 'Zombie PVE [Guns]', 'In this PvE map your goal is to survive enldess waves of Zombies for as long as you can. You can play alone or with friends.\n\nThere are different types of Zombies:\n\n• Normal Zombie\n\n• Gun Zombie: - carries a gun, and can shoot you. Starts to spawn on wave 5.\n\n• Explosive Zombie - explodes when near you, like a creeper. Starts to spawn on wave 10.\n\n• Puller Zombie - pulls you towards it and damages you when you are within a 5 block range. Starts to spawn on wave 15. Can be disabled using the No Pullers mutator.\n\n\nYou can buy power-ups, buy a turret, upgrade your weapons, tp to shop to buy extra items and much more.\n\nThere are 3 game difficulties to choose from: easy, normal and hard.\n\n\nCreator: Fluffyalien1422\nYoutube: FluffyCraft\nDiscord: invite/xu7G4nG', 'https://www.youtube.com/channel/UC5N0I2lEFMrhk3Mo2qTt3wA', '', 'MmVAXxQ', '', 'PvE, Game, Survival', '7.5 MB', '1.16.0+', '0', ''
    );
