      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1010', 'Escape from The Zombie Prison', 'Prison escape map with a lot of interesting puzzles and twists.\n\n\nCreator: -Deathdoy \nYouTube: -Deathdoy ', 'https://www.youtube.com/channel/UC4ACVOetm2RI57k3flE81uw', '', 'ng5iSeV', '', 'Adenture, Prison, Escape, Puzzle', '355 kB', '1.16.200+', '0', ''
