    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1012', 'Secret Underground Base', 'This base has many rooms like mining area, kitchen, bedroom, armory, secret chest and many more. This is my very first map so if you don''t like it sorry but if you like it, wait for my Prison Break, Modern Redstone House, Secret Underground Base V2 and Redstone Creation Maps. Thanks.\n\n\nCreator: Adrian Gaming\nYT: Adrian Gaming', 'https://www.youtube.com/channel/UCJtX8MobmdampxKdEh8kitA', '', '3M4f4Tu', 'CbUOlucTljo', 'Base, Bunker, House', '2.1 MB', '1.16.210+', '0', ''
    );
