    ) VALUES (
      '1013', 'Naruto Konoha Village', 'This map features multiple locations from Naruto:\n\n— Big and detailed Konoha village and surrounding areas\n— Forty-Fourth Training Ground: the forest and the tower\nand more!', 'https://mcpe.app', '', 'FPPCJHm', '', 'City, Village, Anime', '15.3 MB', '1.12.1.1.1+', '1', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1014', 'Living in the Nether', 'Made it easier For you to survive in the nether, you will find Chests With more loot. You can go out And Find Iron, coal, Red stone, Dimonds, In places. Explore and you may find more!\n\n\nCreator: Jeseejesee 2', 'https://mcpe.app', '', 'Sjf9WNE', '', 'Survival', '6.6 MB', '1.16.220+', '0', ''
    );
