      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1015', 'Simple Bake Shop', 'Description\n- Simple Shop with cashiers and kitchen!\n- You can bake, send the bread or cake to the cashier!\n- You can feed and milk some cows and chickens!\n- You can farm too!\n\nCreator: Adrian Gaming\nYoutube: Adrian Gaming', 'https://www.youtube.com/channel/UCJtX8MobmdampxKdEh8kitA', '', 'eH5L4wA', '', 'Creation', '2.3 MB', '1.16.210+', '0', ''
    );
