      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1016', 'Command Block Tutorial - Basics', 'This map has 5 command block tutorials. You can learn some command Block commands on this map. I''ll be doing Pro and Expert Levels on this Tutorial wait for it :). Thanks.\n\nCreator: Adrian Gaming\nYoutube: Adrian Gaming', 'https://www.youtube.com/channel/UCJtX8MobmdampxKdEh8kitA', '', 'YIGLYKt', '', 'Creation, Command, Redstone', '94 kB', '1.16.210+', '0', ''
    );
