      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1017', 'Short Parkour', 'This is a short but fun parkour course.\n\n\nCreator: didacticband323\nYoutube: crafts_4u', 'https://www.youtube.com/channel/UCreaGRdH5mok_UXp9EF8Q6Q', '', 'Z1ekfdt', '', 'Parkour', '47 kB', '1.16.210+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1018', 'Krusty Krab Nightmare', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\nKrusty Nightmare is horror game where you have finish your job, collect all the money, lock everything inside and leave. But something terrible is going on at 3:00am! A monster is after you…\n\n\nCreator: Itsryanfire\nYoutube: ItsRyanFire', 'https://www.youtube.com/channel/UCG_wjI_ViYLL1JO9uSwaVQA', '', 'Hnhct8M', 'bZn-zczokE4', 'Horror, Adventure, Spongebob', '4.5 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1019', 'Pewdiepie''s Hardcore World', 'This is a pretty accurate recreation of Pewdiepie''s hardcore world. It has:\n\n• Iron Farm\n• 6 Crop farms\n• Melon Farm\n• Automatic Giga Furnace(And an automatic bamboo farm to fuel it)\n• 3 wool farms\n• Automatic Sorting system\n• The Fire temple\n• 4 beacons\n• Trading Hall\n• Giant meatball\n• The Iron Wall\n\nNote: this world was ported from Java edition, so some redstone mechanisms may not work.\n\n\nCreator: shotmc\nYoutube: shotmc', 'https://www.youtube.com/channel/UCoztkl8819G5u1ShrfjXoRQ', '', 'oo25u8j', '', 'Youtube, Base, House', '33.5 MB', '1.14.0.52+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1020', 'Ocean Dream Cruise Ship', 'Ocean Dream is a huge cruise ship with an extremely detailed exterior as well as interior decorations. It has every facility imaginable. Everything from pools and waterslides to more relaxing environments such as lounges and restaurants. Exploring the entire ship can take a long time, but it''s well worth it.\n\n\nCreator: ElectroCreeper\nTwitter: electrocreeperg', 'https://twitter.com/electrocreeperg', '', 'mcGVMsv', '', 'Creation, Ship, Ocean', '2.0 MB', '1.0.4+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1021', 'The Wall Parkour', 'The Wall is a pretty difficult parkour map, with the goal of reaching the top of the wall. But to get there, you will need to jump over a number of obstacles, completing 30 different challenges. All obstacles require some type of jumping, and at some stages failure is punishable by death. But fortunately, there are checkpoints along the way. It''s quite a fun challenge if you like parkour maps.\n\nThis map may frustrate you, but it is possible to beat it. Good luck!\n\n\nCreator: theelectricg', 'https://mcpe.app', '', 't5oPI7Y', '', 'Parkour', '193 kB', '1.0.8.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1022', 'Kyokei City', 'Kyokei City is a city with architecture and style inspired by a Japanese city. It''s a very realistic, beautiful and stylish city that you can spend a lot of time exploring alone or with friends in Minecraft. It took a total of six months to create this city, and that really speaks to the quality you''ll experience when exploring this amazing city!\n\n\nCreator: ingram\nTwitter: Ingram_1998', 'https://twitter.com/Ingram_1998', '', 'GO1a3wS', '', 'City, Japan, Modern', '44.5 MB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1023', 'Kyokei City [1.7.0+]', 'Kyokei City is a city with architecture and style inspired by a Japanese city. It''s a very realistic, beautiful and stylish city that you can spend a lot of time exploring alone or with friends in Minecraft. It took a total of six months to create this city, and that really speaks to the quality you''ll experience when exploring this amazing city!\n\n\nCreator: ingram\nTwitter: Ingram_1998', 'https://twitter.com/Ingram_1998', '', '314Re97', '', 'City, Japan, Modern', '43.1 MB', '1.7.0.13+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1024', 'Boom Battle Heroes 13.4', 'This map features 34 mini-games and 59 different huge \n locations. You will find some of the most popular mini-games from popular servers, such as:\n\nBedwar, Skywar, Among US, Tnt Run, Death Run, Block Party, Capture The Flag, Turf war and many more!\n\n\nCreator: Herotorxp\nYoutube: Herotor xp', 'https://www.youtube.com/channel/UCAKyNGoGKM5b9y1Pn42p55g', '', 'TGN8ysV', '', 'Game, Pvp, PvE, Parkour', '14.0 MB', '1.16.210+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1025', 'Abhinav Survival', 'This is a survival map with:\n• Survival farms\n• xp farm,\n• Gold farm,\n• Storage area,\n• Phantom farm,\n• Enderman farm(there are 2 enderman farm in the end),\n• A main base which have villagers in the room,\n• A sky house which is build in the clouds with a sky beacon,\n• Vegetable farm,\n• Lots of sugar cane which gives a structure when seen from upside.\n• And many more things\n\n\nCreator: Abhinav Dodake\nYoutube channel: bumbum gaming\nInstagram: Bum_gaming\n', 'https://www.youtube.com/channel/UCVYin8Es9kdKASaeD7ElTgw', '', 'vo7wVe2', '', 'Survival, Base', '119 MB', '1.16.210+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1026', 'Legend Says [Un-Pointless Map Sequel]', 'This map has 16 levels of varying difficulty. You have to figure out how to get out of each levels.\n\nSolve puzzles, trade with villagers, find the hidden object that the "legend" is wanting you to find!\n\n\nCreator: Zhaox\nYouTube: Zhaox\nTwitter: TheFaderTone', 'https://www.youtube.com/c/ZhaoxTFT', '', 'EI8vZWs', '', 'Puzzle, Adventure, Parkour, Game', '9.4 MB', '1.14.0.9+', '0', 'https://www.youtube.com/c/ZhaoxTFT\nhttps://twitter.com/TheFaderTone'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1027', 'Isla Nublar', 'Isla Nublar is the island from the Abandoned Jurassic World map. This map features a tropical island ready for you to build your own dinosaur theme park or resort.\n\nThere is a huge lagoon at the bottom of the island.\n\nMultiple flat areas are perfect for large structures, or dinosaur paddocks.\n\n\nCreator: DSL3125\nYoutube: DSL3125', 'https://www.youtube.com/channel/UCfD4XNTVmMm0xypviUwOhvg', '', 'DUn74m4', '', 'Custom terrain, Island', '23.3 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1028', 'Epic Survival House', 'Epic survival mansions, all built in survival mode. Large rooms, huge crop barns, and mob-proof underwater rooms. There are plenty of chests and ores to help you get started. It is an easy world to get achievements in, perfect for a new survival gameplay!\n\n\nCreator: MrPoly', 'https://mcpe.app', '', 'x2l8Uk9', '', 'House, Survival', '6.0 MB', '1.12.1.1.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1029', 'TRLG: WWII', 'This is a PvP map about the World War 2. Fight with your friends on the Normandy Beach and in the bunkers.\n\nThere are 5 different classes and several maps to choose from.\n\n\nCreator: aydenMC', 'https://mcpe.app', '', 'vQvGxJt', '', 'PvP, War', '2.1 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1030', 'Underground Ravine Base', 'This is one of the best Minecraft bases ever!\nIt''s a unique base built right into a huge ravine. It has a slick modern design, stretches for a long distance and has a lot to offer:\n\n• Potion/effect room\n• Survival tools room\n• Armory\n• Weaponry\n• 4 "living pods"\n• Functional Farm\n• Storage Room\n• Your own personal End portal right inside the base\n• Nether/End rooms (with portals that lead to bases)\n• Enchantment room\n• Pool\n• Safe room\n• Strip mine\n• and more!\n\nThere is an elevator that runs through all the floors of the base. The entire bunker is mob-proof, secure, and has fully equipped chests with good armor and weapons. Finally, there is a secret Jeb Piston door integrated into the natural background.\n\nAnd all of this while in Survival mode with achievements enabled!\n\n\nCreator: NACForm\nYoutube: Nathan Arundel', 'https://www.youtube.com/channel/UCeTv6bLGGc0trtqePIUdyEg', '', 'q8OhqtW', 'SN1TKy9-93I', 'Base, House, Survival', '6.8 MB', '1.11.0.22+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1031', 'The House Mystery [Adventure]', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\nThis is a mystery adventure puzzle / horror map with a modern house with puzzles and a story that will surely grab your attention.\n\nA beautiful modern house sits on the coast. It looks very normal, doesn''t it? But it''s not as simple as it looks. Solve the unique puzzles and unravel the mysteries of the house. Who is Vanessa?\n\nThere are Easter eggs here, can you find them?\n\n\nCreator: Bryan Minecrafter\nYoutube: Bryan Minecrafter', 'https://www.youtube.com/channel/UCOJN9APetZHKzIFeC2bdrxw/videos', '', 'ThNL9LL', '', 'Puzzle, Adventure, Horror', '4.6 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
