      '1034', 'Herobrine Nightmare [Horror]', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\nYou''re trying to escape a Herobrine nightmare... Follow the instructions to survive.\n\n\nCreator: SkoshieGamer', 'https://mcpe.app', '', 'exncpir', '', 'Horror, Adventure', '4.5 MB', '1.11.0.22+', '0', ''
