INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1035', 'The Mine Simulator [Mindustry]', 'Mines is a map inspired by a game called "Mindustry". There are many features for players to explore, including 10+ custom items and blocks, machines, upgrades, mechanics, achievements and more.\n\nMine resources, explore the map buy machines, upgrade them and become the ultimate mining tycoon!\n\n\nCreator: ICMCPlays\nYoutube:ICMCPlays', 'https://www.youtube.com/channel/UCXqaDPaWqNrWBEgLL64CITg', '', 'mmA135i', '', 'Game, Tycoon', '480 kB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1036', 'Hangshui City', 'Hangshui City is a fictional modern city with East Asian cultural influences. It is inspired by another Minecraft city (Kyokei City and Metropolitan Urashima) and also by real cities (Shanghai, Taipei, Tokyo (Taito), Seoul, etc.). The city is heavily influenced by Chinese culture, with some Japanese and Korean influences as well.\n\nThe city has many places, such as:\n\n- Guangxing Palace (Chinese style palace) (a very small imitation of the Forbidden City in Beijing)\n- City Hall\n- Skyscrapers\n- Restaurants\n- Small apartments\n- River\n- Hotels\n- Gas stations\n- Convenience stores (7-11, FamilyMart, etc.)\n- Night markets\n- Cafes (Starbucks, Subway, KFC, etc.)\n- Bakeries\n- ATMs\n- Subway stations\n- Vending machines\n- Parking lot\n- Spacious sidewalks for walking, roads and sidewalks with street lights, trees and shrubs for comfort and nature.\n- Pedestrian traffic lights.\n- Tactile paving on sidewalks (yellow bump lines)\n- etc.\n\n\nCreator: Nanfuxian\nYoutube: Nanfuxian', 'https://www.youtube.com/channel/UCTpgDzasA7pPp-UbucT63gw', '', '1I6nJYq', '', 'City, Asia', '1.5 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1037', 'The Highland Hollows RPG', 'Highland Wasteland is an RPG adventure map designed for 1-4 players. Get ready to battle through hordes of monsters, solve unique puzzles, and interact with over 100 unique NPCs.\n\nYou''ll travel through Highland Hollows,, the northern end of the world, full of weary travelers and winding caves. You can choose from 13 classes, each with unique gear and gameplay styles, though they all have one thing in common: they''re desperate. Whether you''re an outcast or a criminal, the world has left you with no choice. You must venture into the abyss, where many go and few return. We wish you luck.\n\nThe map has custom mobs, NPCs, Dungeons, Towns, Side Quests, and much more. There are 3 dungeons, each with its own custom boss: The Zombie Lord, The Mad King and The Soul Blaze.\n\nThis map can take you 4 to 8 hours to complete.\n\n\nCreators: soupy6059 and 1upMC\nYoutube: 1upMC\nPatreon: 1UPMC', 'https://www.youtube.com/channel/UCLYH5Ov2v1w1hraZGx-uizQ', '', 'OeFfAq5', '', 'Adventure, RPG', '6.0 MB', '1.16.220+', '0', 'https://www.youtube.com/channel/UCLYH5Ov2v1w1hraZGx-uizQ\nhttps://patreon.com/1UPMC'
    );
