      '1039', 'Mesaville', 'Mesaville is a world with many interesting creations:\n\n• a huge stronghold/fortress\n• naval port with a submarine, and multiple ships\n• an airport\n• a spaceport\n• an underwater hotel\n• military base with a nuclear bunker\n• big pyramids and  temples\n• houses and mansions\n• and much more!\n\n\nCreator: keithross39', 'https://mcpe.app', '', '1Qa6b8g', '', 'City, Village, Fortress', '25.0 MB', '1.12.1.1.1+', '0', ''
