      '1041', 'Disney Park Rollercoaster', 'This is a rollercoaster theme park inspired by the Disney Park in Paris.\nThere are many fun rides: Ratatouille, Wild West, Pirates of the Caribbean, and others!\n\nThere''s also many other attractions including DuckBurg city from the Donald Duck universe.\n\n\nCreator: EmileCar\nYoutube: Carone\nTwitter: EmileCar90', 'https://www.youtube.com/channel/UCNfGjxcmglGAFloV2FXOh1A', '', 'ocBXhS8', '', 'Rollercoaster, Park', '3.0 MB', '1.16.0+', '0', 'https://www.youtube.com/channel/UCNfGjxcmglGAFloV2FXOh1A\nhttps://twitter.com/EmileCar90'
