INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1042', 'Apollo''s Cat [Adventure]', 'This is an adventure map with many puzzles, quests and interesting plot twists.\n\nYou are Apollo, and nothing is more important than your pet cat Ginger, who is also your long time best friend. She was the first gift you received from your father on your first birthday. Everything is normal between you until one day you discover that your precious kitten is missing. You promised yourself that you will do whatever it takes to find your cat. And now, the adventure begins!\n\n\nCreator: s p a d e\nTwitter: espieydii', 'https://mcpedl.com/user/thegoldenspade/', '', '9a9Nmhl', '', 'Adventure', '2.8 MB', '1.11.0.8+', '0', 'https://www.youtube.com/channel/UCDKCfBNR1koA5v6k0FEerhg\nhttps://www.twitter.com/espieydii'
    );
