INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1048', 'Valdin City', 'Valdin City is one of the most beautiful Minecraft cities! It''s a huge vibrant metropolis where huge skyscrapers neighbor with farms, fields, and beaches with palm trees. There''s a lot to explore: skyscrapers, mansions, shops, hospitals, services, and almost all of the builds are decorated.\n\nThere are:\n• 60+ Individual houses.\n• 9 unique skyscrappers (+100 blocks tall)\n• 20+ Tall buildings\n• Railways system\n• 30+ Shops/restaurants\n• ~10 Luxury Homes (mansions) and vertical luxury homes\n• National Palace\n• Many redstone systems and command block system\n• A total of 200+ Builds\n• and much more!\n\n\nCreator: SimonValdin\nYou can support the creator on PayPal: paypal.me/DanielC5', 'https://mcpe.app', '', 'MkRpFLO', '', 'City, Tropical', '28.5 MB', '1.12.1.1.1+', '0', 'paypal.me/DanielC5'
    );
