    ) VALUES (
      '1049', 'Ib Adventure', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\n\nYou visit a Guertena art gallery and quickly realize that there''s something stragne going on. Solve puzzles, survive the monsters and find your way out.\n\n\nCreator: Jonas MercyLand', 'https://mcpe.app', '', 'T9jPIgj', '', 'Horror, Adventure, Puzzle', '12.0 MB', '1.14.0.9+', '0', ''
    );
