      '1051', 'Spike Desert [Custom Terrain]', 'Spike Desert is survival island with custom terrain, it is a unique blend of Mesa, Jungle and Ice Spikes biomes.\n\n\nCreator: Zucth\nYoutube: Zucth', 'https://www.youtube.com/channel/UCphWUHA8XuNnTZQesLTYeog', '', 'GZhMwxy', '', 'Custom Terrain, Survival', '16.3 MB', '1.12.1.1.1+', '0', ''
