INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1052', 'LightKnight2311''s KitPvP', 'This KitPvP map offers tons of kits and arenas for the ultimate fun experience!\n\nKits:\n— Knight\n— Archer\n— Tank\n— Assassin\n— Rouge\n— Poseidon\n— Healer\n— Warper\n— Gladiator\n— Mage\n— Glider\n— Leaper\n— Snowman\n\nArenas:\n— Main Arena\n— Diamond Arena\n— Iron Arena\n— UHC Arena\n— Combo Arena\n— Leather Arena\n— Jungle Area\n— Slither Pit\n— Nether Arena\n— Ender Arena\n— Circle Arena\n\n\nThere''s also a Prison for Rule-breakers:\nUse /tag player add Prisoned to Lock the Rule-breaker in Prison\nUse /tag player remove Prison and /tp player 0 4 0 to get the Player out of Prison\n\n\nCreator: LightKnight2311', 'https://mcpe.app', '', 'HNCyusZ', '', 'PvP', '3.2 MB', '1.16.100+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1053', 'Void Survival [Skyblock]', 'Void Survival is a unique Skyblock-like map featuring 5 huge floating islands with custom biomes, dungeons, caves, an ocean, and access to both the Nether and the End.\n\n\nCreator: Plasma7007', 'https://mcpe.app', '', 'DU2BhaA', '', 'Skyblock, Sky block, Survival', '11.7 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1054', 'Jurassic Island: New Kingdom [Isla Nublar]', 'Welcome to Jurassic Island:A New Kingdom, The map was inspired by the Jurassic park/world franchise so you may find iconic locations on the island like the main street and the visitor center ruins.  \n\nThe island is also based on the film, Isla Nublar.\nThe island will be separated into seven sectors and all of them are connected with monorail, roads or the Maintenance tunnels.\n\n= Sector 1 =\nFerry Landing\nJurassic Suites Ruins\nMain Gate\nBamboo Forest\nMaintenance Tunnels\nmore will be added in future updates\n\n= Sector 2 =\nThis will be the place where Camp Cretaceous will be built in the future instead of being built on the northern part of the island.\n\n= Sector 3 =\nMain Street\nBoardwalk\nInnovation Center\nTyrannosaurus Rex paddock\nPetting Zoo \nPachy Arena\nControl Center\nMarine Facility (south)\nMosasaurus Lagoon\nMaintenance tunnels\n\nMore will be built in the future like the hotels and water park\n\n= Sector 4 =\n\nGyrosphere Valley\nCentral Valley/Gallimimus Valley\nVisitor Center Ruins\nTroodon Cave\nMaintenance Tunnels \nmore will be added in future updates\n\n= Sector 5 =\nAviary\nSafari Tour \nHydroelectric Dam\nCeratosaurus Paddock\nGiganotosaurus Paddock\nDilophosaurus Paddock\nRiver Cruise: Bioluminescent cave, Aviary river, Baryonyx Paddock, Cretaceous Cruise\nVelociraptor Paddock\nSpinosaurus Paddock\n\n= Sector 6 =\nthis entire sector doesn''t have buildings yet so theres nothing here yet.\n\n= Sector 7 =\nRestricted Area \n\nIndominus Rex Paddock.\nmore will be added in the future.\n\nThat''s everything. and more to come on upcoming updates this year.\n\n\nCreator: Matt\nYoutube: Matt (https://www.youtube.com/channel/UC9H1YQ4a8anHn43b8QxQPtg)', 'https://www.youtube.com/channel/UC9H1YQ4a8anHn43b8QxQPtg', '', 'zXPsE7a', 'JZm9r9ekGCc', 'Jurassic, Park, Rollercoaster', '84.4 MB', '1.16.220+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1055', 'Elmsville: RP City', 'Elmsville is a small city ideal for roleplaying! There is a lot of automated jobs to choose from, shops, administrative buildings, attractions and interactive redstone and command block contraptions.\n\n\nHere are some of the features:\n\n• Job System - Choose between many different occupations (each have different pay)\n\n• Shop System - Simple and easy to figure out! (You press buttons to buy stuff!)\n\n• A ''mode-chooser'' which allows a ''freedom mode'' or ''regular mode'' (use freedom mode to get free money and change your game mode!)\n\n• Restaurant with drive-thru\n• A theater with a working curtain, lighting, etc.\n\n• A selection of modern houses for the average person\n\n• Three awesome huge houses for the rich persons, complete with garage doors, indoor and outdoor pools, working showers, and multiple bedrooms\n\n• Theme park with a mini dropper, roller coaster, bumper cars, made (partly) by TheSteakPotato\n• And much, much more!\n\n\nCreator: 2cuteRedstoneKitty', 'https://mcpe.app', '', 'ostuhlU', '', 'City, RP, Roleplay', '1.6 MB', '1.10.0.7+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1056', 'MineMusic [Megalovania]', 'This is a Rhythm Game inspired by a popular Japanese video game Dance Dance Revolution!\n\nThe goal is to move to correspond with the arrows that appear on screen and the beat: forward, backwards, left, right and jump.\n\nThere are 6 songs included:\n\n• Megalovania\n• Charles\n• Senbonzakura\n• A Cruel Angel''s Thesis\n• Suger Song & Bitter Step\n• Grand Escape\n\nCreators: Kei, Yoshi\nTwitter: mcbe0717', 'https://twitter.com/mcbe0717', '', 'IaZqcGB', '', 'Game, Music, Undertale', '1.7 MB', '1.13.0.34+', '0', ''
    );
