      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1064', 'Japanese Village', 'A beautiful Japanese village with a lot of details! It has:\n\n• houses in Japanese style, complete with interiors\n• koi ponds\n• stone garden\n• bamboo forest with pandas\n• farms\n• and more\n\nThere''s also a deep ravine with an exposed mieshaft right outside of the village.\n\nThis world is in Survival and you can earn achievements.\n\n\nCreator: Cortezerino, emywilk\nYoutube: Cortezerino', 'https://www.youtube.com/c/Cortezerino', '', 'q8APuoW', '', 'Survival, Village', '9.1 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1170', 'Techno Gamerz World #77: Statue', 'Updated Techno Gamerz''s Survival World episode #77: Statue — a giant statue of Techno Gamerz.\n\nThe map includes:\n• automatic sorting system\n• automatic iron farm\n• auto mob farm\n• auto sugarcane farm\n• regular crop and animal farms\n• villagers shop\n• and more!\n\nYou can earn achievements in this world, it''s great for survival.\n\n\nYoutube: Techno Gamerz', 'https://mcpe.app', '', 'vVNoECj', '', 'Survival, Castle, Youtube', '56.1 MB', '1.17.10+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1171', 'One Piece: Baratie', 'This is a recreation of the Baratie restaurant from the popular Japanese manga series «One Piece».\n\nThe Baratie is an ocean-going restaurant run by Zeff, located in the Sambas Region of the East Blue, close to the entrance of the Grand Line.\n\nCreator: MindlessAirport', 'https://www.planetminecraft.com/member/mindlessairport/', '', 'DVMDLKd', '', 'Creation, Anime, Manga', '641 kB', '1.17.0.2+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1066', 'Lucky Skyblock', 'Classic Skyblock game... except all the blocks are Lucky Blocks!\n\n\nCreator: AB Gaming Studios\nYoutube: AB Gaming Studios', 'https://www.youtube.com/channel/UCGXIHjiC3dof1vQ6Cyr-CCA', '', 'hdDtKX1', '', 'Game, Skyblock, Lucky block', '280 kB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1067', 'Lucky Block Race', 'Lucky Block Race is a PvP game — break the lucky blocks on your track and try to get to the finish first.\n\n\nCreator: Shabah Gamer', 'https://mcpe.app', '', 'qELX4ja', '', 'Game, Lucky block', '3.4 MB', '1.16.000+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1068', 'Lucky Block SkyWars', 'Lucky Block SkyWars is a PvP game for 2-8 players. Each player is spawned on its own island and has to gather resources and try to kill all other players to win.\n\nThere are 4 skills/events and 4 types of lucky blocks!\n\n\nCreator: A Teal Penguin\nYoutube: A Teal Penguin', 'https://www.youtube.com/c/ATealPenguin', '', 'UcS7n1l', '', 'Game, PvP, Skywars, Lucky block', '327 kB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1069', 'Herobrine Smp', 'Recreation of the Herobrine Smp server.\n\n\nCreator: Techno ADEEB\nYoutube: Techno ADEEB', 'https://www.youtube.com/channel/UCOTj5lXpP1Pbx8W_aRvowBg', '', '8n0xZBU', '', 'Base, Survival, Youtube', '10.0 MB', '1.16.220+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1070', 'Megan [Horror]', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\n\nAfter a horrible accident of your wife and daughter tragically dying in a cabin fire they begin to haunt you. Find out where this story leads you...\n\n\nCreator: EyeAtomic500\nYoutube: EyeAtomic', 'https://www.youtube.com/channel/UCPYvqpVTi34pScbSRNmg_4w', '', '5BzeBgY', '', 'Horror, Adventure', '1.6 MB', '1.12.1.1.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1071', 'Dark Sewer', 'Dark Sewer is a horror/adventure maze map. You are stuck in a giant sewer maze and have to find your way out or get stuck there forever.\n\nFind hidden barrels to get supplies from. They are hidden under the water and in the walls. \n\nThere are two types of mobs that will hunt and attack you: Demogorgon and hostile cod that will bite you in the water!\n\n\nCreator: Degu', 'https://mcpe.app', '', 'cRDQ2zc', '', 'Horror, Adventure, Puzzle', '1.4 MB', '1.16.000+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1072', '5 Secret Entrances [Redstone]', 'This map showcases 5 interesting redstone entrances which you can learn and implement in your own world.\n\n(You may need to place a minecart with hopper underneath the golden blocks in some versions.)\n\n\nCreator: Lloyd Semblante\nTwitter: LloydSemblante', 'https://mcpe.app', '', 'VkiNQGC', '', 'Redstone, Creation', '134 kB', '1.0.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1073', 'Hobbit House', 'This is a small and cozy hobbit house with everything ready for your new survival adventure!\n\n\nCreator: JayLythical\nYoutube, Twitter, PayPal: JayLythical', 'https://www.youtube.com/channel/UCK0yWfikzKAWtf500F8sTyQ', '', 'bgn6OmH', '', 'House, Survival', '11.5 MB', '1.16.000+', '0', 'https://www.youtube.com/channel/UCK0yWfikzKAWtf500F8sTyQ\nhttps://twitter.com/JayLythical/\nhttps://www.paypal.com/paypalme/JayLythical'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1074', 'Tropical Modern Mansion', 'This map showcases a big modern villa located on a private island.\nSpacious mansion with a pool and jacuzzi, private beach, a beach bar, big yacht, beautiful garden and more.\n\n\nCreator: FALL Studios\nYoutube: FALL Studios', 'https://www.youtube.com/channel/UC-uvbydW0gCb66RdfkUypfQ', '', '2D3mYzm', '', 'House, Creative', '1.5 MB', '1.16.000+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1075', 'Adventure Time Tree House', 'This is a very detailed recreation of the Adventure Time Tree House (Tree Fort)!\nExplore the intricate design of the house with all its rooms and narrow passages.\n\nThe world is in Survival mode, so you can earn achievements as well.\n\n\nCreators: Pluvia, Hellzoulz1', 'https://www.planetminecraft.com/member/pluvia/', '', 'z9NqTPG', '', 'House, Survival', '13.1 MB', '1.16.000+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1076', 'Fisherman''s House', 'A small fisherman''s house/small store, and a lighthouse located on a custom little island. All the interiors are decorated and the chests are filled with useful items!\n\nThe world is in Survival mode, so you can earn achievements as well.\n\n\nCreators: Pluvia, Hellzoulz1', 'https://www.planetminecraft.com/member/pluvia/', '', 'ji3eH8T', '', 'House, Survival', '23.5 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1078', 'Randomizer', 'This world includes the Block Randomizer Addon:\n\nEvery time you break any block you get a random item back instead of it''s original item drop!\n\nThere are 5 levels of randomness to choose from in the mod settings.\n\n\nCreator: DanRobzProbz\nYoutube: DanRobzProbz', 'https://www.youtube.com/c/DanRobzProbz', '', 'aVYTEXG', '', 'Survival, Mods, Random', '975 kB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1079', 'Small Medieval House', 'This is a small house made in medieval/rustic style. It has almost everything you need for a Survial — tools, storage, farm and, most importantly, a roof above your head!\n\nThere''s also a village nearthe house.\n\nYou can earn achievements in this world.\n\n\nCreator: Mars Mcforden, emywilk', 'https://www.planetminecraft.com/member/mars_mcforden/', '', '1aiLS9d', '', 'Survival, House', '3.2 MB', '1.14.0.9+', '0', 'https://www.youtube.com/channel/UCvK2rolBEJj_gV6FcWitmnw\nhttps://twitter.com/MarsMcforden\nhttps://www.instagram.com/marsmcforden'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1080', 'Yes Smarty Pie''s Survival World', 'Survival world which contains:\n\n• small castle\n• illager farm\n• creeper farm\n• villagers room\n• a snowy village with animal farms and a hidden room\n\n\nCreators:\nTechno G, Youtube: Techno G\nYes Smarty Pie, Youtube: Yes Smarty Pie', 'https://www.youtube.com/channel/UCJQb0JQuiVa-qQGdlogExzQ', '', 'jsgRKBU', '', 'Survival, Base, Castle, Youtube', '4.6 MB', '1.16.210+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1081', 'Small Mesa House', 'This is a small gold miner''s adobe house built in the mesa biome.\nIt has basic set of items and tools needed for a survival game.\n\nYou can earn achievements in this world!\n\n\nCreators: emywilk\nOriginal design by: Mr Mirror\nYoutube: Mr Mirror', 'https://www.youtube.com/channel/UCcbssCXYVtVrI8956ziVIbw', '', 'HeIfgaR', '', 'Survival, House', '5.6 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1082', 'Equestria', 'Equestria is a huge world based on the My Little Pony universe. There are many locations, and it can take you days to explore the entire world:\n\n— Ponyville: main village\n— Crystal Empire: frozen village/city\n— Dodge Junction: wild west village\n— Two Sisters Castle: big half destroyed, spooky castle\n— Whitetail: a lush, scenic forest east of Ponyville\n— Everfree Forest\n— Cloudominium: a large floating castle in the clouds\n— Yakyakistan: the ancient home of the Yaks, is a solitary society hidden deep within the mountains north of the Crystal Empire.\n— Manehattan: a sprawling urban city on an island, with many unique skyscrapers and landmarks\n— Hollow Shades: a dark town deep in the woods\n— and more\n\n\nAlmost all the buidlings in this world are fully decorated and furnished, each with its unique design.\n\n\nYou can easily teleport between locations using teleport stands.\nOr you can type "/function home" to teleport to the spawnpoint in Ponyville from anywhere on the map!\n\n\nThis map is ideal for multplayer roleplay.\n\n\nThis is a port from Minecraft Java edition of the old MLP server brohoof.com, which does not work anymore.\n\n\nCreator: brohoof.com', 'https://mcpe.app', '', 'wRvx6s5', '', 'Village, City, MLP', '88.3 MB', '1.11.0.22+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1083', 'Spiderman & Batman Parkour', 'This parkour map consists of 4 courses, each with its own unique mechanics:\n• Spider-Man parkour: use web slinging and climb walls\n• Batman course: use grapple gun\n• Pearl course: use pearls and active blocks\n• and a regular course: use power-up boost blocks: jumping, speed, levitation and slow falling\n\n\nCreator: Jasucard\nYoutubee: Jasucard\n', 'https://www.youtube.com/channel/UCMocJtiMXBacZSjSHFetrig', '', 'HXsqxNw', '', 'Parkour, Batman, Spiderman', '91 kB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1085', 'Toy Story: A New Home [Parkour]', 'You are special toy for your owner — Matilda, help her find all the 15 tokens scattered all over her giant room! When you find a token bring it over to the Piggy and put it inside.\n\n\nCreator: Jasucard\nYoutube: Jasucard', 'https://www.youtube.com/channel/UCMocJtiMXBacZSjSHFetrig', '', 'fC5XUdE', '', 'Parkour, Adventure', '62 kB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1086', 'Splatoon (Turf Wars)', 'In this multiplayer game players must ink the most turf to win the match.\n\nEach round lasts 3 minutes. Team that inks the most turf in their color wins.\n\nIt''s recommended for 2 vs 2 players, but is also suitable for up to 4 vs 4 players.\n\n\nCreator: ChefFranky\nYoutube: Chef Franky', 'https://www.youtube.com/cheffranky', '', 'us1yMj4', '', 'PvP, Game', '417 kB', '1.2.9.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1084', 'Going Up! 5 [Parkour]', 'In this parkour map your goal is to reach the top of the Ocean Tower.\nYou can play alone or challenge your friends to see who is the fastest.\n\n\nCreator: Jasucard\nYoutubee: Jasucard', 'https://www.youtube.com/channel/UCMocJtiMXBacZSjSHFetrig', '', '6viV90l', '', 'Parkour, PvP', '266 kB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1087', 'Working Camera [Redstone]', 'This map features a working camera that can take any 15×15 3D model you build and turn it into all 2d perspectives: Front, Back, Top, Bottom and both sides.\n\nYou can even save your builds and their snapshots and load them later! There are 32 save slots: 16 for 3d models and 16 for images.\n\nHow to use it:\n\nFirst build your scene inside the yellow box.\nThen, when you''re done, press the button in front of the camera to snap the pictures!\n\n\nCreator: ChefFranky\nYoutube: Chef Franky', 'https://www.youtube.com/cheffranky', '', 'dhLRS3m', '', 'Redstone, Creation', '180 kB', '1.4.2.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1088', 'Tower Parkour', 'This is a giant parkour tower consisting of 6 levels that get progressively harder the higher you go. Epic prize awaits those who can make to to the top.\n\n\nCreator: iStutterYT\nYoutube: iStutter', 'https://www.youtube.com/channel/UCUu8ZBZGHIFgVHXZtRE2yMQ', '', 'L14yhge', '', 'Parkour', '76 kB', '1.16.000+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1089', 'The Archipelago Adventure', 'The Archipelago is an open world tropical themed adventure map with many beautiful and interesting locations to explore.\n\nSolve mysteries, fight mobs, solve puzzles, clear parkour courses and collect as much gold, diamond and wool blocks as you can!\n\n\nCreator: Notmikeweir\nTwitter: notmikeweir', 'https://www.twitter.com/notmikeweir', '', 'wCZqaXu', '', 'Adventure, Puzzle, Parkour', '31.8 MB', '1.16.000+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1090', 'Soul Snatchers PvP', 'Soul Snatchers is a spooky multiplayer mini game for two teams. One team is trapped inside a building and must find their way out while avoiding being killed by the soul snatchers. This is a very intense mini-game and you will find yourself in many difficult situations. Sometimes it is best to stay hidden and hide, and other times you will find yourself running for your life. Recommended for 5-10 players.\n\nCreator: SpiderEyeGaming', 'https://mcpe.app', '', '5BPQ38X', '', 'Game, PvP, Horror', '1.1 MB', '1.0.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1091', 'The Last Patient [Horror]', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\n\nYou wake up in an abandoned creepy hospital. You quickly realize that something''s lurking in the dark. You must escape before it''s too late!\n\n\nCreator: GabTheCrafter\nYoutube: GabTheCrafter', 'https://www.youtube.com/channel/UCG1DUQQqXE3zlMENFGb5utg', '', 'hfguwKv', '', 'Game, Horror', '3.6 MB', '1.11.0.22+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1092', 'Elytra Parkour 3', 'Fly through hoops with elytra on many beautiful levels.\n\n\nCreators: JPlaysPE,  Jannik_DE\nTwitter: JPlaysPE, jannik_mcpe', 'https://twitter.com/JPlaysPE', '', 'JAhHWy1', '', 'Game, Elytra, Parkour', '1.2 MB', '1.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1093', 'Thimble 2.0', 'In this fun muliplayer PvP game players take their turn to jump into a pool of water from a tall tower. Each time a player lands in the water, the spot where they landed turns from water to a solid block. Over time, the pool has fewer and fewer water blocks, making it more difficult to land safely.\n\nThe last player to live wins.\n\nThere are 3 levels:\n• Forest\n• Nether\n• Cave\n\n\nCreator: lycroh', 'https://mcpe.app', '', 'RONlZE0', '', 'PvP, Game', '1.6 MB', '1.7.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1094', 'Tomb Crafter 2: Egypt', 'Tomb Crafter 2: Egypt is a short but fun adventure map where you have to find the Tutankhamun''s helmet. Complete parkour courses, solve puzzles and fight monsters on your way to find the artifact!\n\n\nCreator: minecraftstyler777\nYoutube: McStyler777', 'https://www.youtube.com/c/minecraftstyler777TV', '', 'HbilwVH', '', 'Adventure, Parkour, Puzzle', '8.2 MB', '1.1.5+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1095', 'Lush Cave House [1.17]', 'This world features a small survival house located in a beautiful lush cave biome from the latest Minecraft 1.17 "Caves and Cliffs" update!\n\nThe cave is really immense and is filled with moss, azaleas and vines of glowing berries that light up the entire area. There is a huge cliff with water- and lava- falls making for a beautiful scenery.\n\nThe house itself is very simple but has all the basic tools needed for a survival, as well as a small wheat farm.\n\nYou can earn achievements in this world.\n\nWe had a lot of fun creating this house and hope you will enjoy it!\n\n\nCreator: emywilk', 'https://mcpe.app', '', 'Be0fuCH', '', 'Survival, House, Cave', '13.0 MB', '1.17.10+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1096', 'MLG Clutch Practice', 'In this map you can practice survivng falling from different heights (from 10 to 200 blocks high) using water bucket, hay bales or slime blocks.\n\n\nCreator: ADVERSE APPLE\nInstagram: ADVERSE_APPLE\nYoutube: ADVERSE APPLE', 'https://www.youtube.com/channel/UCV7R74zyc-7R8Ip6uIzj-HQ', '', 'SVArZ5G', '', 'Game', '80 kB', '1.17.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1097', 'SANS SMP S4 School', 'SANS SMP is a popular Indonesian Minecraft server.\nThis map recreates the school from the server.\n\nThis map is in Indonesian!\n\n\nCreator: LeoPrince\nYoutube: LeoPrince', 'https://www.youtube.com/channel/UCXwIcezOZIPwYn9_n6CM_AQ', '', 'V9fjyTZ', '', 'Youtube, Creation, School', '7.8 MB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1098', 'Lakewell Kingdom', 'Lakewell is a medieval kingdom with a big mountain top castle, a colorful market with a port, a big detailed village in the woods and a mine. All of the buildings have unique interiors.\n\n\nCreator: MADLAD3718', 'https://www.planetminecraft.com/member/madlad3718/', '', 'mq2PfiV', '', 'Castle, Village, Medieval', '27.9 MB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1099', 'Alien Escape [Guns]', 'Alien Escape is a PvP minigame for 2-5 players.\n\nYou are stuck on an alien spaceship with an Alien, which is trying to kill all the Humans!\n\nPlayers are divided into two teams:\n\n— 1 Alien:\n\nAlien''s goal is to get to all the Humans and eliminate them. You have 3 weapons: Claws, Tail and Acid Spit\n\n\n— and the rest of the players are Humans:\nHumans must find all the generator activating pressure plates, stand on all of them antil they are activated to power up the generator and escape the ship.\n\nHumans have these weapons andabilities:\n• Blaster - single shot gun which slows the alien\n• Slowing Ammo - ammo for the blaster\n• Medkit - right-click on the ground to use it\n• Hide - right-click on the ground to become invisible for a short period of time\n• Barrier - use barriers to stick the Alien in his tracks and prevent him from getting to you quickly\n• Knife - melee weapon\n\n\nCreator: Fizzman797\nYoutube: Jasucard', 'https://www.youtube.com/channel/UCMocJtiMXBacZSjSHFetrig', '', 'jHss7ql', '', 'Game, PvP, Aliens', '639 kB', '1.1.1.51+', '0', ''
    );
