      '1101', 'Super Smash Mobs', 'This is a KitPvP multiplayer game for 2-4 players.\n\nYou can play as a Minecraft mob or monster. Players'' goal is to defeat the opponents by pushing them of the edge of the map or just killing them.\n\n\nThere are:\n\n• 16+ different kits and classes, each being a mob with special items and abilities\n• 7 maps, each uniquely themed\n• 7 game modes to spice up the game\n\n\nCreator: wedge', 'https://mcpe.app', '', '2kuY6gW', '', 'Game, PvP', '10.6 MB', '1.14.0.9+', '0', ''
