      '1111', 'DeathCore III: Melting Hollow', 'Melting Hollow is the third in the DeathCore CTM survival series.\nThs time you are in a boiling hot hellscape of lava and magma.\nBut lava is not the only danger, many monsters lurk in the dark, and even in the hot lava!\n\nExplore the deadly caverns and collect 10 Shulker Boxes to complete the Monument.\n\n\nCreator: wedge', 'https://mcpe.app', '', 'bpLOJnK', '', 'Survival, CTM', '239 kB', '1.14.0.9+', '0', ''
