    ) VALUES (
      '1115', 'Matsuhama 松浜 | Japanese Town', 'Matsuhama is a small coastal Japanese town loosely based on the real-life town of Takehara in Hiroshima Prefecture.\n\nThere are main commercial district, railway station, a city hall, a department store, many konbinis, Shinto shrines, a temple and a high school with a detailed interior.\n\n\nCreator: mattuFIN\nYoutube: Mattupolis\nInstagram: shivovish', 'https://www.youtube.com/channel/UCzCfea2x2AAWmCc3yQD9Pnw', '', 'jrVYQDA', '', 'City, Japan', '31.6 MB', '1.16.0+', '0', ''
    );
