    ) VALUES (
      '1116', 'Serenity Breeze Cruise Ship', 'Serenity Breeze is a very detailed cruise ship, it has a lot of attractions on boar: many restaurants, shops, a water park, theaters and movie theater and even a green park!\n\n\nCreator: ElectroCreeper\nTwitter: electrocreeperg', 'https://twitter.com/electrocreeperg', '', 'VLgyCGo', '', 'Creation, Ship', '933 kB', '1.6.1.0+', '0', ''
