    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1118', 'Vertoak City v.13', 'Vertoak City is one of the best Minecraft city maps ever!\n\nIt consists of several large custom islands with hundreds of unique buildings, every single one which is fully furnished.\n\nIt can take you weeks to explore the map and discover all the hidden secrets! There are many attractions, secret locations, remote places to discover and adventures.\n\n• downtown business center with skyscrapers\n• many stores/shops and restaurants\n• yacht club\n• military base\n• subway system\n• desert city\n• mountain mansions\n• mining network\n• underground base\n• space observatory\n• airport\n• sunken ships\n• Jungle Outposts\n• Ruins\n• and much much more\n\nThe map is in Survival mode and you can earn achievements.\n\n\nCreator: fish95\nWebsite: vertoakcity.com\nPayPal: cjb030@bucknell.edu', 'https://vertoakcity.com', '', 'eAUxEvs', '', 'City, Survival, Village', '41.9 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1119', 'Osfjoll City', 'Osfjall is a cozy Scandinavian style city located on a small island. It has a lot of small shops, recreation areas like lakes, a beach and a park, a hospital and even an active volcano!\n\n\nCreator: foulelse', 'https://www.planetminecraft.com/member/foulelse/', '', 'f2XRY7A', '', 'City, Village, Scandinavian', '8.3 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1120', 'Portville City', 'Portville is a small, but very detailed city with a lot of unique buildings most of which are furnished. There are shops and cafes/restaurants, a big theme park, a yacht pier, a hospital, a suburban village and much more!\n\n\nCreator: Dani4355\nYoutube: Dani4355', 'https://www.youtube.com/channel/UC7CnEU4JqiIyngh7vXxcSFA', '', 'l6FPUjC', '', 'City, Village, RP', '12.9 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1121', 'Ancient Rome City', 'Roma Aeterna is an incredibly accurate recreation of the entire city of Rome from the 5th century AD at a scale of 1 block : 1 meter.\n\nHere''s an example of the sites that are recreated:\n• Baths of Trajan\n• Colosseum (aka amphitheatrum Flavium)\n• Ludus Magnus (Great Gladiatorial Training School)\n• Fora Imperatorum\n• Temple of Venus and Roma\n• Palatine Hill\n• Circus Maximus\n• Piscina Publica ("Public Pool")\n• Baths of Caracalla\n• The naumachia of Augustus\n• Circus Varianus\n• and many many more\n\nWARNING: This map is really huge, you will need a powerful high-end device to open it and play on it.\n\n\nCreator: MolochBaal\nYoutube: Nouvilas\nPlanetMinecraft: MolochBaal', 'https://www.youtube.com/user/lokosuperfluoLEGOman/', '', 'fTyhL2A', '', 'City, Rome, Roman', '106 MB', '1.11.0.22+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1122', 'Stardew Valley', 'This is a detailed recreation of the Stardew Valley map.\n\nIt features:\n\n• Pelican Town\n• Backwoods\n• Bus Stop\n• Calico Desert\n• Pelican Beach\n• JojaMart\n• and most of the other locations and buildings\n\nAll the buildings have decorated interiors.\n\n\nCreator: sjossss', 'https://www.planetminecraft.com/member/sjossss/', '', 'cu7PAMw', '', 'City, Village, Town, Pelican', '2.2 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1123', 'Varenburg City', 'Varenburg is a large German city with several distinct districts: Historic center, Midtown, Downton, West and East sides.\n\nThere are:\n• 2 residential areas\n• lots of offices and shops\n• a huge football stadium\n• many unique skyscrapers\n• subway and tram systems\n• a sewer network running through the entire city and connecting all the buildings\n• and more\n\nAll the buildings are furnished!\n\n\nCreator: Nick96894\nYoutube: Nick96894', 'https://www.youtube.com/user/Nick96894Arniboy13v2/', '', 'ZyLyT3N', '', 'City, Modern', '73.1 MB', '1.9.0.15+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1124', '7 Minigames', 'This world provides 7 fun PvP minigames:\n\n1. • The Bridge •\nA 2 team PvP minigame where your objective is to cross the bridge, try reach the other team’s base, and jump in their goal to score a point.\nFirst team to score 5 points wins!\n\nYou will get swords, armour, and other items you will need to defeat the other team.\n\n\n2. • Kitted FFA •\nA free for all PvP. Choose from 12 available kits and defeat all other players! The last player standing wins.\n\n\n3. • Knockoff  •\nPlayers are spawn on a floating platform and are given a bow. Knock other players off the platform and be the last one standing to win.\n\n\n4. • Playground •\nIn this mode there are no rules, everybody is free to do what they want. You can parkour, fight other players, practice your archery skills and more!\n\n\n5. • Duels •\n2 teams, the last one standing wins. Easy!\n\n\n6. • Hide N Seek •\nGame starts with 1 Seeker and all other players as Hiders. Seek can hit a Hider to convert him into a Seeker as well. The game stops when time runs out or there are no more Hiders.\n\n\n7. • Skywars •\nA classic Skywars game: Players are spawned each on their own floating island and have to use the resources they are given to defeat all other players.\n\n\nCreator: Aden Lynn\nYoutube: Aden Lynn', 'https://www.youtube.com/channel/UCWLkmKLz1JIoo-uh6_5rYNg', '', 'yKwzQsX', '', 'Game, PvP, Skywars', '2.0 MB', '1.17.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1125', 'Lava Rising!', 'This looks like a regular world, except for a small fact that slowly but surely lava rises from Y level 50 and up!\n\nCan you survive this hot mess?\n\n\nCreator: Shox\nYoutube: Where Shox Get His Inspiration', 'https://www.youtube.com/channel/UCid5zLSmXpfk1oqGPRy70cw', '', 'udF4ugI', '', 'Survival', '2.0 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1126', 'Navrit Gaming Survival World #93', 'This is a recreation of a great survival world by Navrit Gaming.\n\nThis world has:\n• many automatic and manual farms: wool, sugarcane, wheat, coconuts, Nether wart etc.\n• artificial village ready for breeding villagers\n• a mob farm\n• a witch farm\n• automatic smelter\n• automatic brewing system\n• cattle pens\n• storage\n• railway system\n• Nether house\n• a sky house and much more\n\n\nCreator: Yabhi Dhiman\nSubscribe to their Youtube channel: Yabhi Dhiman', 'https://www.youtube.com/channel/UCfEHX0kHfqFnFlYe8BCLxYw', '', 'EzL5lBE', '', 'Survival, Base, Youtube', '9.4 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1127', 'Mechanic Apocalypse 3 [Guns]', 'Mechanic Apocalypse is a fun first-person shooter (FPS) adventure!\nHere you can use different types of guns and ride mecha bots to fight robots and even a final boss!\n\n\nCreator: TheEnderface\nTwitter: TheEnderface', 'https://twitter.com/TheEnderface', '', 'lNLmyln', '', 'Adventure, FPS, Guns', '4.7 MB', '1.1.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1128', 'TJOC: R | FNAF [Horror]', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\nThis map is a recreation of the popular PC horror game The Joy of Creation: Reborn.\n\nYour goal is to find the hidden objects before the monsters find you!\n\nThere are 2 levels: Freddy and Bonnie.\n\n\nCreator: TheSpringLockedBoi\nYoutube: TheSpringLockedBoi / Team Fazbear', 'https://www.youtube.com/channel/UCf9sh1EtYByStokHoVcm-iA', '', 'PhT5oMZ', '', 'Adventure, Horror, Puzzle', '1.2 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1129', 'House & Farm', 'This map features a compact house and a 2-story farm.\n\n\nCreator: Manav Ramani\nYoutube: Manav Ramani', 'https://www.youtube.com/channel/UCw4FU5MXxZDVHwit_86zptA', '', 'jvhEX4u', '', 'House, Farm', '8.4 MB', '1.17.2+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1130', 'Parkour Island', 'This challenging parkour map consists of 10 unique levels which get progressively harder as you go. But don''t give up, all jumps are possible!\n\nUse fishing rod to highlight the barrier blocks and find the right path.\n\n• Golden pressure plates are level check points\n\n• Orange block gives you slow falling\n\n• Purple block gives you levitation\n\n• Emerald block is also checkpoint (you will see it in level 8)\n\n\nCreator: Alvin Launcher1024\nYoutube: Alvin Launcher', 'https://www.youtube.com/channel/UCsPkCBs0W7Mal8yL6fcVmLg', '', 'a484qq1', '', 'Parkour, Puzzle', '983 kB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1131', 'Castaway Parkour', 'Castaway is a parkour map set on a beautiful uninhabited island in the middle of the ocean. The goal is as usual — get to the end of the map!\n\n\nCreator: SquarePixelsStudio\nYoutube: SquarePixelsStudio', 'https://www.youtube.com/channel/UCHrw2k21tUO06xPGg8r9vtQ', '', 'a4BpTfP', '', 'Pakour, Island', '186 kB', '1.17.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1132', 'Medieval Tower Mansion', 'This is a medieval mansion with a tower that serves as an observatory of a breathtaking view of the surrounding land.\n\nThe mansion has a beautiful detailed exterior but is empty inside. You have 4 levels and the attic to furnish the way you want and make this house your home.\n\n\nCreator: CloseeDBr\nYoutube: CloseeDBr', 'https://www.youtube.com/c/CloseeDBr', '', 'l7UEnGU', '', 'House, Survival, Medieval', '6.1 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1133', 'Mounatintop House', 'This is a cozy 2-story house built on top of a small mountain/rocky hill!\n\nIt has furnished and decorated interiors.\n\n\nCreator: CloseeDBr\nYoutube: CloseeDBr', 'https://www.youtube.com/c/CloseeDBr', '', 'iz7Aimx', '', 'House', '13.6 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1134', 'Techno Gamerz World #73: Decorations', 'Updated Techno Gamerz''s Survival World episode #73: castle interior and exterior decorations.\n\nThe map includes:\n• automatic sorting system\n• automatic iron farm\n• auto mob farm\n• auto sugarcane farm\n• regular crop and animal farms\n• villagers shop\n• and more!\n\nThis is a great map for survival.\n\n\nCreator: Yabhi Dhiman; Techno Gamerz\nYoutube: Yabhi Dhiman; Techno Gamerz\n', 'https://www.youtube.com/channel/UCfEHX0kHfqFnFlYe8BCLxYw', '', 'htpddrQ', '', 'Survival, Castle, Youtube', '16.4 MB', '1.17.2+', '0', ''
    );
