      '1141', 'Tomb Crafter 4: Illuminati [Adventure]', 'Tomb Raider 4: Illuminati takes you on an adventure to the Illuminati stronghold on a mission to find the ancient magical clothes. This fun map includes several mob battles, parkour, traps and much more!\n\n\nCreator: minecraftstyler777\nTwitter: m_styler777\nYoutube: McStyler777', 'https://twitter.com/m_styler777', '', 'aFR1PUU', 'sVCAq9Ba0-w', 'Adventure, Parkour, PvE', '8.5 MB', '1.0.0+', '0', 'https://www.youtube.com/c/minecraftstyler777TV\nhttps://twitter.com/m_styler777'
