    ) VALUES (
      '1142', 'Tomb Crafter 5: Sphinx', 'This is the fifth map in the Tomb Crafter series. This time you are on an adventure in the Ancient Egypt! Your mission is to find 3 ancient golden artifacts with a side quest of finding 12 emeralds which will help you find a hidden room.\n\n\nCreator: minecraftstyler777\nTwitter: m_styler777\nYoutube: McStyler777', 'https://twitter.com/m_styler777', '', 'uHgn1YA', '', 'Adventure, Parkour, PvE', '16.5 MB', '1.0.0+', '0', 'https://www.youtube.com/c/minecraftstyler777TV\nhttps://twitter.com/m_styler777'
