INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1143', 'Plants vs Zombies 2', 'This map is recreates Plants vs Zombies game in extreme detail!\n\nThere are almost all the characters and mechanics from the original game.\n\nAvailable arenas:\n• Lawn\n• Pool\n• Egypt\n• Dark Ages\n• Neon Mixtape\n• Bigwave Beach\n• Jurassic Marsh\n• Lost City\n• Frostbite Caves\n• Wild West\n• Farfuture\n• Pirate Seas\n• Kung Fu\n• Sky City\n• Steam Age\n\nThere are also addition minigames:\n\n• Vasebreaker Mode\n• Zomboss Fight\n• Zen Garden\n• Zen Garden (night)\n• Zen Garden (aquarium)\n• Zombiquarium\n• Slot-machine\n• Night Fog Mode - (pool)\n• Night Thunderstorm Mode (pool)\n• Endless Mode (and zombie spawner entities)\n• Multiplayer Mode (zombie team vs plants team)\n\n\nCreator: LiL Craft YT\nYoutube: LiLCraftYT', 'https://www.youtube.com/c/LiLCraftYT', '', 'qDfjSM4', '', 'Game, PvE, Zombies', '46.8 MB', '1.17.10+', '0', ''
    );
