      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1144', 'Achievements World 1.17', 'This maps allows you to unlock all the Minecraft Bedrock achievements in one world, including the new ones from the latest version — 1.17!\n\n\nCreator: The Sonic Master\nYoutube: TheSonicMaster', 'https://www.youtube.com/c/TheSonicMaster', '', '7mjISwj', '', 'Creation, Survival', '1.4 MB', '1.17.0+', '0', 'https://www.youtube.com/c/TheSonicMaster\npaypal.com/donate/?hosted_button_id=V979F2WVNHE78'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1145', 'Flat Lucky World 1.17', 'An infinite flat world of endless lucky blocks and endless fun!\n\nThere are 6 types of lucky blocks: regular, spiral, rainbow, astral, withered and red.\n\nBreak the lucky blocks to get random items, magic weapons, traps, effects, different unique structures, friendly or hostile mobs and more!\n\n\nCreator: Effect99MC\nYoutube: Effect99\n', 'https://www.youtube.com/channel/UCw2-_xxMzda5uKu64_pCIGg', '', 'V9suNIB', '', 'Custom Terrain, Survival, Game', '4.4 MB', '1.17.2.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1146', 'Manav Ramani''s Survival World', 'Hey guys! This is my survival world.\n\nIt includes:\n• A tree house\n• Wheat farm\n• Sugarcane  farm\n• Bone meal farm\n• A book with coordinates to reach many places I''ve already explored\n• 2 zombie villages\n• And a lot more\n\nYou can earn achievements in this world.\n\nThank you... ❤️❤️❤️\n\n\nCreator: Manav Ramani \nYoutube: Manav Ramani', 'https://www.youtube.com/channel/UCw4FU5MXxZDVHwit_86zptA', '', 'Oc2iCxr', '', 'House, Survival, Village', '12.0 MB', '1.17.2.0+', '0', ''
    );
