INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1148', 'Swords and More Swords v2.0', 'This map features an addon that adds a total of 36 unique magic swords!\n\n• Blaze Sword: Cast fireballs when hitting enemies. + Protection from fireballs\n\n• Wither Sword: withers everything in its path\n\n• Shulker Sword: 10% chance of throwing shulker projectiles when attacking enemies. + Ability to levitate entities within 6 radius\n\n• Spider Sword: Holding the sword makes you ride a spider! +5% chance of throwing cobwebs when attacking enemies. + Press the screen to fire cobwebs for a few seconds\n\n• Ice Sword: Turns the water under your feet to ice. + Chance of throwing snowballs when attacking enemies. + Press the screen to freeze nearby enemies\n• And many more!\n\n\nCreator: Effect99MC\nYoutube: Effect99', 'https://www.youtube.com/channel/UCw2-_xxMzda5uKu64_pCIGg', '', 'FgMhqvg', 'qib11VNumDg', 'Creation, Anime, Survival', '2.0 MB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1149', 'Prehistoric Park [Dinosaurs] [Jurassic]', 'Prehistoric Park is a big zoo on an island, with all kinds of prehistoric creatures and dinosaurs! It is inspired by Jurassic Park and Jurassic World, and is aimed to combine both of them into one park.\n\nYou can roll around the park in a comfortable minecart, watch  the dinosaurs and even feed them!\n\nThere are 16 enclosures, including The Great Aviary, The aquarium, Herbivorous Dinosaur Enclosure and others.\n\nYou can find the following dinosaurs in the park:\n• Brachiosaurus\n• Stegosaurus\n• Brontosaurus\n• Sinoceratops\n• Protoceratops\n• Gigantoraptor\n• Bajadasaurus\n• Tyrannosaurus Rex\n• Cryolophosaurus\n• Raptors\n\nAquatics like:\n• Mosasaurus\n• Megalodon\n• Plesiosaurus\n\nPrehistoric animals:\n• Dodo\n• Mammoth\n• Saber-toothed tiger\n\n• and many many more\n\n\nCreator: DØCTØR JØKER\nYoutube: EŁ SANĐØ\n\nAddon creator: Prehistoric Life\nYoutube: \nPrehistoric Life ADD-ON OFFICIAL', 'https://www.youtube.com/channel/UCNWTnqalRfgZFurYGY4Uy4A', '', 'IQlOu1c', '', 'Creation, Park, Rollercoaster, Jurassic', '30.1 MB', '1.16.200+', '0', ''
    );
