      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1150', 'Parkour Islands', 'This really big parkour map consists of 10 levels with a great variety of jumps and obstacles:\n\n• Tutorial\n• Dirtland\n• Stone & Wood\n• Slime Mania\n• Redstonia\n• The End?\n• The Nether\n• Rainbow\n• MADNESS\n•  The Trials\n\n\nCreator: Examinedcat669\nYoutube: ExamineCat', 'https://www.youtube.com/channel/UC4NynRM_UTRSg2_4Ccy2N5g', '', 'DPZvvS1', '', 'Parkour, Game', '1.8 MB', '1.10.0.7+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1151', 'UKS City [Avengers]', 'UKS is a great city for RP. It has many unique modern houses and  different kinds of places, squares and strutures. There''s even the Avengers tower and a spaceport. The city is populated by villagers and iron golems which makes it morelively.\n\n\nCreator: Tpops2017\nYoutube: Tiago''s Films', 'https://www.youtube.com/channel/UC_ufO0oPMnAoBym3heNX2cQ', '', 'bo1ojQs', '', 'City, RP, Avengers', '14.7 MB', '1.11.0.22+', '0', ''
