      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1152', 'SCP – Containment Breach: LCZ', 'This is a pretty accurate recreation of the Light Containment Zone from the popular horror video game SCP – Containment Breach.\n\nThere''s no actual gameplay to it, but you can free roam and explore the map.\n\n\nCreator: iamded64', 'https://mcpe.app', '', 'E0yXTw4', '', 'Creation, SCP, Adventure', '21.6 MB', '1.14.0.8+', '0', ''
