INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1153', 'Fossil Research Post', 'This map features a small outpost built around a naturally generated fossil. There''s a research point, two tents and a campfire. Not much but it''s pretty cozy. :) There''s also a village and a desert temple nearby.\n\n\nCreator: RISALZI', 'https://mcpe.app', '', 'iqzUJsR', '', 'Creation, Village, Adventure', '1.5 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1154', 'Medieval Village', 'This is a beautiful andpretty big medieval village that is great for RP!\n\nThere are:\n\n• market\n• church\n• tower\n• many fully decorated houses\n• a library\n• fisherman''s house\n• a big farmhouse/castle\n• and more!\nYou can earn achievements in this world.\n\n\nCreator: GOLDENknight YT\nYoutube: GOLDENknight YT', 'https://www.youtube.com/channel/UCc_Xc_pC7cmIGVm6Orb5YgA', '', 'jjsuML5', '', 'Village, Survival, Castle', '5.4 MB', '1.16.210+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1155', 'Evil Nun [Horror]', '"!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\nIn this horror map you have to escape the school without getting caught by an evil nun!\nSearch for keys and items that will help you on your mission.\n\n\nCreator: LiL Craft YT\nYoutube: LiL Craft YT', 'https://www.youtube.com/c/LiLCraftYT', '', 'lDS8O8h', '', 'Horror, Puzzle', '4.9 MB', '1.16.100+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1156', 'Evil Nun 2', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\n\nThis map is inspired by the popular horror game Evil Nun 2.\nTry to  not get caught by the evil nun and her terrible pet — Gummy!\n\nThe map is not finished yet.\n\n\nCreator: Vince Louis\nYoutube: Vince Louis', 'https://www.youtube.com/channel/UCxkdCXBiKJaj6v_sv3dU3TQ', '', 'u4nzNn6', '', 'Horror, Puzzle', '3.7 MB', '1.16.220+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1157', 'Last Day on Earth', 'Last Day on Earth is a survival adventure map inspired by a popular mobile game of the same name.\n\nIt takes place in a barrent post-apocaliptic world. The world as we know it ended when a deadly virus took its heavy toll, killing most of the Earth''s population.\n\nYou are one of the few survivors, but calling you lucky wouldn''t be right.\n\nSurvive the hostile world the Earth has become, collect the materials required to repair the broken spacecraft and leave the cursed Earth!\n\n\nCreator: Umerkk164\nTwitter: umerkk164', 'https://twitter.com/umerkk164', '', '003KpEz', '', 'Survival, Adventure, Apocalypse', '2.1 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1158', 'Thorpe Park', 'This is an awesome recreation of the Thоrpе Pаrk thеmе pаrk in Englаnd! Thеrе аrе mоrе thаn 40 diffеrеnt аttrасtiоns (аnd thаt inсludеs еvеrything frоm rоllеr соаstеrs tо wаtеr ridеs). And an addon makes it possible for carts to do 360 loops!\n\nSome of the rides:\n• SAW: The Ride (Old Town)\n\n• THE SWARM (Swarm Island)\n\n• Colossus (Lost City)\n\n• Amity\n\nCome and have fun! \n\n\nCrеаtоr: BlосkMаstеr_203\nYoutube: BlockCoasters', 'https://www.youtube.com/channel/UCfWT9kr50zQHeifkEqDjahg', '', 'lA1EqB2', 'ZGJa8URpSQs', 'Creation, Park, Rollercoaster', '25.9 MB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1159', 'Minecraft Cinema [Movie Theater]', 'In this awesome map you can walk into a movie theater and watch a music video clip on a huge screen, right inside the Minecraft!\n\nAfter entering the cinema hall turn right and go to the control room to start the movie.\n\n⚠Warning:\n1. The wolrd file is large (>60 Mb)\n2. and the map requires a powerful device to run smoothly.\n\n\nCreator: CAIMEO&Wolf_KaiYan\nTwitter: WolfKaiyan', 'https://twitter.com/WolfKaiyan', '', 'BYqLVNm', '', 'Creation, Redstone', '62.2 MB', '1.17.2+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1160', 'Random Items Skyblock', 'In this map you spawn on a single block floating in the void.\nEvery 10-15 seconds you get random items.\n\n\nCreator: jesser101\nYoutube: jesser101', 'https://www.youtube.com/c/jesser101', '', '2wXLT2f', '', 'Skyblock, Random, Survival', '291 kB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1161', 'Unfair Villager [Hardcore Puzzle]', 'Unfair Villager is a hardcore puzzle map inspired by the popular Unfair maps for Minecraft PC.\n\nTry to clear all the levels by solving the puzzles.\nYou will need a lot of patience, because every time you die you start all the way from the start!\n\nIf you''re stuck you can watch the walkthrough here: youtube.com/watch?v=dH9GCwNaVCg\n\n\nCreator: ZHAOX\nYoutube: ZHAOX', 'https://www.youtube.com/channel/UCgvkkhRzQpajHb8qRUw9gDw', '', 'KlNXE4j', '', 'Puzzle, Adventure', '1.2 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1162', 'Going Up! Parkour Batman', 'A small wild west town with several buildings, inlcuding:\n• a Bank\n• windmill with wheat farms\n• a tavern\n• and others\n\nYou can earn achievements in this world, great for survival gameplay!\n\n\nCreator: Ruubzy\nInstagram: ruubzy.ig', 'https://www.youtube.com/channel/UCMocJtiMXBacZSjSHFetrig', '', 'Xaf9xYG', '', 'Parkour, PvP', '34 kB', '1.14.0.9+', '0', ''
