      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1165', 'Detection E1: Thief! [Adventure]', 'In this adventure map you are playing a role of a detective. Look for clues and try to find out who is behind all the thievery and murders that are happening lately in the village of Blocksville.\n\n\nCreator: MineCreeper1290', 'https://mcpe.app', '', 'laaOMiX', '', 'Adventure, Puzzle', '86 kB', '1.16.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1166', 'Captive Minecraft Survival', 'Captive Minecraft is a survival game where you''re limited by a world border.\n\nYour goal is to earn achievements from the achievements book, unlock treasure chests and expand the world border to unlock more space.\n\nBy expanding the world border, you will have access to more and more treasure chests that are spawned in Overworld, Nether and the End!\n\nThe map supports up to 5 players.\n\n\nCreator: -nxtdxny\nYoutube: nxtdxny', 'https://www.youtube.com/c/nxtdxny', '', 'F5F5TH9', '', 'Survival, Adventure, PvP', '17.6 MB', '1.17.11+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1168', 'Minegames: 8 minigames PvP', 'This world provides 8 fun PvP minigames:\n\n1. • The Bridge •\nA 2 team PvP minigame where your objective is to cross the bridge, try reach the other team’s base, and jump in their goal to score a point.\nFirst team to score 5 points wins!\n\nYou will get swords, armour, and other items you will need to defeat the other team.\n\n\n2. • Kitted FFA •\nA free for all PvP. Choose from 12 available kits and defeat all other players! The last player standing wins.\n\n\n3. • Knockoff  •\nPlayers are spawn on a floating platform and are given a bow. Knock other players off the platform and be the last one standing to win.\n\n\n4. • Playground •\nIn this mode there are no rules, everybody is free to do what they want. You can parkour, fight other players, practice your archery skills and more!\n\n\n5. • Duels •\n2 teams, the last one standing wins. Easy!\n\n\n6. • Hide N Seek •\nGame starts with 1 Seeker and all other players as Hiders. Seek can hit a Hider to convert him into a Seeker as well. The game stops when time runs out or there are no more Hiders.\n\n\n7. • Skywars •\nA classic Skywars game: Players are spawned each on their own floating island and have to use the resources they are given to defeat all other players.\n\n8. • Parkour Race•\nFinish the parkour track race before other players do!\n\n\nCreator: Aden Lynn\nYoutube: Aden Lynn', 'https://www.youtube.com/channel/UCWLkmKLz1JIoo-uh6_5rYNg', '', 'UI0WNQU', '', 'Game, PvP, Skywars', '2.0 MB', '1.17.11+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1169', 'McDonald Mystery 3', 'This is the final chapter of the McDonald Mystery Series.\nIn this part you have to stop Ronald McDonald from burning down the local McDonalds in the town of McVille.\n\n\nCreator: TheCommanderCreeper\nYoutube: The Commander Creeper\nPaypal: paypal.me/commandercreeper', 'https://www.youtube.com/channel/UCcQfQHAMB5-dCD-AgX2LZGg', '', 'cSZfCo0', '', 'Horror, Adventure, Parkour', '8.7 MB', '1.2.6+', '0', 'https://www.youtube.com/channel/UCcQfQHAMB5-dCD-AgX2LZGg\npaypal.me/commandercreeper'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1179', 'Mutant Hunter [Zombies]', 'H.Y.P.E.R Enterprise has been working on a top secret program to create superhuman soldiers. But things quickly got out of control, and now the lab is full of mutant zombies.\n\nYou area a highly skilled Anti Mutant Vanguard Soldier who have been sent to the lab to eliminate all of the zombies and to shut down the Zombie Mutant Brain Controller!\n\n\nCreator: PUMPKINSID', 'https://mcpe.app', '', '4WG2mPt', '', 'Adventure, Zombie, Parkour', '4.7 MB', '1.5.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1180', 'The Living Dead [Zombie Adventure]', 'The Living Dead is an awesome open-world post-apocalyptic Zombie adventure/survival.\n\nA mysterious virus plagued the Earth, you and a few lucky others are the only ones who have not been infected. Most other people have turned into flesh-hungry zombies.\n\nEntire cities and towns are now desolate and filled with hordes of angry monsters.\n\nExplore this vast world and try to figure out what happened and not die. You will get help from military resistance forces. Good luck!\n\n\nCreator: RealTnTMaster', 'https://mcpe.app', '', 'lQXDJO7', '', 'Adventure, Survival, Apocalypse', '61.3 MB', '0.16.0+', '1', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1181', 'Haunted Mansion Hunt [Halloween]', 'Happy Spooktober!\n\nThis map features a big haunted mansion with 54 special items hidden in barrels all over the map.\n\nGo on a hunt to find them all!\n\nThere are many hidden secrets and easter eggs to discover, including a secret portal to the extra spooky copy of the mansion in the End!\n\nIt is recommended to set brightness to a low value for better experience.\n\nYou can play alone or compete with your friends.\n\n\nCreator: Potassiumola\nYoutube, Twitter, Instagram, Patreon: Potassiumola', 'https://www.youtube.com/channel/UC8oQR3rvm4KmS6WVE61aLRQ', '', 'bNOOOhL', '', 'House, Adventure, Parkour, PvP', '17.0 MB', '1.17+', '0', 'https://www.youtube.com/channel/UC8oQR3rvm4KmS6WVE61aLRQ\nhttps://www.twitter.com/potassiumola\nhttps://www.instagram.com/potassiumola\nhttps://www.patreon.com/Potassiumola'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1182', 'Small Medieval Kingdom', 'This map features a small castle with a nearby village full with busy vilagers. The village is surounded by a wall and has houses, a market, a church and farms.\n\nThere''s also a big autogenerated village nearby.\n\n\nCreator: ExhaustedGamingLife\nYoutube: Exhausted Gaming Life', 'https://www.youtube.com/channel/UCJAEGsOirkeXjLKAi0nsB5Q', '', 'EoZ3w62', '', 'Village, Castle, Medieval', '22.1 MB', '1.17+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1183', 'Viking Village [Vinland Saga]', 'This is a small village built in a Viking-like style, inspired by the Vinland Saga manga series and other sources on Nordic architecture.\n\n\nCreator: RazorJazz', 'https://www.planetminecraft.com/project/nordic-viking-fantasy-city-detailed/', '', 'gSHjQsS', '', 'Village, Creation, Viking', '15.9 MB', '1.16+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1184', 'Spooky House', 'This is a small spooky house decorated for Halloween.\n\n\nCreator: ExhaustedGamingLife\nYoutube: Exhausted Gaming Life', 'https://www.youtube.com/channel/UCJAEGsOirkeXjLKAi0nsB5Q', '', 'KbDFQcG', '', 'House, Halloween', '4.3 MB', '1.16+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1186', 'Squid Game PvP', 'This map recreates the Red Light - Green Light game from the popular Netflix show "Squid Game".\n\nThe rules are simple:\n• You are allowed to move when the doll is talking\n• When she stops talking you must stop or you will be eliminated\n\n \nIt is recommended to play in third person mode for better experience.\n\nYou can play solo or with other players.\n\n\nCreator: LiL Craft YT\nYoutube: LiLCraftYT', 'https://www.youtube.com/c/LiLCraftYT', '', 'RtbKoSM', '', 'Game, PvP, Squid', '578 kB', '1.17.30+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1187', 'Hunger Games Mars [Pvp]', 'Hunger Games Mars is a PvP game inspired by the popular movie series The Hunger Games.\n\nYou are spawned on a Mars base along with other players.\nEach player should stand on his platform and after the counted has been done run and fund provision, armor and weapons hidden in chests all over the map.\n\nThen try to kill all the other players. The last player to stand wins!\n\n\nCreator:  Jooky2000\nTwitter: Jooky2000_', 'https://twitter.com/Jooky2000_', '', 'fuFbQqO', '', 'Game, PvP', '474 kB', '1.0.0+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1188', 'Herobrine SMP [October ''21]', 'Herobrine SMP is a popular survival multiplayer server.\nThis is a recreation of the server as of October 2021.', 'mcpe.app', '', 'qoVliMz', '', 'Base, Survival, Youtube', '26.0 MB', '1.17.30+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1189', 'Teddy Gaming World', 'Teddy Gaming youtuber''s survival world with:\n• automatics sugarcane and bamboo farms\n• pumpkin and wheat farms\n• xp farm\n• trading villagers\n• storage\n• big Steve statue\n• and more\n\nYou can earn achievements in this world.\n\n\nCreator: Teddy Gaming\nYoutube: Teddy Gaming', 'https://www.youtube.com/channel/UCXv_UYbZ-AP3w7uulH-LSUA', '', 'AU7LUQx', '', 'Survival, Base, Youtube', '13.4 MB', '1.16.220+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1190', 'Saga MC & Casa Automática |Felipe Neto+Viniccius13', 'Felipe Neto and Viniccius13 are two popular Brazilian youtubers.\n\nThis world combines creations from both of their survival worlds.\nThere is so many awesome creations:\n• Castles\n• Giant tree\n• Giant mushrooms\n• Multiple decorated houses\n• Temples of various styles\n• Pyramids\n• Bamboo forest and a panda sanctuary\n• Awesome portals\n• Nether railway tunnels to different places in the world\n• and many more!\n\nYou can earn achievements in this world.\n\n\nCreators: Felipe Neto, Viniccius13\nYoutube: Felipe Neto, Viniccius13\n\nPorted by: Mistério Craft\nYoutube: Mistério Craft', 'https://www.youtube.com/user/felipeneto', '', 'MtD0kMG', '', 'Base, Survival, Youtube', '204.7 MB', '1.16+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1191', 'OP Chest World [Mod]', 'This world contains OP Chest Mod which fills naturally generated chests with OP items such as:\n• enchanted armor and weapons\n• enchanted diamond tools\n• diamonds\n• emeralds\n• etc\n\n\nCreator: Minecraftter', 'mcpe.app', '', '9QUJxLz', '', 'Mod, OP, Village', '3.9 MB', '1.12.1.1.1+', '1', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1192', 'Yandere Simulator World', 'This map recreates the world from the Yandere Simulator videogame. It contains a town with different types of houses, temples, an ocean beach, high school, football field.\n\nAlmost all of the buildings are furnished.\n\n\nCreator: Bidryan\nInstagram: jcraftbidryan', 'https://www.instagram.com/jcraftbidryan', '', '8L3L0lO', '', 'City, Anime, School', '4.4 MB', '1.17+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1193', 'Morph Mod World', 'This world contains a Morph mod which let''s you morph into (almost) any mob in the game! Not only will you take the mob''s form, you will also get all of its abilities!\n\nFly as chicken, swim as fish, explode as creeper, scare off villagers as zombie, give wool as sheep, climb walls as spder etc.\n\n\nUse the Soul catcher item to collect mob''s Soul, which you can then use to morph.\n\n\nCreator: CookieDookie\nYoutube: CookieDookie145\nTwitter: ProBabyGoodBoy', 'https://www.youtube.com/c/CookieDookie145', '', 'J0HIPWr', '', 'Mod, Morph, Game', '2.7 MB', '1.17.30+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1194', 'Erebor [Hobbit | LOTR]', 'Erebor or The Lonely Mountain is a legendary Dwarven stronghold, the Kingdom under the Mountain in the Middle-earth world of the Lord of The Rings / The Hobbit universe.\n\n\nCreator: sonofdad123\nYoutube: sonofdad123', 'https://www.youtube.com/channel/UCoY09voWZsn2Z5bryMD9CQw', '', 'ONaDJe6', '', 'Creation, City, LOTR', '11.3 MB', '1.9.0.15+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1195', 'Underwater Survival Base', 'This is a cool underwater base with multiple rooms:\n• Farm with carrots, wheat, beehives and glowberries\n• Living room\n• Big Hall\n• Recreational area with a jacuzzi\n• Storage / enchantment room with a Nether portal\n\n\nCreator: Little_Gator\nXbox profile: LittleGator6297', 'https://account.xbox.com/en-us/Profile?xr=LittleGator6297', '', 'rW5ou3E', '', 'House, Survival, Base', '12.1 MB', '1.17+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1196', 'Medieval Island Town', 'This is a lovely small medieval town with:\n• many fully furnished homes\n• 2 cathedrals\n• 2 harbours with ships\n• a lively market\n• watchtowers\n• and more!\n\n\nCreator: danielberrry\nXbox profile: danielberrry', 'https://www.planetminecraft.com/member/danielberrry/', '', 'W7LzVRa', '', 'City, Village, Medieval', '13.0 MB', '1.17+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1197', 'Dungeon Craft 7.0', 'Dungeon Craft is a crazy MCPE addon that adds hundreds of new unique mobs, colorful biomes, structures, towns and cities, new ores, items, armours and weapons and much more!\n\nIt may take a few days of playing and you still will not discover everything this addon has to offer!\n\n\nCreator: ThatDirtMan7494\nYoutube: ThatDirtMan7494', 'https://www.youtube.com/channel/UCZvS9ulaXALAHGHEmLLMF4A', '', 'Oq8AVOk', '', 'Mods, Addons, Survival', '11.2 MB', '1.17+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1198', 'Terraria Mod World', 'Do you like Terraria and Minecraft? Well, now with the help of this mod you can play both at the same time!\n\nThis mod adds many of Terraria''s items, ores,  biomes, weapons, mobs, bosses and more.\n\nBiomes:\n• The Forest Biome\n• The Desert Biome\n• The Ice Biome\n• The Underground Desert Biome\n• The Underground Mushroom Biome\n• The Underground Jungle Biome\n• The Crimson Biome\n• The Snow Biome\n\nStructures:\n• The BeeHive\n• Meterorite\n• Runied House\n• The Dungeon\n• Enchanted Sword Shrine\n• Living Trees\n• Floating Islands\n• Underground Cabin\n\nAlmost all of the mobs from Terraria:\n• Eater of Souls\n• Goblin Warriors\n• The Snatchers\n• The Merchant\n• Angry Bones\n• and many others\n\nBosses:\n• Eye of Cthulhu\n• King Slime\n• Brain of Cthulhu\n• Queen Bee\n• Wall of Flesh\n• Eater of Worlds\n• Skeletron\n\nEvents:\n• Blood Moon\n• Goblin Army\n• Slime Rain\n• Rain\n\nThis mod may not work correctly in 1.18+ because of the new world generation system.\n\n\nCreator: LanceLikesSause Dev\nYoutube: LanceLikesSause Games', 'https://www.youtube.com/channel/UCoQo-BlMDHTUMtU38hlpAWw', '', '1CzzTgv', '', 'Adventure, Mods, Addons', '2.5 MB', '1.17.30+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1199', 'Hide & Seek | Прятки', 'This is a small H&S map for 2 players, with a hanful of creative hiding spots.\n\nHey! This map is about hide and seek! Hope you, my friend, enjoy this map, wish you all the best and goodbye.\n\n\nCreator: Fluffy', 'mcpe.app', '', 'A8BJGoK', '', 'Hide and Seek, H&S, Game', '62 kB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1200', 'Parkour Corridor', 'Parkour Corridor is a map with 30 colorful easy parkour levels.\n\nThere are also some hidden easter eggs and a small shop where you can purchase jump and speed boosts after you''ve completed the course.\n\n\nCreator: JMCbrine\nYoutube: JMCbrine', 'https://www.youtube.com/channel/UCrq2TssZEKSMFnkP8MkQhcA', '', '5W1Z3gf', '', 'Game, Parkour, Puzzle', '4.1 MB', '1.17.10+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1201', 'Parkour Corridor 2', 'Parkour Corridor 2 is a map with 30 easy levels.\n\nThis time the levels are much bigger and more detailed than in the first part of the series. Each level is themed around a specific biome or a them, and they all are vibrant and beautiful!\n\nThere are also some hidden easter eggs and a small shop where you can purchase jump and speed boosts after you''ve completed the course.\n\n\nCreator: JMCbrine\nYoutube: JMCbrine', 'https://www.youtube.com/channel/UCrq2TssZEKSMFnkP8MkQhcA', '', '8r5xWg5', '', 'Game, Parkour, Puzzle', '3.9 MB', '1.17.10+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1200', 'Parkour Corridor 2', 'Parkour Corridor 2 is a map with 30 easy levels.\n\nThis time the levels are much bigger and more detailed than in the first part of the series. Each level is themed around a specific biome or a them, and they all are vibrant and beautiful!\n\nThere are also some hidden easter eggs and a small shop where you can purchase jump and speed boosts after you''ve completed the course.\n\n\nCreator: JMCbrine\nYoutube: JMCbrine', 'https://www.youtube.com/channel/UCrq2TssZEKSMFnkP8MkQhcA', '', '8r5xWg5', '', 'Game, Parkour, Puzzle', '3.9 MB', '1.17.10+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1202', 'TopCraft SMP', 'TopCraft is a poular Brazilian SMP server.\n\nThis recreation contains many of the buildings from the original world. However, most of the buildngs do not have interiors.\n\nThis world is in creative mode, so you cannot earn achievements.\n\n\nCreator: RXBGAMES\nYoutube channel: RXBGAMES', 'https://www.youtube.com/channel/UCEMFUBie2uzC4ZqhFMWmErg', '', 'zCm0AwM', '', 'SMP, Youtube, Creation', '33.2 MB', '1.17.30+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1203', 'Classic Skyblock', 'Classic skyblock map with many floating islands representing different biomes from all dimensions: Overworld, Nether and The End.\n\n\nCreator: Alpha Studios\nYoutube: CodeName Guardian', 'https://www.youtube.com/channel/UCWrmnjx2yXLZJMPu6AWQpDA', '', 'd77Gsmw', '', 'Skyblock, Game, Survival', '3.6 MB', '1.16.210+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1204', 'New Year Fireworks + Minigames', 'This colorful map let''s you watch an awesome fireworks show!\nThere''s also a minigames area with 3 games: Rock-Paper- Scissors, Whack ''Em All and a Bow game.\n\nYou can also discover a secret Happy Birthday area.\n\n\nCreator: DiamondGamerAsh\nYoutube: DiamondGamerAsh', 'https://www.youtube.com/channel/UCina1q1MgKYao2sXj-N34wg', '', '6ZqVhMX', '', 'Creation, Fireworks, New Year', '7.8 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1205', 'PvE / PvP Arena', 'This is a PvE/PvP arena where you can fight mobs and other players.\n\nThere are many locations around the map, as well as automatically generated random loot in chests. And you can trade with villager traders to get better loot!\n\n\nCreator: Vatonage\nYoutube: Vatonage', 'https://www.youtube.com/channel/UCI2V49THhaT679Ig_4Uoo3Q', '', '9W6Dfkr', '', 'Game, PvP, PvE, Survival', '810 kB', '1.12.1.1.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1206', 'AquaBlock v1.0 [Skyblock]', 'This is a unique spin of the popular SkyBlock type maps.\nInstead of spawning on a floating island in the skies you are challenged to survive on an underwater island deep in the ocean!\n\n\nTo make the game interesting you have a list of challenges you can complete. You can find the list in the instructions book on the island.\n\nBeing surrounded by water will make even simple tasks much harder, so you will have to think outside of the box (or should we say outside of the water? haha).\n\n\nGood luck and try not to drown too often!\n\n\nCreator: Diaub', 'mcpe.app', '', '5zrfUn3', '', 'SkyBlock, Game, Survival', '2.0 MB', '1.13.0.34+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1207', 'Zombie Waves PvE', 'This PvE map contains 3 gamemode:\n\n• Apocalypse\nSurvive 3 waves of mobs to win\n\n• Freeplay\nSurvive as many waves as you can!\n\n• Food Fight\nCollect the ingredients needed to bake a cookies and try to not get killed in the process\n\nThis map is suitable for 1-8 players.\n\n\nCreator: TeamLeonMC', 'mcpe.app', '', 'Q53HIVo', '', 'Survival, Game, PvE', '159 kB', '1.12.1.1.1+', '0', ''
    );
