    ) VALUES (
      '1208', 'SkyWars: World Of Rarity', 'This map contains classic SkyWars and a PvP/PvE multiplayer games.\n\nYou need at least 2 players to play.\n\n\nCreator: Kirito-06\nYoutube: Proyecto Ion', 'https://www.youtube.com/channel/UCl9ri-pnhkW-P36KomR1POw', '', 'bRoQRP6', '', 'SkyWards, Game, PvP, PvE', '551 kB', '1.16+', '0', ''
