    ) VALUES (
      '1209', 'DeathRun Redux', 'This is a multiplayer minigame with simple rules:\n\nPlayers divide into 2 teams — the Runners and The Death.\n\nRunners\nYour goal is to complete the obstacles course in the given amount of time.\n\nDeath\nYour goal is to set traps and create obstacles on the runners'' way and make them run out of time before they reach the end of the course.\n\n\nCreator: McMCPE1234', 'mcpe.app', '', '7PECFOb', '', 'Game, PvP, Parkour', '662 kB', '1.17.30+', '0', ''
