    ) VALUES (
      '1210', 'Wadzee Hardcore World', 'This is a recreation of the Hardcore survival world of Wadzee — a popular Australian youtuber.\n\nThere are a number of interesting monuments, a few houses with interiors and 4 skyscrappers which are empty inside.\n\nAchievements are enabled in this world.\n\n\nCreator: Wadzee, C1OUS3R\nYoutube: Wadzee, C1OUS3R', 'https://www.youtube.com/channel/UCbTKxZa77gscEmcjnZThUaQ', '', 'WMuS2sb', '', 'Base, Survival, Youtube', '66.8 MB', '1.14.0.9+', '0', ''
