    ) VALUES (
      '1211', 'Wheel Unfortunate', 'This map is base on the popular youtube channel Dude Perfect''s Wheel Unfortunate segment.\n\n\nThe rules are simple: spin the wheel, click the button with your color and try to get out of a bedrock chamber you''ve been put in.\n\n\nCreator: Unpredictable_Maps\nYoutube: unpredictablegaming', 'https://www.youtube.com/unpredictablegaming', '', 'eKwGyeu', '', 'Game, Youtube, Parkour', '97 kB', '1.12.0.25.1+', '0', ''
