      '1214', 'Hide and Seek: Tropical Resort', 'This is a hide and seek map themed as a tropical beach resort.\nDespite being a small map it has a lot of hiding places which makes it very fun to play.\n\n\nCreator: ItzGamerBonez\nYoutube: ItzGamerBonez', 'https://www.youtube.com/channel/UCwdAY-hI5RZprypaWoANxbA', '', 'nmHCOad', '', 'Game, PvP, HnS, Escondite', '276 kB', '1.12.0.25.1+', '0', ''
