    ) VALUES (
      '1215', 'Hide and Seek: Spooky Mansion', 'This is a hide and seek map set up in a big spoky mansion.\n\nThe house is pretty big and has a lot of hiding places so it can take seekers a lot of time to find anybody!\n\nYou need at least 2 players to start the game.\n\n\nCreator: ItzGamerBonez\nYoutube: ItzGamerBonez', 'https://www.youtube.com/channel/UCwdAY-hI5RZprypaWoANxbA', '', 'fw4zCUs', '', 'Game, PvP, HnS, Escondite', '385 kB', '1.16+', '0', ''
