INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1216', 'Complete The Pyramid', 'In this minigame your goal is to find the missing pieces of the pyramid needed to activate it.\n\nThere are 8 different levels with hidden chests which contain the missing blocks.\nFind them all and place to complete the pyramid.\n\nTo return to the lobby simply throw a snowball.\n\n(Find The Button)\n\n\nCreator: Team Infinite Minds\nTwitter: TInfiniteMinds', 'https://twitter.com/TInfiniteMinds', '', 'jOgFx1v', '', 'Game, Puzzle, FTB, CTM', '341 kB', '1.12.0.25.1+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1217', 'Gmod Tower', 'This map recreates the Gmod Tower — a fan-created mod for Garry''s Mod.\n\nIt is great for multiplayer RP or just for exploring.\n\nIt includes:\n• Lobby 1\n• Forest\n• Pool\n• Entertainment Plaza\n• Appearance Store\n• Electronic Store\n• Casino\n• Restaurant\n• Bar\n• Arcade\n• Gamemode Ports\n• Suites\n• and more\n\n\nCreator: Gmanluigi\nYoutube: Gmanluigi', 'https://www.youtube.com/channel/UCsk6FTxLth9VbySV3r32FFw', '', 'wTPXMRp', '', 'Creation, RP, Multiplayer', '567 kB', '1.12.1.1.1+', '0', ''
    );
