INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1221', 'AliceQ', 'AliceQ is a horror/adventure map similar to Granny.\n\nYour goal here is to find your way out of a haunted house without getting cauhgt by the ghost of Alice.\n\n\nCreator: GBrookeFX\nYoutube: GBrookeFX', 'mcpe.app', '', 'XAWziVw', '', 'Horror, Adventure, Puzzle', '1.6 MB', '1.13.0.34+', '0', ''
