INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1222', 'Alice Mansion [Horror]', 'Alice Mansion is a horror/adventure map similar to the Granny horror game.\n\nYour goal is to find your way out of a haunted mansion without getting cauhgt by the ghost of Alice.\n\nFind 4 gold ingots, 2 keys and a compass to escape the mansion.\n\nCustom textures, sounds and ambient music add greatly to the atmosphere of the game!\n\n\nCreator: GBrookeFX\nYoutube: GBrookeFX', 'mcpe.app', '', '83YYmo5', '', 'Horror, Adventure, Puzzle', '1.7 MB', '1.13.0.34+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1223', 'Savanna Paradise Resort', 'Savanna Paradise Resort is an awesome amusement park with lots of thrilling rollercoasters, an aquapark and lots of greenery.\n\nIn total there are 10 areas:\n• Entrance\n• The Nightmare Zone\n• The Ancient Castle\n• Magic Land\n• The Tropical Island\n• Futuristic Land\n• Possessed Forest\n• Savanna Gardens\n• Medieval Land\n• The Sea\n\n\nCreator: SavannaYT\nYoutube: Savanna', 'https://www.youtube.com/channel/UCf03TH2sXTjRuN-ZTvxH0pQ', '', 'mu8cVmL', '', 'Rollercoaster, Park, Amusement', '6.0 MB', '1.17.2+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1224', 'Survival World', 'Hey Here is My survival World\nThe World Contains:\n\n• A tower house\n• Wheat, carrot and potato farms\n• Bone meal farm\n• Skeleton farm(2 spawners)\n• Nether portal\n• Enchanting room\n• Dog house\n• Pumpkin and melon farm\n• Sugercane farm\n• Kelp\n\nI think you''ll enjoy to explore this...❤️❤️❤️\n\n\nCreator: Manav Ramani', 'https://www.youtube.com/channel/UCw4FU5MXxZDVHwit_86zptA', '', 'VKJ0BOc', '', 'Survival, Base', '40.6 MB', '1.17.30+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1225', 'Space Station Survival [en|id]', 'You''ve sure played a lot of Survival games, but have you playe a Space-themed Survival game? Well, now you can!\n\nYou''re stranded on a space station in the vast nothingness of cosmos. You have ore generators, shops and farms to grow your space colony and beat the game. Oh, and also some minigames to add some additional fun.\n\nThis map is available in two languages — English and Indonesian.\n\n\nCreator: WINTERMASTER TEAM\nYoutube: WINTERMASTER GAMING', 'https://www.youtube.com/channel/UCcTWvpFsvoy4ZHnlwvcutCw', '', 'RxsDDFl', '', 'Survival, Tycoon, Game', '1.7 MB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1226', 'SlyTheMiner''s Vilkadahan #70 | Survival World', 'Vilkadahan is a survival world of a popular Filipino youtuber SlyTheMiner.\n\nIt has everything you''d want in a survival world:\n• many automatic farms: stone, wood, crops, wood, honeycomb, mobs etc.\n• many unique buildings like houses, a big castle, asian temples\n• many storage rooms\n• a small bay with a big ship\n• and many more!\n\nYou can earn achievements in this world.\n\n\nCreator: SlyTheMiner\nYoutube: SlyTheMiner', 'https://www.youtube.com/channel/UChMoFQr8tEisoGXOhw3cdHg', '', 'JLEYoFO', '', 'Survival, Base, Castle, Youtube', '41.8 MB', '1.16.200+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1227', 'KadaCraft S.1 #20 | Survival World SMP', 'KadaCraft is a popular Filipino Minecraft SMP Server with lots of unique buildings and creations:\n\n• Medieval castles\n• Modern houses\n• Futuristic builds and rockets\n• A huge dragon\n• Asian-style garden island\n• Huge trees\n• Warships\n• Spongebob''s home\n• Pyramids\n• and much more!\n\nYou can earn achievements in this world.\n\n\nCreator: SlyTheMiner\nYoutube: SlyTheMiner', 'https://www.youtube.com/channel/UChMoFQr8tEisoGXOhw3cdHg', '', 'VUtXok6', '', 'Survival, Base, Youtube, SMP', '201.0 MB', '1.14.0.9+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1228', 'Advanced Redstone House', 'This is an advanced house with a many clever redstone/command block mechanisms:\n\n• automatic proximity doors\n• a functional TV\n• an elevator\n• a functional cinema\n• a garage with automatic gates\n• a security room with cameras\n• several secret rooms\n• a secret apocalypse bunker where you can enable invasion mode\n• and more!\n\nThe map is in Spanish.\n\n\nCreator: RausGa\nXbox: RausGa5472', 'https://account.xbox.com/en-us/Profile?xr=RausGa5472', '', 'kH1nJZT', '', 'House, Redstone, Commands', '473 kB', '1.17+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1229', 'Dark Mansion', 'This map features a dark 1900s mansion with a custom resource pack.\n\nExplore intricately decorated rooms, visit the dusty attic, the dump basement or take a walk in the grove that surrounds the house.\n\n\nCreator: Belial6', 'https://www.planetminecraft.com/member/belial6/', '', 'rTnKnnu', '', 'House, Mansion, Halloween', '24.2 MB', '1.17.10+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1230', 'Slendrina: The Cellar - #1', '!!!!WARNING!!! This map contains elements of horror gameplay, loud noises, jumpscares, etc! Do not play if you do not want to be scared! Lower your volume if you are using headphones!\n\nSlendrina is a recreation of the mobile horror game of the same name.\nThe game is set in a dark cellar, and your goal is to find 8 books scattered all over the basement without being caught by Slendrina.\n\n\nCreator: DarkPower202\nYoutube: DarkPower202', 'https://www.youtube.com/c/DarkPower202', '', 'ZtgEJ4J', '', 'Horror, Adventure, Puzzle', '4.3 MB', '1.2.6+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1231', 'Slendrina: The Cellar - #2', '!!!!WARNING!!! This map contains elements of horror gameplay, loud noises, jumpscares, etc! Do not play if you do not want to be scared! Lower your volume if you are using headphones!\n\nThis is a second part of the Slendrina map — a recreation of the mobile horror game of the same name.\n\nThe game is set in a dark cellar, and your goal is to find 8 books scattered all over the basement without being caught by Slendrina.\n\n\nCreator: DarkPower202\nYoutube: DarkPower202', 'https://www.youtube.com/c/DarkPower202', '', 'PmMTCwA', '', 'Horror, Adventure, Puzzle', '2.2 MB', '1.2.6+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1232', 'The Haunted Tunnel', '!!!WARNING!!!: This map contains elements of horror gameplay, loud noises, jumpscares etc.! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\nYou have been trapped inside an old abandoned mineshaft and now have to find your back to the surface.\n\nExplore the tunnels and look for keys, but beware, the mineshaft seems to be haunted by the souls of dead miners!\n\n\nCreator: DarkPower202\nYoutube: DarkPower202', 'https://www.youtube.com/c/DarkPower202', '', 'jYSkKut', '', 'Horror, Adventure, Puzzle', '476 kB', '1.2.6+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1233', 'Subject 248', 'Subject 248 is a short puzzle game. The story behind the map is that you have awaken in the future to find out that 99% of the world population has been wiped out by an unknown virus outbreak.\n\nThere are parkour and find the lever puzzles.\n\n(Find The Button)\n\nCreator: DJDiamondPlayzM\nTwitter: DJDiamondPlayzM', 'https://twitter.com/DJDiamondplayzM', '', 'rmVbtrZ', '', 'Adventure, Parkour, FTB', '217 kB', '1.0.0+', '0', ''
