INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1234', 'Run [Maze]', 'Run is a big maze with a few hidden cottages where you can find supplies. Try to find all the endings and easter eggs!\n\n\nCreator: Snowball5267\nDiscord: Snowball#2836', 'mcpe.app', '', 'N6YxgVA', '', 'Puzzle, Maze, Survival', '215 kB', '1.17.40+', '0', ''
