INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1235', 'Mining Simulator', 'In this mining simulator you can:\n\n• Mine 5 different types of ore: Diamond, Gold, Cobblestone, Iron and Ancient Debris\n• Buy upgrades in the shop: different types of axes, armor and swords\n• Upgrade your gear in the enchantment area\n• Enter the End and kill the Dragon!\n\n\nCreator:  Neel Khemka\nDiscord: Neel Khemka#0459', 'https://www.youtube.com/channel/UCQX_3jnOmCYhEoeasl5uXQA', '', 'J4s6VwP', '', 'Simulator, Game, Tycoon', '1.6 MB', '1.16+', '0', ''
