INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1236', 'Realistic Modern House', 'This is a beautifully decorated modern house with:\n\n• big living area\n• kitchen and diner\n• bonsai gardens\n• 2 bedrooms\n• bar and entertainment area with a big TV \n• a tennis court\n• multiple pools\n\nYou can earn achievements in this world.\n\n\nCreator: ackers5861\nYoutube: ackers5861', 'https://www.youtube.com/channel/UCVOGvVoAj_4gfrjCcrH8-3Q', '', 'v1Id1kG', '', 'House, Survival, Creation', '26.9 MB', '1.17+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1237', 'Survival Island Castle [Medieval]', 'This is a big castle built on a sea island built for a survival game.\nMost of the rooms are empty so you can furnish them as you see fit. However there are some prefurnished rooms:\n\n• Throne hall\n• small underground mob farm,\n• dripstone farm\n• Pumpkin and melon farms\n• bee (honeycomb) farm\n• fish farm\n• villager breeder\n• 3 rooms of villager traders\n• there''s also a huge ship parked outside of the castle\n\nYou can earn achievements in this world.\n\n\nCreator: Krysot\nTwitter: krysot_CZ', 'https://twitter.com/krysot_CZ', '', 'DM8WMBm', '', 'Castle, Survival, Base', '27.7 MB', '1.17+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1238', 'Mushroom House', 'Cozy small mushroom house!\nDespite being a tiny house it has many of the essentials you''d need for a survival game:\n• multiple chests\n• tool tables\n• bedroom\n• kitchen\n• and more\n\nYou can earn achievements in this world.\n\n\nCreator: JayLythical\nYoutube: JayLythical', 'https://www.youtube.com/channel/UCK0yWfikzKAWtf500F8sTyQ', '', 'oZL7ohS', '', 'House, Survival, Tiny', '13.1 MB', '1.17+', '0', ''
    );
