      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1239', 'Modern One-Story House by Deathdoy', 'This is a tiny one-story house with all the essential tools and items you''d need for a survival game.\n\nYou can earn achievements in this world!\n\n\nCreator: Deathdoy\nYoutube: Deathdoy\nDiscord: discord.gg/V78XV7xUHs', 'https://www.youtube.com/channel/UC4ACVOetm2RI57k3flE81uw', '', 'Rqpl0ee', '', 'Houses, Survival', '18.0 MB', '1.17.40+', '0', ''
