      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1243', 'Stunning Lake House', 'A 2-storey house built in a spectacular 1.18 seed: near a deep lake surrounded by snow-covered mountains!\n\nThe house provides everything you need to start a new survival game, and the world, generated by the  new 1.18  system, features spectacular views of high mountains, crazy deep caves and beautiful valleys.\n\nYou can earn achievements in this world!\n\n\nCreator: emywilk\nHouse exterior design: DevilMC', 'https://www.youtube.com/channel/UCQNMij3_CcgvDmycGH7X0Zw', '', 'owy4UEf', '', 'House, Survival', '39.3 MB', '1.18+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1244', 'Achievement world 1.18', 'Earn (almost) all the achievements in one single world, including the latest achievements added in 1.18.\n\n\nCreator: The Sonic Master\nYoutube: TheSonicMaster\nPaypal: paypal.com/donate/?hosted_button_id=V979F2WVNHE78', 'https://www.youtube.com/c/TheSonicMaster', '', '5Tcy8ya', '', 'Survival, Achievements, Creation', '1.3 MB', '1.18+', '0', 'https://www.youtube.com/c/TheSonicMaster\npaypal.com/donate/?hosted_button_id=V979F2WVNHE78'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1245', 'Chernobyl Pripyat Restored [Чернобль | Припять]', 'This is a remastered version of the "Chernobyl and Pripyat" map, with the city of Pripyat restored to its pre-disaster state in 1984.\n\nThere are many updates:\n\n• reconstructed plant\n• 6 reactors with control panels\n• reconstructed cooling towers\n• cafeteria\n• secret underground tunnel \n• added a riverside restaurant\n• many buildings have been rebuilt\n• new Ferris wheel in the park, shooting gallery and merry-go-rounds\n• 2 new stores\n• added fields on the farm\n• several large maps of the city located in different places\n• added an admin house\n• an island house with a yacht\n• added a train\n• road with a tunnel to the pier\n• added a playground\n• all the roads have been restored\n\n\nOriginal map creator: JakpokCo\nCreator: Рома Котов, Андрей Котов\nYoutube: Рома Котов (youtube.com/channel/UCXv8VwmbeY0uXnVps6wSHcw), Андрей Котов (youtube.com/channel/UCIb_3h2a0oWkG7mVkXjZX7A)\nInstagram: roman2009kotov', 'https://youtube.com/channel/UCXv8VwmbeY0uXnVps6wSHcw', '', 'UdLEYoJ', '', 'Creation, City, Survival', '8.8 MB', '1.17.20+', '0', ''
    );
