    ) VALUES (
      '1248', 'Techno Gamerz Survival World #80: ZOO', 'Techno Gamerz''s Survival World #80: ZOO\n\n• big castle\n• automatic farms\n• railway system in the Overworld and in the Nether\n• automatic dipstone farm\n• honey farm\n• new ZOO area\n• and more\n\nYou can earn achievements in this world.\n\n\nCreator: Techno Gamerz\nYoutube: Techno Gamerz', 'https://www.youtube.com/channel/UCX8pnu3DYUnx8qy8V_c6oHg', '', 'oSROlxY', '', 'Survival, Youtube, Castle, Base', '51.2 MB', '1.18+', '0', ''
