INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1249', 'Christmas Easter Egg Hunt', 'In this map you find yourself inside a giant snow globe with a cozy house and a huge Christmas tree.\n\nThere are 7 easter eggs hidden all over the map. Try and find them all!\n\n\nCreator: Chingustus, emywilk', 'https://www.planetminecraft.com/member/chingustus/', '', 'riyglIC', '', 'Game, Parkour, Puzzle', '258 kB', '1.17+', '0', ''
