    ) VALUES (
      '1250', 'Julausrie''s Military Base v 2.0', 'This map features 2 military bases with farms, armory, bedrooms, kitchen, safety room and other cool things. There''s also a surprise chest hidden in the world...\n\nYou can earn achievements on this map.\n\n\nCreator: Julausrie and Elena', 'mcpe.app', '', 'sEj2qw6', '', 'Base, Survival', '1.9 MB', '1.17.11+', '0', ''
