INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1251', 'Willian''s Spongebob World', 'Hey, everyone!\n\nThis map is a project i''ve been working on sinse 2015, a project that recreates the entire Spongebob''s universe.\n\nEvery place, city, parallel dimension and timelines from every episode, movie and special of the show!\n\n\nCreator: Willian de Assis Corrêa\nYoutube: Willianッ\nTwitter @Willian Corrêa\nDiscord: Willian Corrêa#8338\nE-mail: Willianac27@gmail.com', 'https://www.youtube.com/channel/UCa6x_XgpcEr1CAW6z1BSvoA', '', 'zxzbIAs', '', 'City, Creation, Bikini Bottom', '63.4 MB', '1.18+', '0', 'https://www.youtube.com/channel/UCa6x_XgpcEr1CAW6z1BSvoA\nhttps://twitter.com/Willianac25\n'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1252', 'Deathdoy''s Roller Coaster 2', 'A short roller coaster map with multiple locations:\n• Ocean Monument (underwater tracks)\n• Lush cave\n• Woodland Mansion\n• Village\n• and others\n\nThere''s also a cozy lounge area at the end.\n\n\nCreator: Deathdoy\nYoutube: Deathdoy', 'https://www.youtube.com/channel/UC4ACVOetm2RI57k3flE81uw', '', 'A6NFjxV', '', 'Rollercoaster', '4.2 MB', '1.18+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1253', 'Five Nights at Freddy''s', '!!!WARNING!!!: This map contains elements of horror gameplay! Do not play if you don''t want to be scared! Lower your volume if you''re using headphones!\n\n\nThis is a very detailed recreation of FNAF – a popular horror game.\n\nIn this PVP map players are divided into 2 teams:\n\n• The Guard\nTo become a guard enter the building, go to the right and step on the pressure plate that says "Become Guard". After that you will be teleported to the Office where you can use fully functional camera surveillance system.\n\n• The Animatronics\nAll other players that join the game, after the Guard has been chosen, will be Animatronics: Freddy, then Chica, then Bonnie and then Foxy.\n\n\nWhen the guard turns on the lever, that sets the time to night, the game begins!\nThe guard''s goal is to survive until 6 AM!\n\n\n• Rules:\n- The animatronics are not allowed to jump!\n- The guard''s power slowly decreases over time. Using cameras also drains power. So use it wisely!\n- The animatronics take damage if they hide in the blind spot behind the office door when it is closed.\n- When an animatronic get''s within 3 blocks of guard''s chair he gets jump-scared. Be careful!\n\nAdvice: turn your brightness to below 50 for a better experience!\n\n\nCreator: user_NULL\nYoutube: user_NULL\nXBox: userNULL404 ', 'https://www.youtube.com/channel/UC3R-g053KQ7eJHqaRyh8q4g', '', 'Nl2zAZm', '', 'Horror, PvP, Survival', '553 kB', '1.18+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1254', 'Bedwars', 'Classic BedWars minigame for up to 4 players.\n\n\nPlease note, you should drop these items, in order for them to work:\n• TNT\n• Fire Charge\n• Iron Armor\n• Diamond Armor\n• Glass Bottle\n• All of the diamond upgrades\n\n\nCreator: Dabbin_Gaming', 'mcpe.app', '', 'Sl3SPWJ', '', 'PvP, Game', '1.7 MB', '1.16.210+', '0', ''
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1256', 'The Legend of Minecraft – Adventure of Steve', 'In a world of peace, Steve has to go on a quest to save Hyrule from the evil king Ganondorf.\n\n• Villager trading\n• 3 dungeons\n• Hidden secrets\n• 3 mini games\n\n\nThis map is only a demo, the full map will be available later.\n\nIf you wish to get more updates on the full map go to my youtube channel.\n\nNote: If you report a Bug Send it in the The Legend of Minecraft website.\n\n\nCreator: The RTG Gaming', 'https://www.youtube.com/c/TheRTGGaming', '', '3rQS6nc', '', 'Adventure, Puzzle, Parkour', '5.4 MB', '1.17.30+', '0', 'https://www.youtube.com/c/TheRTGGaming\nhttps://thelegendofminecraft.weebly.com\nhttps://discord.gg/9QBQEUT'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1255', 'Wolfics Prison Escape', 'This is a challenging and fun adventure where your goal is to escape the prison and find your father''s book.\n\nCreator: Deathdoy\nYoutube: Deathdoy', 'https://www.youtube.com/channel/UC4ACVOetm2RI57k3flE81uw', '', '3KGgerv', '', 'Adventure, Puzzle', '483 kB', '1.18.10+', '0', 'https://www.youtube.com/channel/UC4ACVOetm2RI57k3flE81uw\nhttps://doywebsite.w3spaces.com/'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1257', 'Olann City', 'A beautiful small city with many attractions:\n• circus\n• waterfalls\n• sports arena\n• new residential area under construction\n• a port and a harbor with multiple ships\n• cinema\n• fire department\n• and more!\n\nCreator: Enmah', 'https://www.youtube.com/channel/UCWSVNpIgBd7ai3Sodj_3JJA', '', 'toQNj4G', '', 'City, Port, Creation', '6.7 MB', '1.7.0+', '0', 'https://www.youtube.com/channel/UCWSVNpIgBd7ai3Sodj_3JJA'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1258', 'Modern City', 'This is a futuristic/modern city with many very creative and colorful skyscrapers and other buildings!\n\nThe city contains:\n• Train station\n• Casino\n• Art Centre\n• Hotels\n• Office buildings\n• Bars\n• Parks\n• Victorian Houses\n• Parlement Building\n• Bridges\n• Docks\n• Ships\n• Aquarium\n• FunFair\n• LandMark\n• Beach\n• Restaurant\n• and more!\n\n\nCreator: MC_Nightmare', 'https://www.planetminecraft.com/member/mc_nightmare/', '', '1jdp9dq', '', 'City, Creation', '5.6 MB', '1.7.0+', '1', 'https://www.planetminecraft.com/member/mc_nightmare/'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1259', 'Kingdom of Verona', 'Kingdom of Verona is a large medieval city, surrounded by smaller villages and a huge castle in its centre. There is much to see and explore, including small mining towns, large trees, dangerous mines, and even a treasure! It is a custom-made world that includes large snow-topped mountains and dense forests.\n\nYou can earn achievements in this world!\n\n\nCreator: Expertise101\nYoutube: ExpertCrafter', 'https://www.youtube.com/channel/UC4M-F_MFr3xDNl7NseYxxCQ', '', 'Pe2xMHs', '', 'Medieval, Village, City', '34.8 MB', '1.12+', '0', 'https://www.youtube.com/channel/UC4M-F_MFr3xDNl7NseYxxCQ'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1260', 'Tephra Castle & Noxshire', 'Tephra Castle is a large castle located on top of a mountain, overlooking the town of Noxshire. Within the town you will find a Town Hall, Castle Keep, Library, Jousting arena, Pub, Inn and Chapel, all fully furnished. As well as a windmill and a few empty house.\n\n\nCreator: NoxusBolgar\nYoutube: NoxusBolgar\nTwitter: noxusbolgar', 'https://www.youtube.com/channel/UCoOkUTw03EPXJZOrkSP9DWw', '', 'NCYAd12', '', 'Medieval, Village, City', '10.3 MB', '1.7.0.13+', '0', 'https://www.youtube.com/channel/UCoOkUTw03EPXJZOrkSP9DWw\nhttps://twitter.com/noxusbolgar'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1261', 'Thunder Bluff', 'This is a recreation of Thunder Bluff – the tauren capital city from the game World of Warcraft.\n\n\nCreator: NoxusBolgar', 'https://www.youtube.com/channel/UCoOkUTw03EPXJZOrkSP9DWw', '', 'avce84w', '', 'Creation, WoW', '2.5 MB', '1.7+', '0', 'https://www.youtube.com/channel/UCoOkUTw03EPXJZOrkSP9DWw\nhttps://www.twitter.com/noxusbolgar'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1262', 'A Nightmare', 'This is a short, but entertaining horror map.\n\nStory: You are trapped inside your own nightmare and have to find a way out.\n\n\nCreator: OposingCritt\nYoutube: ItzCritt', 'https://www.youtube.com/channel/UC4pSGXvsl26BaXNhoQFLh5A', '', 'PiwVMLg', '', 'Horror, Adventure', '236 kB', '1.16+', '0', 'https://www.youtube.com/channel/UC4pSGXvsl26BaXNhoQFLh5A'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1263', 'The Skyblock', 'This is a great skyblock map with more than 20 unique islands!\n\nThere are also minigames and easter-eggs throughout the map.\n\nYou can play alone or with with other players.\n\n\nCreator: manifest.', 'https://www.youtube.com/AddyOnTap', '', 'gSkoTcU', '', 'Skyblock, PvP, Survival, Game', '2.5 MB', '1.16.210+', '0', 'https://www.youtube.com/AddyOnTap\nhttps://www.twitter.com/addyontap'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1264', 'Step Parkour', 'Parkour your way through these floating ships!\n\nThere are a few easter eggs & secrets hidden all around the ships at the spawn. Try to find them all!\n\n\nCreator: manifest.', 'https://www.youtube.com/AddyOnTap', '', 'NdzILqz', '', 'Parkour, Game', '2.8 MB', '1.16.200+', '0', 'https://www.youtube.com/AddyOnTap\nhttps://www.twitter.com/addyontap'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1265', 'The Backrooms', 'The Backrooms map is a recreation of the popular "The Backrooms" adventure game in Minecraft.\n\nYou wander through seemingly infinite levels, each with its own unique design. The goal is to find the exit from each level.\n\nThere are 10+ custom mobs and entities in this map.\n\n\nCreator: UltraDragon999', 'mcpe.app', '', 'TCBaXUx', '', 'Adventure, Game, Survival', '899 kB', '1.18+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1266', 'S.T.A.L.K.E.R: Shadow Of Chernobyl', 'This map is inspired by "S.T.A.L.K.E.R : Shadow Of Chernobyl" game and takes place in the Chernobyl Exclusion Zone.\n\nYou are a stalker in the Chernobyl Exclusion Zone, and you are trying to find out what happened to you after a car accident. Your goal is to find a man named Sterlock. Explore the Zone, build shelters, and try to stay alive in this hostile environment. Along the way, you will need to find or build shelters, as the danger is everywhere. You will find villages, factories, outposts, and fallen cities.\n\n\nPlease note: This map is big, and the file''s size is 183 MB!\n\n\nCreator: O f f l i n e', 'mcpe.app', '', 'Sw8IAH6', '', 'Adventure, Survival, Zombie', '182.7 MB', '1.14.0.9+', '1', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1267', 'Anshu Bisht Survival World', 'This is a recreation of popular Indian youtuber Anshu Bisht''s Gamerfleet survival world. It includes:\n• Crop farms\n• Villager farm\n• Castle\n• Colorful house\n• Sorting system\n• Treasure house\n• and more\n\nYou can earn achievements in this world!', 'mcpe.app', '', 'SyskmVD', '', 'Survival, Youtube, Base', '9.8 MB', '1.18.10+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1268', 'Future CITY 4.9', 'This is a very large, detailed futuristic city map with a lot of different areas to explore.\n• downtown area\n• military area\n• The Pyramid\n• a promenade\n• huge Dome\n• an industrial area\n• and much more.\n\nThere are also a lot of different vehicles around the map, including spaceships, jet fighters, and tanks.\nYou can take the SkyTrain or the different subways around the map, or use the teleporters to travel easily between different areas.\n\n\nCreator: Zeemo', 'https://www.youtube.com/channel/UC5x8AaKAsijQTlNG6B0OaqQ', '', 'ZYYvPPU', '', 'City, Creation', '79.1 MB', '1.11.0.22+', '0', 'https://www.youtube.com/channel/UC5x8AaKAsijQTlNG6B0OaqQ\nhttps://www.instagram.com/zeemo_minecraft'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1269', 'SCB', 'The SCB is a knock-back based pvp map that has 21 unique maps and 4 different game modes. The game modes include:\n\nStandard mode: a free-for-all with 28 mob classes.\n\nBoss mode: has one person as an incredibly powerful boss class and everyone else is teamed up against the boss.\n\nTeam mode: team PvP with unique classes that can only be used in that mode.\n\nSteve mode: is like the standard mode, but everyone is a Steve class with different items that make the game chaotic.\n\n• Big lobby with minigames, including parkour\n• 4 game modes\n• 21 maps\n• 32 mob classes\n• 15 Steve classes\n• 10 boss classes\n\nCreator: Triangle Plan', 'mcpe.app', '', 'L0Cmwom', '', 'PvP, Game, Parkour', '5.2 MB', '1.17.10+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1270', 'The Heart of The Sea - Escape Room', 'This is the first part of a Minecraft Escape Room series that is designed to test your intellect, agility, cunning, perception, endurance, and will to advance. In this first part, you will travel through the woods to find the escape room, then the stopwatch will start and the game begins. You will have to solve puzzles in order to progress through the escape room and ultimately find the heart of the sea.\n\nThe map features 12 Rooms, Parkour, Underwater Maze, and The Guardian.\n\nIf you want to report bugs or become a beta tester consider joining the Discord server.\n\nSubscribe to me on YouTube!\n\n\nCreator: chronicoverride', 'https://www.youtube.com/c/chronicoverride', '', 'DinYLuB', '', 'Game, Adventure, Parkour', '6.6 MB', '1.16+', '0', 'https://www.youtube.com/c/chronicoverride\nhttps://www.instagram.com/chronicoverride\nhttps://www.twitter.com/chronicoverride\nhttps://www.twitter.com/chronicoverride\nhttps://discord.com/invite/h2tr3g7fDA'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1271', 'Command Block Carnival - Quest for The Keepers', 'Command Block Carnival is a map created by Chronicoverride. It is the third map in the Quest for The Keepers series. The map is an escape room style map where the player must complete a series of challenges to progress. You must use your skills to pass Kronicle''s trials and become a Keeper yourself. The map has its own currency system, minigames and many secrets to discover.\n\nIf you want to report bugs or become a beta tester consider joining the Discord server.\n\nSubscribe to me on YouTube!\n\n\nCreator: chronicoverride', 'https://www.youtube.com/c/chronicoverride', '', 'GVuhPlh', '', 'Game, Adventure, Parkour', '7.5 MB', '1.16.220+', '0', 'https://www.youtube.com/c/chronicoverride\nhttps://www.instagram.com/chronicoverride\nhttps://www.twitter.com/chronicoverride\nhttps://www.twitter.com/chronicoverride\nhttps://discord.com/invite/h2tr3g7fDA'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1272', 'Cabin in The Woods - Escape Room', 'Cabin in The Woods is a single player Escape Room map. You play as one of Alfred''s son''s, Danny. You start out at the campsite and your goal is to uncover your Father''s dark secrets and save your family before Alfred returns. There are many puzzles, minigames, parkour and more!\n\nIf you want to report bugs or become a beta tester consider joining the Discord server.\n\nSubscribe to me on YouTube!\n\n\nCreator: chronicoverride', 'https://www.youtube.com/c/chronicoverride', '', 'CvNzRZO', '', 'Game, Adventure, Parkour', '15.1 MB', '1.16.200+', '0', 'https://www.youtube.com/c/chronicoverride\nhttps://www.instagram.com/chronicoverride\nhttps://www.twitter.com/chronicoverride\nhttps://www.twitter.com/chronicoverride\nhttps://discord.com/invite/h2tr3g7fDA'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1274', 'Ravine of Revenge', 'Ravine of Revenge – is an Escape Room map that follows the story of Trilynx. After becoming a Keeper himself, Trilynx returned home and abruptly left his city of Gold abandoned. A tribe of Villagers has moved into the city and they need your help solving the mysteries left behind from Trilynx.\n\nIn this map, players must help a group of villagers solve the mysteries left behind by the previous keeper, Trilynx. This includes finding out what happened to Trilynx, why he left the city suddenly, and where he is now. Players will also need to operate a crane and a car to move around the map, and use the clock tower to tell time. There is also an Easter egg to be found in the map.\n\nIf you want to report bugs or become a beta tester consider joining the Discord server.\n\nSubscribe to me on YouTube!\n\n\nCreator: chronicoverride', 'https://www.youtube.com/c/chronicoverride', '', 'kJOWmRf', '', 'Game, Adventure, Parkour', '46.3 MB', '1.17.2+', '0', 'https://www.youtube.com/c/chronicoverride\nhttps://www.instagram.com/chronicoverride\nhttps://www.twitter.com/chronicoverride\nhttps://www.twitter.com/chronicoverride\nhttps://discord.com/invite/h2tr3g7fDA'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1273', 'Flame of The Ancients - Escape Room', 'Quest for The Keepers is a five-part escape room series presented by Chronicoverride. In this second installment, players must solve puzzles based on perspective, mazes, and parkour in order to advance. The stakes are higher and things are ever more explosive. Do you have what it takes to become a Keeper yourself?\n\nThe map features a variety of different challenges, including mazes, parkour, and piston puzzles.\n\n\n\nIf you want to report bugs or become a beta tester consider joining the Discord server.\n\nSubscribe to me on YouTube!\n\n\nCreator: chronicoverride\n\nCreator: chronicoverride', 'https://www.youtube.com/c/chronicoverride', '', 'UBxgxxb', '', 'Game, Adventure, Parkour', '7.7 MB', '1.16.200+', '0', 'https://www.youtube.com/c/chronicoverride\nhttps://www.instagram.com/chronicoverride\nhttps://www.twitter.com/chronicoverride\nhttps://www.twitter.com/chronicoverride\nhttps://discord.com/invite/h2tr3g7fDA'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1275', 'Noteblock Parkour', 'This is a quick parkour map that is easy to complete no matter your skill level. The map features a custom lobby and custom background music. You can practice your skills by repeating the levels, and see how the map was made in Creative Mode once you complete it.\n\nThere are 5+ different levels:\n• slime\n• nether\n• lava\n• zombie "runkour"\n• End\n• and others\n\n\nCreator: RealMcMatthewPe', 'https://www.youtube.com/mushroommusic', '', 'tEIUsqE', '', 'Parkout, FTB', '17.8 MB', '1.16+', '0', 'https://www.youtube.com/mushroommusic\nhttps://www.instagram.com/MushroomMsc\nhttps://www.twitter.com/MushroomMsc'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1276', 'Find The Button: Fish Pond', 'This map is a "Find The Button" map that takes place underwater. There are five levels, each with different fish. The goal is to find the button on each level to move on to the next.\n\n\nCreator: einua_trinity', 'https://www.youtube.com/channel/UCfyZRTSX0Dy24xyAWoCPnlg', '', 'YK85g3E', '', 'FTB, Game', '289 kB', '1.14.0.9+', '0', 'https://www.youtube.com/channel/UCfyZRTSX0Dy24xyAWoCPnlg\nhttps://www.twitter.com/3nity_the'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1277', 'FTB: Bikini Bottom', 'The small map features five tiny levels, each with a different theme based on a location from the SpongeBob SquarePants TV show.\n\n• Squidward''s House.\n• Patrick''s House\n• the Krusty Krab restaurant\n• Sandy''s House\n• SpongeBob''s House.\n\nThe objective of each level is to find a hidden button, with the difficulty increasing as the player progresses through the map.', 'https://www.youtube.com/channel/UCfyZRTSX0Dy24xyAWoCPnlg', '', 'o9yXEsk', '', 'FTB, Game', '639 kB', '1.14.0.9+', '0', 'https://www.youtube.com/channel/UCfyZRTSX0Dy24xyAWoCPnlg\nhttps://www.twitter.com/3nity_the'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1278', 'FTB: Prison Escape', 'This map is a prison themed Find The Button map. There are five levels, ranging from easy to extremely hard. The goal is to find the button in each level in order to escape the prison cell.\n\n\nCreator: einua_trinity', 'https://www.youtube.com/channel/UCfyZRTSX0Dy24xyAWoCPnlg', '', 'EGZCjih', '', 'FTB, Game', '567 kB', '1.14.0.9+', '0', 'https://www.youtube.com/channel/UCfyZRTSX0Dy24xyAWoCPnlg\nhttps://www.twitter.com/3nity_the'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1279', 'PvP Pratice Arena', 'Do you want to get better at SkyWars, Bedwars and other PvP games?\n\nWell, you''re in luck! This map is designed to help players improve their skills in various PvP gamemodes. There are a variety of training exercises to choose from, including Enderpearl clutch training, PvP training, bridging speed training, block extension training, block parkour, treasure breaking, bow aim, and wall run.\n\n\nCreator: Pada iOS', 'https://www.youtube.com/channel/UCWS9YP27ZhYq9dkqZr8FF0Q', '', 'wWMJpoo', '', 'PvP', '6.4 MB', '1.18.10+', '0', 'https://www.youtube.com/channel/UCWS9YP27ZhYq9dkqZr8FF0Q\nhttps://www.twitter.com/PadaIOS'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1280', 'A Mercenary''s Revenge', 'A Mercenary''s Revenge is an awesome, very detailed adventure map with an interesting story line!\n\nYou are a mercenary on a quest to get back at those who wronged you. The story starts out with you playing through a flashback building up to the climax. There will be tests, trials, and bosses to defeat. Can you make it through and defeat the one who betrayed you?\n\nThis map features:\n\n• A currency system\n• Perks\n• Attributes\n• A tutorial\n• Difficulties and a custom difficulty\n• NPC''s you can talk to\n• Achievements\n• Five Chapters\n• An in-game timer\n• Shops\n• Secrets\n• Puzzles\n• Prison Escape\n• Boss fights\n\nThis map has a detailed story with interesting mechanics and combat; and it aims to bring back the feel of old, journey style, adventure maps. If you have any questions, concerns, or just want to talk feel free to reach out to me!\n\nThe map is in English.\n\n\nCreator: zippyblume', 'https://www.youtube.com/channel/UCan-A1qCIS2Ux7COYcdDhUQ', '', 'AZUH4jG', '', 'Adventure, Parkour, Puzzle', '123.4 MB', '1.17.40+', '0', 'https://www.youtube.com/channel/UCan-A1qCIS2Ux7COYcdDhUQ\nhttps://www.twitter.com/zippyblume\nhttps://www.twitch.tv/zippyblume'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1281', 'Hunter vs Runner', 'This is a classic Hunter vs Runner map for 2-4 players.\n\nThe goal is for the runner to evade the hunters and complete the game (to kill the Ender Dragon).\nThe hunters'' goal is to track down and eliminate the runner.\n\nWhen the start button is pressed the runner is places 200 blocks away from the hunter and the game begins! Hunters are given a tracking item (compass) for the hunters with unlimited uses and a 2 second cooldown.\n\n\nCreator: Otterly2351', 'https://www.youtube.com/channel/UCgjuafhRUA1MwP7Dy090rjg', '', 'c4v5Vro', '', 'Survival, PvP', '3.4 MB', '1.16+', '0', 'https://www.youtube.com/channel/UCgjuafhRUA1MwP7Dy090rjg'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1282', 'Ardonia', 'This map recreates a part of Ardonia – the main world in the fantasy animation series "Songs of War".\n\n\nCreator: Black Plasma Studios', 'https://www.youtube.com/c/BlackPlasmaStudios/', '', 'o8UCYWC', '', 'City, Adventure, Village', '96.8 MB', '1.14.0.9+', '0', 'https://www.youtube.com/c/BlackPlasmaStudios/\nhttps://www.patreon.com/BlackPlasmaStudios\nhttps://discord.com/invite/blackplasma'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1283', 'The Awakening [ENG]', 'THIS MAP IS IN ENGLISH. THERE IS A SEPARATE VERSION OF THE MAP IN RUSSIAN.\n\nVampires - truth or fiction? What is behind the blood-curdling stories about vampires? Madness and insanity, or something else, more sinister, more ancient? It was these questions that I asked myself when I made this map, putting maximum effort and my free time into it (a break of six months does not count). As a result, a good map came out, but extremely short. I wanted to make it much longer: add a lot of locations, more Easter eggs, more riddles, but even such motivation quickly disappears (especially when you try to fix bugs and flaws most of the time). In general, okay, let''s get to the point.\n\n\nPlot\n\nA historian is an interesting profession, comprehending which you can look into antiquity, into bygone years, uncover the secrets of the past and find real treasures - no, not jewelry and gold (although this too), but ancient writings: letters, chronicles and other documents that shed light on the events of the past. You will play as a girl - a young historian who went to a very responsible and significant event for you - the study of the ruins of an ancient castle. Of course, you did not go alone: one of the best professors at your university, John Williams, went with you. After a long trip, you finally reached the ruins of the castle and set up camp near it. It began to get dark, you, sitting in front of the fire and peering into its bright flame, dozed off. Suddenly you woke up, not finding John next to you, you decided to go and look for him near the ruins of the castle. But you had a strange feeling that someone was looking at you from the side of the forest...\n\nP. S. There are 2 main endings.\n\nYou can support me on my donationalerts and patreon pages below to motivate me to build more maps and spend more time on them.\n\n\nCreator: EvGENI', 'https://www.youtube.com/channel/UC6TMxffZqbIF_Fo2hYGkUCA', '', 'sivCGUg', '', 'Adventure, Horror, Puzzle', '3.3 MB', '1.18+', '0', 'https://www.youtube.com/channel/UC6TMxffZqbIF_Fo2hYGkUCA\nhttps://www.donationalerts.com/r/evgeni_funny_player\nhttps://www.patreon.com/EvGEN1\nhttps://new.donatepay.ru/@855777\nhttps://account.xbox.com/en-us/Profile?xr=EvGEN111111111\nhttps://www.tiktok.com/@evgeni_yt\nhttps://www.planetminecraft.com/member/evgeni'
    );
