    ) VALUES (
      '1284', 'The Awakening [RUS]', 'THIS MAP IS IN RUSSIAN. THERE IS A SEPARATE VERSION OF THE MAP IN ENGLISH.\n\nVampires - truth or fiction? What is behind the blood-curdling stories about vampires? Madness and insanity, or something else, more sinister, more ancient? It was these questions that I asked myself when I made this map, putting maximum effort and my free time into it (a break of six months does not count). As a result, a good map came out, but extremely short. I wanted to make it much longer: add a lot of locations, more Easter eggs, more riddles, but even such motivation quickly disappears (especially when you try to fix bugs and flaws most of the time). In general, okay, let''s get to the point.\n\n\nPlot\n\nA historian is an interesting profession, comprehending which you can look into antiquity, into bygone years, uncover the secrets of the past and find real treasures - no, not jewelry and gold (although this too), but ancient writings: letters, chronicles and other documents that shed light on the events of the past. You will play as a girl - a young historian who went to a very responsible and significant event for you - the study of the ruins of an ancient castle. Of course, you did not go alone: one of the best professors at your university, John Williams, went with you. After a long trip, you finally reached the ruins of the castle and set up camp near it. It began to get dark, you, sitting in front of the fire and peering into its bright flame, dozed off. Suddenly you woke up, not finding John next to you, you decided to go and look for him near the ruins of the castle. But you had a strange feeling that someone was looking at you from the side of the forest...\n\nP. S. There are 2 main endings.\n\nYou can support me on my donationalerts and patreon pages below to motivate me to build more maps and spend more time on them.\nЮмани (Я.Деньги) - 410019109386416\n\n\nCreator: EvGENI', 'https://www.youtube.com/channel/UC6TMxffZqbIF_Fo2hYGkUCA', '', 'q5ubkUK', '', 'Adventure, Horror, Puzzle', '3.4 MB', '1.16+', '0', 'https://www.youtube.com/channel/UC6TMxffZqbIF_Fo2hYGkUCA\nhttps://www.donationalerts.com/r/evgeni_funny_player\nhttps://www.patreon.com/EvGEN1\nhttps://new.donatepay.ru/@855777\nhttps://account.xbox.com/en-us/Profile?xr=EvGEN111111111\nhttps://www.tiktok.com/@evgeni_yt\nhttps://www.planetminecraft.com/member/evgeni'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1285', 'TNT run', 'Hello! My nickname (and also my real name) is EvGENI.\nI try to make cool maps with new ideas and complex logical chains of command blocks.\n\nAbout the map:\nTNT run with 2 different types (classic and modern) and 4 different sizes (small, medium, big and large) to play.\n\n• Classic type\nThis type is the most known and simple. It''s made of 3 layers: pressure plate, sand (or other solid block with falling physics) and tnt.\nThere are some bugs in this type and I added it because I like classic tnt run.\n\n• Modern type\nToday you will not find the old type of TNT run anywhere else: on all servers today there is only a type consisting of 1 layer of solid blocks and, strictly speaking, this type of game is this single-layer type.\nThe mechanics of this type are simple and ingenious in their own way: invisible armor stands appear under you, which, falling to a certain height, activate command blocks and remove the block that the player walked through a few moments ago.\nThis type is developed by me and I really like it.\n\n\nMap sizes:\n\nSmall - arena with a radius of 10 blocks\n\nMedium - arena with a radius of 15 blocks\n\nBig - arena with a radius of 25 blocks\n\nLarge - arena with a radius of 40 blocks\n\nLanguages\nThis map is translated into the following languages:\n\n- Deutsch\n- English (USA)\n- English (GB)\n- French\n- Polish\n- Portuguese\n- Russian\n- Ukrainian\n\n* If you find a mistake in the translation, then please let us know in the comments.\n\nFuture updates:\nIn future updates, I''m thinking of adding something interesting (various chips tied to the gameplay), but if there is no support from you I don''t see the point in wasting time on this map.\nSo support me if you like it!\n\nHow you can support me?\n- Subscribe to me on YouTube and TikTok.\n- Become my patreon - EvGEN1\n- Buy me a coffee or donate to me\nEvery dollar motivates me very much to create new maps or to update the old ones.\n\n\nCreator: EvGENI', 'https://www.youtube.com/channel/UC6TMxffZqbIF_Fo2hYGkUCA', '', 'paRTGl8', '', 'Game, PvP', '1.2 MB', '1.18.30+', '0', 'https://www.youtube.com/channel/UC6TMxffZqbIF_Fo2hYGkUCA\nhttps://www.donationalerts.com/r/evgeni_funny_player\nhttps://www.patreon.com/EvGEN1\nhttps://new.donatepay.ru/@855777\nhttps://account.xbox.com/en-us/Profile?xr=EvGEN111111111\nhttps://www.tiktok.com/@evgeni_yt\nhttps://www.planetminecraft.com/member/evgeni'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1286', 'Make me cry [EN]', 'You''ve been waiting, and finally, the new map "Make me cry" is finally translated to English!\n\nThis wonderful map has already fallen in love with Russian-speaking players for its interesting plot, redstone mechanics and variability of actions, which can slightly change the further passage, and a large number of achievements and references that will not let you get bored!\n\nAnd all this made in vanilla Minecraft (without mods, addons and even texture packs!)\n\nThe map currently contains 2 locations (in the future I plan to add 2 more locations if you will like and support me):\n\n• Abandoned mines\nWho wasn''t afraid to go to the mine when played Minecraft for the first time? This place is scary in survival mode, but in adventure map... it''s much MORE scary. But don''t afraid so much, it''s not horror-map with special texture pack, it''s just one of the locations of my adventure map! Isn''t it? Anyway, you need to figure out what''s going on here and find a way out.\nI recommend going through this location first, as it is quite short, unlike the next one.\n\n• Mountain village\nThis time you will go to a Mountain village. It would seem that nothing bad can happen in such a quiet and peaceful place. But as the well-known saying says: "Beware of a silent dog and still water"...\nThis location is very big, and it take approximately 1 hour to complete this location. There are a lot of content, including quests, achievements, and also some hidden places.\n\n\nSupport me:\nBuilding such big maps is really difficult (especially when you make this alone). So, please support me following by the links below.\n\nYou can also sub my YouTube and TikTok channels.\n\nAnd don''t forget to tell your friends about this map, it''s very important!\n\n\nCreator: EvGENI', 'https://www.youtube.com/channel/UC6TMxffZqbIF_Fo2hYGkUCA', '', 'AuAX6Ah', '', 'Adventure, Puzzle', '3.8 MB', '1.18.10+', '0', 'https://www.youtube.com/channel/UC6TMxffZqbIF_Fo2hYGkUCA\nhttps://www.donationalerts.com/r/evgeni_funny_player\nhttps://www.patreon.com/EvGEN1\nhttps://new.donatepay.ru/@855777\nhttps://account.xbox.com/en-us/Profile?xr=EvGEN111111111\nhttps://www.tiktok.com/@evgeni_yt\nhttps://www.planetminecraft.com/member/evgeni'
    );
