, '6.6 MB', '1.18+', '0', 'https://www.youtube.com/channel/UC6TMxffZqbIF_Fo2hYGkUCA\nhttps://www.donationalerts.com/r/evgeni_funny_player\nhttps://www.patreon.com/EvGEN1\nhttps://new.donatepay.ru/@855777\nhttps://account.xbox.com/en-us/Profile?xr=EvGEN111111111\nhttps://www.tiktok.com/@evgeni_yt\nhttps://www.planetminecraft.com/member/evgeni'
