INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1292', 'Superland 2.0', 'Superland 2.0 is a map that consists of several different minigames combined in one single map. It is best suited for Realms or for local multiplayer as most games are for two players or more. By playing this map you will be able to enjoy PvP games, parkour, Block Party, Speedrun, Drop and Jump, Total Wipeout and much more.\n\n• PvP\n• Parkour\n• Skywars\n• Speedrun\n• Drop and Jump\n• Total Wipeout\n• Pokemon Go\n• Block Party\n• Kit PVP\n• Mario\n• Prisons\n• Capture The Flag\n• Elytra Parkour\n• Zombies Survival\n• Hide & Seek\n• Elytra Parkour\n• Zombies\n• One Punch\n• TNT RUN\n• City Role Play\n• Sumo\n• Farming Simulator Role-Play\n• Theme Park/Zoo\n• Murder Mystery\n• Free Build\n• Sonic Parkour\n• Minecraft Dungeons\n• Cookie Slap\n• Cart Dodge\n• New hub\n• FortressMC Realm\n\n\nCreator: Scuppy12', 'https://twitter.com/scuppy114', '', 'Qxe12Hd', '', 'PvP, Game, Skywars', '55.8 MB', '1.18.30+', '0', 'https://twitter.com/scuppy114\nhttps://www.youtube.com/user/scuppy12\nhttps://realms.gg/ocMJepHPerg'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1293', 'SkyBlock Multiverse', 'This map features both a traditional skyblock mode as well as a oneblock skyblock mode, as well as mini games such as a mob arena and a PvP arena. There is coins which you can use to buy blocks, items and ore generators in the shop. There''s also a day counter that shows how many days you have played.\n\n\nCreator: Rusty Gaming 321', 'https://twitter.com/RUSTYGAMING321', '', '5XWozDc', '', 'Game, PvP, Skyblock', '7.2 MB', '1.18.10+', '0', 'https://twitter.com/RUSTYGAMING321\nhttps://www.youtube.com/c/RUSTYGAMING321\nhttps://discord.gg/kuX6eqDYf7'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1294', 'Hope Hill / Деревня Фиксая', 'This is the village of a popular YouTuber FixEye.\nThere are many unique buildings, farms, castles and more.\n\nYou can earn achievements in this world.', 'mcpe.app', '', 'VdM6VqX', '', 'Village, Youtube, Survival', '22.1 MB', '1.14.0.9+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1295', 'Techno Gamerz World #84: Museum', 'This is a recreation of a popular YouTuber Techno Gamerz''s castle base. Episode #84: Museum.\n\nThe map includes:\n• big castle\n• automatic farms\n• railway system in the Overworld and in the Nether\n• automatic dipstone farm\n• honey farm\n• new ZOO area\n• new big Museum\n• roller coaster\n• and more\n\nYou can earn achievements in this world.\n\n\nCreator: Techno Gamerz\nYoutube: Techno Gamerz', 'mcpe.app', '', '8qbMz51', '', 'Survival, Youtube, Castle, Base', '23.9 MB', '1.18+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1296', 'Quartz Island', 'This map consists of multiple small islands with white quartz houses built on them. The houses have extensive underground and underwater basements. There is also a big main 5-story house. However, the houses are mostly empty.\n\nYou can earn achievements on this map.', 'mcpe.app', '', 'djFG8So', '', 'Survival, House, Base', '3.1 MB', '1.0+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1297', 'Techno GamerZ Hardcore World', 'This is a recreation of a hardcore world of a popular youtuber Techno GamerZ.\n\nThere are multiple farms in this world:\n• iron farm\n• stone farm\n• sugar cane farm\n• wheat farm\n• wood farm\n\n\nYou can earn achievements in this world.', 'mcpe.app', '', 'ba9tDSi', '', 'Survival, Youtube, Village', '918 kB', '1.18.10+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1298', 'Techadron''s Survival World', 'This beautiful map is a recreation of youtuber Techadron''s Hardcore jungle world.\n\nThe map has:\n\n• huge crop farms\n• a lot of unique buildings built above a jungle forest\n• a big ship in the bay\n• floating houses on the beach\n• railway system\n• huge storage building\n• huge unfinished castle\n• and more!\n\nYou can earn achievements in this map.', 'mcpe.app', '', '1yyfYUw', '', 'Survival, Youtube, Base', '28.7 MB', '1.18+', '1', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1299', 'Steven Universe World', 'This map features many of the locations from the popular cartoon show, Steven Universe. The map includes warp pads that lead to the warp stream, which can then be used to travel to different locations on the map.\n\nLocations:\n• Warp Stream\n• Warp Center\n• Ancient Gem Colony Ship\n• Ancient Sky Arena\n• Barn\n• Beta Kindergarten\n• Communication Hub\n• Crystal Temple\n• Desert\n• Galaxy Warp\n• Gem Battlefield\n• Geode\n• Ice Caverns\n• Lunar Sea Spire\n• Mask Island\n• Prime Kindergarten\n• Rose''s Armory\n• Rose''s Fountain\n• Sea Shrine\n• Sky Spire\n• The Forge\n• The Great North\n\nThe map also includes a door in the Crystal Temple that leads to the warp center, which can be used to travel to different temples on the map. There are also warps in the Lunar Sea Spire and the Pyramid Temple that lead to different levels in those locations.\n\nThere''s also a Golden Warp Pad that leads to a beach, and a Roaming Eye that can be used to travel to different locations on the map.\n\n\nCreator: CrimsonWerewolf, Replicraft7', 'mcpe.app', '', 'WjA1XSf', '', 'House, City, Creation', '49.3 MB', '1.14.0.9+', '1', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1300', 'Tower Defense', 'Prepare to defend yourself in this Minecraft Tower Defense game! Face off against waves of enemies and strategically place your towers to defeat them. With three different types of towers at your disposal, choose the one that suits your playstyle best. Dive into various game locations and test your defense strategies. Get ready to protect yourself and conquer the enemy!\n\nCreator: Fotor', 'mcpe.app', '', 'JYxZL8z', '', 'Game', '350 kB', '1.17.10+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1301', 'BedWars in a Bedrock Box', 'Bed Wars is a classic minigame that offers dynamic PvP action for those seeking diversity. Play with your friends (2-8 players) in a bedrock box filled with stone. Mine cobblestone, trade with villagers for items, upgrade your equipment, and defend your bed. Eliminate opponents by destroying their beds, and be the last survivor to win. If you want to play again just wait any seconds. If you have alredy started the game, don''t leave it. This could lead to bugs. \n\n\nCreator: Fotor', 'mcpe.app', '', '88FK3eg', '', 'Game', '681 kB', '1.19.20+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1302', 'The Jungle', 'The Jungle map is perfect for survival adventures, featuring five unique homes, livestock, and a mine. It offers an exciting and immersive jungle experience. You will find plenty of wheat, melons, and cocoa beans for a reliable food supply. The tree houses provide safety during the night, while fenced areas house various animals. The mine is a great place to start mining, and if you venture further, you''ll discover a magnificent jungle mountain with two well-designed houses at the top. The view from the mountain is breathtaking, making the challenging journey worthwhile. There are also some hidden rooms and other secrets on this map.\n\nYou can earn achievements in this world!\n\n\nCreator: KopiandCy', 'mcpe.app', '', '7KpHsVX', '', 'Creation', '43.0 MB', '1.0.0+', '1', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1303', 'Dungeon-Craft', 'Dungeon-Craft is a classic adventure map. You play as a scientist who has been imprisoned for discovering how to make blocks float. Can you escape the underground dungeon and uncover the mysteries within? Download and play to find out!\n\n\nCreator: Furminator\nTwitter: Megafurminator', 'mcpe.app', '', 'aSb4WVF', '', 'Adventure, Game', '155 kB', '1.0.0+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1304', 'ShulkerWars [PvP]', 'ShulkerWars is a PvP map inspired by the End dimension in Minecraft. You start on separate sky islands and must craft items to reach other islands for better gear. The goal is to eliminate the other teams and be the last one standing. The map has shulkers guarding the main island, but smaller islands offer useful items. Watch out for shulkers firing projectiles! The map has been updated with new rooms, bug fixes, and regeneration of shulker boxes.\n\n\nCreator: ZzeuzZ23\nTwitter: Alejand38507559', 'mcpe.app', '', 'YJGZTK6', '', 'PvP, Game', '522 kB', '1.0.0+', '1', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1305', 'Minotaur [Minigame]', 'SG Minotaur is an intense multiplayer minigame where players are assigned the roles of either Survivors or the Minotaur. Survivors must work together to find items and unlock the maze''s exit while avoiding the Minotaur. The Minotaur''s objective is to find and kill all the Survivors. The game offers 10 different themes to customize the arena.\n\n\nCreator: SkyGames\nTwitter: MCPESkyGames', 'mcpe.app', '', 'KA8s4mh', '', 'Game', '592 kB', '1.0.0+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1306', 'Village of Aphrodite', 'Explore a vibrant, rainforest-covered village on a distant planet in this roleplay map! Join the adventure on our YouTube channel. Discover a majestic mountain with a castle, a bustling village, a scenic port, and a mini rainforest. While the entire island couldn''t be covered, we hope you enjoy the lush greenery. Share the map with friends and have fun!\n\n\nCreator: xXRubyGamersXx\nYouTube: TheRubyGamersTRG', 'https://www.youtube.com/@TheRubyGamersTRG', '', 'Ckoj4gR', '', 'Creation', '12.5 MB', '1.0.0+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1307', 'Dead by Dawn 3 [Horror]', 'Dead By Dawn is a multiplayer horror game where one player is randomly chosen as the killer, while the rest are survivors. The killer''s objective is to eliminate all the survivors, while the survivors must repair generators and escape through the exit gates.\n\nThe game features a new killer, The Rake, and a new survivor, Jessica Winters. The killer has abilities such as Horrid Haunting, Quick Scream, Smiting, Generator Disorder, and Feasting.\n\nThe survivor can place bear traps, use security cameras, track the killer, and crawl faster when downed. Hooks are important for the killer to win, while survivors must repair generators and complete skill checks.\n\n\nCreator: RedSlimeTime25\nYouTube: Cr1smatic', 'https://www.youtube.com/@cr1smatic/', '', 'TBXvujg', '', 'Horror, Game, PvP', '14.2 MB', '1.17.11+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1308', 'Achievements World 1.20.0', 'This map is your key to unlocking all achievements in Minecraft Bedrock quickly and easily, whether you''re playing on PC or Mobile.\n\nYou''ll start at the spawn point, where you''ll find the update board, alphabetical order area, and the main achievement area. The new achievement area is conveniently located at the spawn point as well. There''s also a section for content creators to modify the map for showcasing purposes.\n\nThe map includes every achievement currently available in the game, from simple ones like "Taking Inventory" and "Getting Wood," to challenging ones like "The Beginning" and "Wax on, Wax off." You can also easily obtain biome-related achievements such as "Hot tourist destination" and "Caves & Cliffs." Even the newest achievements like "Sneak 100" and "Birthday Song" are included.\n\nIf this map proves helpful, don''t forget to subscribe to OutboardPrism''s YouTube channel for more content.\n\n\nCreator: sokor\nYouTube: OutboardPrism71', 'https://mcpedl.com/leaving/?url=https%3A%2F%2Fwww.youtube.com%2F%40OutboardPrism71', '', 'UtQCUkZ', '', 'Creation', '50.2 MB', '1.20+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1309', 'One Block 1.19', 'One Block is a challenging mini-game where players must break the block they are standing on to progress. This map offers new features, including three new faces on the block, making it even more exciting. You can play alone or with friends, making it suitable for all skill levels.\n\nThere are 13 levels in this map:\n\n1 Forests\n2 Caves\n3 Mangrove swamp\n4 Snowy\n5 Desert\n6 Jungle\n7 Deep dark cave\n8 Ocean\n9 Nether\n10 Mansion\n11 Ancient city\n12 Stronghold\n13 The End\n\n\nCreator: MCPE Faster\nYouTube: MCPE Faster Studio', 'mcpe.app', '', 'pE0NPo6', '', 'Game', '555 kB', '1.19+', '1', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1310', 'Reef Race [Oceanic Parkour]', 'Dive into an enchanting underwater world filled with beautiful landscapes and incredible sculptures. Jump between corals and explore the ocean''s depths alongside sea creatures. \n\nThis mega parkour map offers a stress-relieving experience for players, whether you choose to play alone or with friends. \n\nSwitch between creative and adventure mode as you navigate through castles, trees, ships, and monuments. There are no rules, and the map can be played multiple times. \n\nImmerse yourself fully by playing with the maximum field of vision, but keep in mind that performance may vary depending on your device.\n\n\nCreator: You Koala\nYouTube: @youkoala3371', 'https://www.youtube.com/@youkoala3371', '', '5PnFvYh', '', 'Parkour', '8.6 MB', '1.19+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1311', 'Backrooms', 'Explore the creepy and unpredictable Backrooms in Minecraft Bedrock with your friends. Navigate through different levels and encounter unknown creatures. Be careful not to clip too far or you might get stuck! Choose from different difficulties to adjust the challenge. Collect supplies and use special items like cans of beanz, steak in a can, and almond water.\n\nHOW TO PLAY\nThere are four difficulties that determine how many creatures or supply locations are located on the map.\nYou spawn in a room with seemingly no way out. But a never seen before mechanic makes it even more like the backrooms! Clipping!\n\nHOW TO CLIP\nSome blocks here don’t look right. Certain blocks can be completely walked through! Just make sure to avoid any if you’re in a chase.\n\nThe spawn location contains many useful supplies! If you’re on the lower difficulties you''ll get more supplies.\n\n\nCreator: HD.aNimatesYT\nYouTube: HD aNimates', 'https://www.youtube.com/@hdanimates4998', '', '33u7zHI', '', 'Adventure, Game, Horror', '6.0 MB', '1.19.10+', '1', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1312', 'Zombie Tycoon', 'Welcome to Zombie Tycoon Map, where you can become a successful entrepreneur by killing zombies and selling their flesh to buy weapons and armor.\n\nUpdates:\n- Zombie spawners are faster now \n- Improved commands \n- Earn XP and convert it into money \n- Fixed some issues with commands \n\nFeatures:\n- Shop with various items like armor, food, golden apples, and more. Swords come with the armor. \n- Purchase permanent enchantments for your sword by simply holding it after buying the desired enchantment. \n- Lobby for a seamless experience.\n\n\nCreator: BlastedSoda, Devil Angel0901, Op1292, ToweringSpoon27', 'mcpe.app', '', 'ExY9vKI', '', 'Game', '2.3 MB', '1.16.220+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1313', 'Ore Simulator', 'In this minigame map, your goal is to mine ores and sell them to earn money. Upgrade your tools and mines to increase your profits. There is also a Zombie Arena where you can battle zombies for additional money. Upgrade your pickaxe, armor and sword, and purchase enchants and effects in the mines. Follow the rule to throw all items obtained in the zombie arena (except for rotten flesh) into the lobby''s trash can and do not cheat.\n\n\nCreator: BlastedSoda', 'mcpe.app', '', 'OmhC6mh', '', 'Game', '1.4 MB', '1.16.220+', '1', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1314', 'SkyBlock', 'This is a modified skyblock map with four custom-built floating islands. The map has been visually enhanced and includes custom commands to make gameplay more enjoyable.\n\nEach island can spawn map generated mobs. The islands include a main island with a plains biome and custom trees, a floating cave with ores, an island centered on the nether for a hot atmosphere, and a floating stronghold room with end portals.\n\nThe chests on three of the islands refresh every in-game day. The main island''s chest contains various items such as a villager egg and dye. The cave''s chest contains valuable ores. The nether''s chest includes netherrack, nether quartz ore, and more.\n\nPlayers can also build their own custom block generator. Each ore has a different rarity.\n\n\nCreator: Impetus\nYoutube: @ImpetusOfficial', 'https://www.youtube.com/channel/UCV8LgrrCRcc3AJ_b4qczqlQ', '', 'T2Hh4rl', '', 'PvP, Game', '542 kB', '1.16.230+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1315', 'Vintage Mansion & Village', 'Looking for a Minecraft Mansion? Check out this Vintage style mansion, complete with a pond and surprise builds. The house is decorated, but you can customize it to your liking. There is also a Vintage Village with themed houses for various villagers, including a butcher, farmer, fisherman, librarian, cartographer, fletcher, shepherd, leather worker, cleric, stone mason, and blacksmiths. The map is perfect for server ideas or playing with friends.\n\n\nCreator: Impetus\nYoutube: @ImpetusOfficial', 'https://www.youtube.com/channel/UCV8LgrrCRcc3AJ_b4qczqlQ', '', 'x228ETX', '', 'Creation', '12.1 MB', '1.17.10+', '0', 'mcpe.app'
    );
INSERT OR REPLACE INTO maps (
      id, name, description, author, album_id, cover_id, youtube, type, size, version_name, premium, creator_links
    ) VALUES (
      '1316', 'Techno GamerZ Hardcore World | 20M Surprise', 'This is a recreation of a hardcore world of a popular youtuber Techno GamerZ: 20M surprise update.\n\nThere are multiple farms in this world:\n• iron farm\n• stone farm\n• sugar cane farm\n• wheat farm\n• wood farm\n\n\nYou can earn achievements in this world!', 'mcpe.app', '', 'Nclbccl', '', 'Survival, Castle, Youtube', '49.4 MB', '1.20+', '1', 'mcpe.app'
    );
